P_HTM[581]='*Naadhipatiyā nava, napurejāte nava, napacchājāte nava, nakamme tīṇi, navipāke nava, navippayutte nava. (Saṃkhittaṃ.)*';
P_HTM[582]='*Hetupaccayā naadhipatiyā nava. (Saṃkhittaṃ.)*';
P_HTM[583]='*Naadhipatipaccayā hetuyā nava. (Saṃkhittaṃ.)*';
P_HTM[584]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[585]='*Hetu-ārammaṇapaccayā*';
P_HTM[586]='****6*. Hetu sahetuko dhammo hetussa sahetukassa dhammassa hetupaccayena paccayo. Hetu sahetuko dhammo nahetussa sahetukassa dhammassa hetupaccayena paccayo. Hetu sahetuko dhammo hetussa sahetukassa ca nahetussa sahetukassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[587]='****7*. Hetu sahetuko dhammo hetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko dhammo nahetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko dhammo hetussa sahetukassa ca nahetussa sahetukassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[588]='*Nahetu sahetuko dhammo nahetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu sahetuko dhammo hetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu sahetuko dhammo hetussa sahetukassa ca nahetussa sahetukassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[589]='*Hetu ** sahetuko ca nahetu sahetuko ca dhammā hetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko ca nahetu sahetuko ca dhammā nahetussa sahetukassa dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko ca nahetu sahetuko ca dhammā hetussa sahetukassa ca nahetussa sahetukassa ca dhammassa ārammaṇapaccayena paccayo. (3) (Saṃkhittaṃ.)*';
P_HTM[590]='****8*. Hetuyā tīṇi, ārammaṇe nava…pe… upanissaye nava avigate nava. (Saṃkhittaṃ.)*';
P_HTM[591]='*(Yathā kusalattike pañhāvāraṃ, evaṃ vitthāretabbaṃ.)*';
