P_HTM[593]='*Paccayacatukkaṃ*';
P_HTM[594]='****9*. Hetuṃ ahetukaṃ dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[595]='*Nahetuṃ ahetukaṃ dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[596]='*Hetuṃ ahetukañca nahetuṃ ahetukañca dhammaṃ paṭicca nahetu ahetuko dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[597]='*Hetuyā tīṇi, ārammaṇe ekaṃ, avigate tīṇi. (Saṃkhittaṃ. Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
