P_HTM[600]='*Nahetu ahetuko dhammo nahetussa ahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu ahetuko dhammo hetussa ahetukassa dhammassa ārammaṇapaccayena paccayo. (2) (Saṃkhittaṃ.)*';
