P_HTM[729]='****43*. Hetuṃ saññojanaṃ dhammaṃ paṭicca…pe… hetuṃ ganthaṃ dhammaṃ paṭicca…pe… hetuṃ oghaṃ dhammaṃ paṭicca…pe… hetuṃ yogaṃ dhammaṃ paṭicca…pe… hetuṃ nīvaraṇaṃ dhammaṃ paṭicca pe… hetuṃ noparāmāsaṃ dhammaṃ paṭicca hetu no parāmāso dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[730]='*Hetuyā nava…pe… avigate nava (sabbattha gocchakaṃ vitthāretabbaṃ.)*';
