P_HTM[736]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[737]='*Nahetuṃ anārammaṇaṃ dhammaṃ paṭicca nahetu anārammaṇo dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
