P_HTM[790]='*1-82. Hetuduka-piṭṭhidukaṃ*';
P_HTM[791]='****60*. Hetuṃ dassanena pahātabbaṃ dhammaṃ paṭicca hetu dassanena pahātabbo dhammo uppajjati hetupaccayā. (Sabbattha nava, vipākaṃ natthi.)*';
P_HTM[792]='*Hetuṃ nadassanena pahātabbaṃ dhammaṃ paṭicca hetu nadassanena pahātabbo dhammo uppajjati hetupaccayā. (Sabbattha nava, vipākaṃ natthi.)*';
P_HTM[793]='****61*. Hetuṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca hetu bhāvanāya pahātabbo dhammo uppajjati hetupaccayā. (Sabbattha nava, vipākaṃ natthi.)*';
P_HTM[794]='*Hetuṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca hetu nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. (Sabbattha nava, vipākaṃ natthi.)*';
