P_HTM[817]='*2-1. Sahetukaduka-hetudukaṃ*';
P_HTM[818]='****67*. Sahetukaṃ hetuṃ dhammaṃ paṭicca sahetuko hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[819]='*Sahetukaṃ nahetuṃ dhammaṃ paṭicca sahetuko nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[820]='*Hetuyā nava.*';
P_HTM[821]='*3-1. Hetusampayuttaduka-hetudukaṃ*';
P_HTM[822]='****68*. Hetusampayuttaṃ hetuṃ dhammaṃ paṭicca hetusampayutto hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[823]='*Hetusampayuttaṃ nahetuṃ dhammaṃ paṭicca hetusampayutto nahetu dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
