P_HTM[825]='*4-1. Hetusahetukaduka-hetudukaṃ*';
P_HTM[826]='****69*. Hetuñceva sahetukañca hetuṃ dhammaṃ paṭicca hetu ceva sahetuko ca hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[827]='*Sahetukañceva na ca hetuṃ nahetuṃ dhammaṃ paṭicca sahetuko ceva na ca hetu nahetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
