P_HTM[829]='****70*. Hetuñceva hetusampayuttañca hetuṃ dhammaṃ paṭicca hetu ceva hetusampayutto ca hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
