P_HTM[838]='*Sappaccayaṃ nahetuṃ dhammaṃ paṭicca sappaccayo nahetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[839]='****73*. Saṅkhataṃ hetuṃ dhammaṃ paṭicca saṅkhato hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[840]='*Saṅkhataṃ nahetuṃ dhammaṃ paṭicca saṅkhato nahetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ).*';
P_HTM[841]='****74*. Anidassanaṃ hetuṃ dhammaṃ paṭicca anidassano hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[842]='*Anidassanaṃ nahetuṃ dhammaṃ paṭicca anidassano nahetu dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[843]='*Hetuyā tīṇi, ārammaṇe ekaṃ…pe… avigate tīṇi. (Saṃkhittaṃ.)*';
P_HTM[844]='****75*. Appaṭighaṃ hetuṃ dhammaṃ paṭicca sappaṭigho hetu dhammo uppajjati hetupaccayā. (Sabbattha ekaṃ.)*';
P_HTM[845]='*Sappaṭighaṃ ** nahetuṃ dhammaṃ paṭicca sappaṭigho nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[846]='*Appaṭighaṃ nahetuṃ dhammaṃ paṭicca appaṭigho nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[847]='*Sappaṭighaṃ nahetuñca appaṭighaṃ nahetuñca dhammaṃ paṭicca sappaṭigho nahetu dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
