P_HTM[858]='****78*. Kenaci viññeyyaṃ hetuṃ dhammaṃ paṭicca…pe… nakenaci viññeyyaṃ hetuṃ dhammaṃ paṭicca… (sabbattha nava).*';
P_HTM[859]='*Kenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca…pe… nakenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca… (sabbattha nava).*';
