P_HTM[863]='****80*. Sāsavaṃ hetuṃ dhammaṃ paṭicca…pe… anāsavaṃ hetuṃ dhammaṃ paṭicca… (sabbattha dve).*';
P_HTM[864]='*Sāsavaṃ nahetuṃ dhammaṃ paṭicca…pe… anāsavaṃ nahetuṃ dhammaṃ paṭicca…pe….*';
P_HTM[865]='****81*. Āsavasampayuttaṃ hetuṃ dhammaṃ paṭicca…pe… āsavavippayuttaṃ hetuṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
