P_HTM[924]='*Hetu-ārammaṇapaccayā*';
P_HTM[925]='****1*. Nakusalaṃ *dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā – akusalaṃ abyākataṃ ekaṃ khandhaṃ paṭicca akusalā abyākatā tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… dve khandhe paṭicca dve khandhā cittasamuṭṭhānañca rūpaṃ. Nakusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Nakusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati hetupaccayā. Nakusalaṃ dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Nakusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[926]='****2*. Naakusalaṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Naakusalaṃ dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Naakusalaṃ dhammaṃ paṭicca naabyākato dhammo uppajjati  Naakusalaṃ dhammaṃ paṭicca naakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Naakusalaṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[927]='****3*. Naabyākataṃ ** dhammaṃ paṭicca naabyākato dhammo uppajjati hetupaccayā. Naabyākataṃ dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Naabyākataṃ dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Naabyākataṃ dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Naabyākataṃ dhammaṃ paṭicca naakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Naabyākataṃ dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Cha.*';
P_HTM[928]='****4*. Nakusalañca naabyākatañca dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca naabyākato dhammo uppajjati hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca nakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[929]='****5*. Naakusalañca naabyākatañca dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca naabyākato dhammo uppajjati hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca naakusalo ca naabyākato ca dhammā uppajjanti hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[930]='****6*. Nakusalañca naakusalañca dhammaṃ paṭicca nakusalo dhammo uppajjati hetupaccayā. Nakusalañca naakusalañca dhammaṃ paṭicca naakusalo dhammo uppajjati hetupaccayā. Nakusalañca naakusalañca dhammaṃ paṭicca nakusalo ca naakusalo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
