P_HTM[938]='****8*. Nakusalo dhammo nakusalassa dhammassa hetupaccayena paccayo…pe…. Nakusalo dhammo nakusalassa dhammassa ārammaṇapaccayena paccayo. Nakusalo dhammo naakusalassa dhammassa ārammaṇapaccayena paccayo. Nakusalo dhammo naabyākatassa dhammassa ārammaṇapaccayena paccayo. Nakusalo dhammo nakusalassa ca naabyākatassa ca dhammassa ārammaṇapaccayena paccayo. Nakusalo dhammo naakusalassa ca naabyākatassa ca dhammassa ārammaṇapaccayena paccayo. Nakusalo dhammo nakusalassa ca naakusalassa ca dhammassa ārammaṇapaccayena paccayo. Cha.*';
P_HTM[939]='*Naakusalo dhammo naakusalassa dhammassa ārammaṇapaccayena paccayo…. Cha.*';
P_HTM[940]='*Naabyākato dhammo naabyākatassa dhammassa ārammaṇapaccayena paccayo…. Cha.*';
P_HTM[941]='*Nakusalo ca naabyākato ca dhammā nakusalassa dhammassa ārammaṇapaccayena paccayo…. Cha.*';
P_HTM[942]='*Naakusalo ca naabyākato ca dhammā nakusalassa dhammassa ārammaṇapaccayena paccayo…. Cha.*';
P_HTM[943]='*Nakusalo ca naakusalo ca dhammā nakusalassa dhammassa ārammaṇapaccayena paccayo…. Cha.*';
P_HTM[944]='****9*. Nakusalo dhammo nakusalassa dhammassa adhipatipaccayena paccayo… anantarapaccayena paccayo… samanantarapaccayena paccayo… sahajātapaccayena paccayo… aññamaññapaccayena paccayo… nissayapaccayena paccayo… upanissayapaccayena paccayo… purejātapaccayena paccayo. Nakusalo dhammo naakusalassa dhammassa purejātapaccayena paccayo…pe… nakusalo dhammo nakusalassa ca naakusalassa ca dhammassa purejātapaccayena paccayo. Cha.*';
P_HTM[945]='*Naakusalo ** dhammo naakusalassa dhammassa purejātapaccayena paccayo. Naakusalo dhammo nakusalassa dhammassa purejātapaccayena paccayo…pe… naakusalo dhammo nakusalassa ca naakusalassa ca dhammassa purejātapaccayena paccayo. Cha.*';
P_HTM[946]='*Nakusalo ca naakusalo ca dhammā nakusalassa dhammassa purejātapaccayena paccayo. Nakusalo ca naakusalo ca dhammā naakusalassa dhammassa purejātapaccayena paccayo…pe… nakusalo ca naakusalo ca dhammā nakusalassa ca naakusalassa ca dhammassa purejātapaccayena paccayo. Cha. (Saṃkhittaṃ.)*';
P_HTM[947]='****10*. Hetuyā ekūnatiṃsa, ārammaṇe chattiṃsa, adhipatiyā pañcatiṃsa, anantare catuttiṃsa, samanantare catuttiṃsa, sahajāte ekūnatiṃsa, aññamaññe catuvīsa, nissaye catuttiṃsa, upanissaye chattiṃsa, purejāte aṭṭhārasa, pacchājāte aṭṭhārasa, āsevane catuvīsa, kamme ekūnatiṃsa, vipāke nava, āhāre ekūnatiṃsa…pe… avigate catuttiṃsa.*';
P_HTM[948]='*(Yathā kusalattike pañhāvārassa anulomampi paccanīyampi anulomapaccanīyampi paccanīyānulomampi gaṇitaṃ evaṃ gaṇetabbaṃ.)*';
