P_HTM[951]='****11*. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nasukhāya ** vedanāya sampayuttaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto ca nadukkhāya vedanāya sampayutto ca naadukkhamasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (7)*';
P_HTM[952]='*Nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… satta.*';
