P_HTM[991]='*1-7. Paṭiccavārādi*';
P_HTM[992]='****21*. Naparittaṃ ** dhammaṃ paṭicca…pe… namahaggataṃ dhammaṃ paṭicca…pe… naappamāṇaṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[993]='*13. Parittārammaṇattikaṃ*';
P_HTM[994]='*1-7. Paṭiccavārādi*';
P_HTM[995]='****22*. Naparittārammaṇaṃ dhammaṃ paṭicca…pe… namahaggatārammaṇaṃ dhammaṃ paṭicca…pe… naappamāṇārammaṇaṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[996]='*14. Hīnattikaṃ*';
P_HTM[997]='*1-7. Paṭiccavārādi*';
P_HTM[998]='****23*. Nahīnaṃ dhammaṃ paṭicca…pe… namajjhimaṃ dhammaṃ paṭicca…pe… napaṇītaṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[999]='*15. Micchattattikaṃ*';
P_HTM[1000]='*1-7. Paṭiccavārādi*';
P_HTM[1001]='****24*. Namicchattaniyataṃ dhammaṃ paṭicca…pe… nasammattaniyataṃ dhammaṃ paṭicca…pe… naaniyataṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[1002]='*16. Maggārammaṇattikaṃ*';
P_HTM[1003]='*1-7. Paṭiccavārādi*';
P_HTM[1004]='****25*. Namaggārammaṇaṃ dhammaṃ paṭicca…pe… namaggahetukaṃ dhammaṃ paṭicca…pe… namaggādhipatiṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[1005]='*17. Uppannattikaṃ*';
P_HTM[1006]='*1-7. Paṭiccavārādi*';
P_HTM[1007]='****26*. Naanuppannaṃ dhammaṃ paṭicca naanuppanno dhammo uppajjati hetupaccayā. Naanuppannaṃ dhammaṃ paṭicca nauppādī dhammo uppajjati hetupaccayā. Naanuppannaṃ dhammaṃ paṭicca naanuppanno ca nauppādī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1008]='*Nauppādiṃ dhammaṃ paṭicca nauppādī dhammo uppajjati hetupaccayā. Nauppādiṃ dhammaṃ paṭicca naanuppanno dhammo uppajjati hetupaccayā. Nauppādiṃ dhammaṃ paṭicca naanuppanno ca nauppādī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1009]='*Naanuppannañca nauppādiñca dhammaṃ paṭicca naanuppanno dhammo uppajjati hetupaccayā. Naanuppannañca nauppādiñca dhammaṃ paṭicca nauppādī dhammo uppajjati hetupaccayā. Naanuppannañca nauppādiñca dhammaṃ paṭicca naanuppanno ca nauppādī ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1010]='*18. Atītattikaṃ*';
P_HTM[1011]='*1-7. Paṭiccavārādi*';
P_HTM[1012]='****27*. Naatītaṃ ** dhammaṃ paṭicca naatīto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1013]='*Naatīto dhammo naatītassa dhammassa hetupaccayena paccayo. Naatīto dhammo naanāgatassa dhammassa hetupaccayena paccayo. Naatīto dhammo naatītassa ca naanāgatassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1014]='*Naanāgato dhammo naanāgatassa dhammassa hetupaccayena paccayo. Naanāgato dhammo naatītassa dhammassa hetupaccayena paccayo. Naanāgato dhammo naatītassa ca naanāgatassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1015]='*Naatīto ca naanāgato ca dhammā naatītassa dhammassa hetupaccayena paccayo. Naatīto ca naanāgato ca dhammā naanāgatassa dhammassa hetupaccayena paccayo. Naatīto ca naanāgato ca dhammā naatītassa ca naanāgatassa ca dhammassa hetupaccayena paccayo. (3) (Saṃkhittaṃ.)*';
P_HTM[1016]='*19. Atītārammaṇattikaṃ*';
P_HTM[1017]='*1-7. Paṭiccavārādi*';
P_HTM[1018]='****28*. Naatītārammaṇaṃ * dhammaṃ paṭicca…pe… naanāgatārammaṇaṃ dhammaṃ paṭicca…pe… napaccuppannārammaṇaṃ dhammaṃ paṭicca… (saṃkhittaṃ).*';
P_HTM[1019]='*20. Ajjhattattikaṃ*';
P_HTM[1020]='*1-7. Paṭiccavārādi*';
P_HTM[1021]='****29*. Naajjhattaṃ dhammaṃ paṭicca naajjhatto dhammo uppajjati hetupaccayā.*';
P_HTM[1022]='*Nabahiddhā dhammaṃ paṭicca nabahiddhā dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1023]='*21. Ajjhattārammaṇattikaṃ*';
P_HTM[1024]='*1-7. Paṭiccavārādi*';
P_HTM[1025]='****30*. Naajjhattārammaṇaṃ dhammaṃ paṭicca naajjhattārammaṇo dhammo uppajjati hetupaccayā. Naajjhattārammaṇaṃ dhammaṃ paṭicca nabahiddhārammaṇo dhammo uppajjati hetupaccayā. (2)*';
P_HTM[1026]='*Nabahiddhārammaṇaṃ ** dhammaṃ paṭicca nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Nabahiddhārammaṇaṃ dhammaṃ paṭicca naajjhattārammaṇo dhammo uppajjati hetupaccayā. (2) (Saṃkhittaṃ.)*';
P_HTM[1027]='*22. Sanidassanattikaṃ*';
P_HTM[1028]='*1-7. Paṭiccavārādi*';
P_HTM[1029]='****31*. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1030]='****32*. Naanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho ca naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho ca naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1031]='****33*. Naanidassanaappaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Naanidassanaappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Naanidassanaappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho dhammo uppajjati hetupaccayā…. Cha.*';
P_HTM[1032]='*Nasanidassanasappaṭighañca naanidassanaappaṭighañca dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā…. Cha.*';
P_HTM[1033]='*Nasanidassanasappaṭighañca **naanidassanasappaṭighañca dhammaṃ paṭicca nasanidassanasappaṭigho dhammo uppajjati hetupaccayā…. Cha. (Saṃkhittaṃ.)*';
P_HTM[1034]='****34*. Hetuyā tiṃsa…pe… avigate tiṃsa.*';
P_HTM[1035]='*(Yathā kusalattike sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi pañhāvārampi gaṇitaṃ evaṃ gaṇetabbaṃ.)*';
P_HTM[1036]='*Dhammapaccanīye tikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[1037]='*Dhammapaccanīye dukapaṭṭhānaṃ*';
P_HTM[1038]='*1. Hetudukaṃ*';
P_HTM[1039]='*1-7. Paṭiccavārādi*';
P_HTM[1040]='*Paccayacatukkaṃ*';
P_HTM[1041]='*Hetupaccayo*';
P_HTM[1042]='****1*. Nahetuṃ **dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā – nahetuṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… dve khandhe paṭicca dve khandhā cittasamuṭṭhānañca rūpaṃ; paṭisandhikkhaṇe…pe… (yāva mahābhūtā). Nahetuṃ dhammaṃ paṭicca na nahetu dhammo uppajjati hetupaccayā – nahetū khandhe paṭicca hetū; paṭisandhikkhaṇe…pe… nahetuṃ dhammaṃ paṭicca nahetu ca na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1043]='*Na nahetuṃ dhammaṃ paṭicca na nahetu dhammo uppajjati hetupaccayā. Na nahetuṃ dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Na nahetuṃ dhammaṃ paṭicca nahetu ca na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1044]='*Nahetuñca na nahetuñca dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Nahetuñca na nahetuñca dhammaṃ paṭicca na nahetu dhammo uppajjati hetupaccayā. Nahetuñca na nahetuñca dhammaṃ paṭicca nahetu ca na nahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1045]='****2*. Hetuyā nava, ārammaṇe nava…pe… avigate nava.*';
P_HTM[1046]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[1047]='*Hetu-ārammaṇapaccayā*';
P_HTM[1048]='****3*. Na ** nahetu dhammo na nahetussa dhammassa hetupaccayena paccayo. Na nahetu dhammo nahetussa dhammassa hetupaccayena paccayo. Na nahetu dhammo nahetussa ca na nahetussa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1049]='*Nahetu dhammo nahetussa dhammassa ārammaṇapaccayena paccayo. Nahetu dhammo na nahetussa dhammassa ārammaṇapaccayena paccayo. Nahetu dhammo nahetussa ca na nahetussa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[1050]='*Na nahetu dhammo na nahetussa dhammassa ārammaṇapaccayena paccayo. Na nahetu dhammo nahetussa dhammassa ārammaṇapaccayena paccayo. Na nahetu dhammo nahetussa ca na nahetussa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[1051]='*Nahetu ca na nahetu ca dhammā nahetussa dhammassa ārammaṇapaccayena paccayo. Nahetu ca na nahetu ca dhammā na nahetussa dhammassa ārammaṇapaccayena paccayo. Nahetu ca na nahetu ca dhammā nahetussa ca na nahetussa ca dhammassa ārammaṇapaccayena paccayo. (3) (Saṃkhittaṃ.)*';
P_HTM[1052]='****4*. Hetuyā tīṇi, ārammaṇe nava…pe… avigate nava. (Yathā kusalattike pañhāvāraṃ, evaṃ vitthāretabbaṃ.)*';
P_HTM[1053]='*2. Sahetukadukaṃ*';
P_HTM[1054]='*1-7. Paṭiccavārādi*';
P_HTM[1055]='*Paccayacatukkaṃ*';
P_HTM[1056]='*Hetupaccayo*';
P_HTM[1057]='****5*. Nasahetukaṃ dhammaṃ paṭicca nasahetuko dhammo uppajjati hetupaccayā – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca cittasamuṭṭhānaṃ rūpaṃ, ekaṃ mahābhūtaṃ paṭicca tayo mahābhūtā…pe… dve mahābhūte paṭicca dve mahābhūtā, mahābhūte paṭicca cittasamuṭṭhānaṃ rūpaṃ kaṭattārūpaṃ upādārūpaṃ. Nasahetukaṃ dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca sampayuttakā khandhā; paṭisandhikkhaṇe vatthuṃ paṭicca sahetukā khandhā. Nasahetukaṃ dhammaṃ paṭicca nasahetuko ca naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1058]='*Naahetukaṃ ** dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1059]='*Nasahetukañca naahetukañca dhammaṃ paṭicca nasahetuko dhammo uppajjati hetupaccayā. Nasahetukañca naahetukañca dhammaṃ paṭicca naahetuko dhammo uppajjati hetupaccayā. Nasahetukañca naahetukañca dhammaṃ paṭicca nasahetuko ca naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1060]='****6*. Hetuyā nava, ārammaṇe cha…pe… avigate nava.*';
P_HTM[1061]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[1062]='*Hetu-ārammaṇapaccayā*';
P_HTM[1063]='****7*. Nasahetuko dhammo nasahetukassa dhammassa hetupaccayena paccayo. Nasahetuko dhammo naahetukassa dhammassa hetupaccayena paccayo. Nasahetuko dhammo nasahetukassa ca naahetukassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1064]='*Naahetuko dhammo naahetukassa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[1065]='*Nasahetuko dhammo nasahetukassa dhammassa ārammaṇapaccayena paccayo (saṃkhittaṃ.)*';
P_HTM[1066]='****8*. Hetuyā cha, ārammaṇe nava…pe… avigate nava.*';
P_HTM[1067]='*(Yathā kusalattike pañhāvāraṃ, evaṃ vitthāretabbaṃ.)*';
P_HTM[1068]='*3. Hetusampayuttadukaṃ*';
P_HTM[1069]='*1-7. Paṭiccavārādi*';
P_HTM[1070]='****9*. Nahetusampayuttaṃ dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā. Nahetusampayuttaṃ dhammaṃ paṭicca nahetuvippayutto dhammo uppajjati hetupaccayā. Nahetusampayuttaṃ dhammaṃ paṭicca nahetusampayutto ca nahetuvippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1071]='*Nahetuvippayuttaṃ dhammaṃ paṭicca nahetuvippayutto dhammo uppajjati hetupaccayā. Nahetuvippayuttaṃ dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā**. Nahetuvippayuttaṃ dhammaṃ paṭicca nahetusampayutto ca nahetuvippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1072]='*Nahetusampayuttañca nahetuvippayuttañca dhammaṃ paṭicca nahetusampayutto dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1073]='****10*. Hetuyā nava, ārammaṇe cha…pe… avigate nava. (Sahajātavārepi…pe… pañhāvārepi sabbattha vitthāretabbaṃ.)*';
P_HTM[1074]='*4. Hetusahetukadukaṃ*';
P_HTM[1075]='*1-7. Paṭiccavārādi*';
P_HTM[1076]='****11*. Nahetuñceva naahetukañca dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca dhammaṃ paṭicca naahetuko ceva na nahetu ca dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca dhammaṃ paṭicca nahetu ceva naahetuko ca naahetuko ceva na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1077]='*Naahetukañceva na nahetuñca dhammaṃ paṭicca naahetuko ceva na nahetu ca dhammo uppajjati hetupaccayā. Naahetukañceva na nahetuñca dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Naahetukañceva na nahetuñca dhammaṃ paṭicca nahetu ceva naahetuko ca naahetuko ceva na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1078]='*Nahetuñceva naahetukañca naahetukañceva na nahetuñca dhammaṃ paṭicca nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1079]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava.*';
P_HTM[1080]='*(Sahajātavārepi…pe… pañhāvārepi sabbattha vitthāro.)*';
P_HTM[1081]='*5. Hetuhetusampayuttadukaṃ*';
P_HTM[1082]='*1-7. Paṭiccavārādi*';
P_HTM[1083]='****12*. Nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca nahetuvippayutto ceva na nahetu ca dhammo uppajjati hetupaccayā**. Nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetuvippayutto ceva na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1084]='*Nahetuvippayuttañceva na nahetuñca dhammaṃ paṭicca nahetuvippayutto ceva na nahetu ca dhammo uppajjati hetupaccayā. Nahetuvippayuttañceva na nahetuñca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Nahetuvippayuttañceva na nahetuñca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetuvippayutto ceva na nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1085]='*Nahetuñceva nahetuvippayuttañca nahetuvippayuttañceva na nahetuñca dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1086]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1087]='*6. Nahetusahetukadukaṃ*';
P_HTM[1088]='*1-7. Paṭiccavārādi*';
P_HTM[1089]='****13*. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā – ekaṃ mahābhūtaṃ paṭicca tayo mahābhūtā…pe…. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā – paṭisandhikkhaṇe vatthuṃ paṭicca nahetusahetukā khandhā. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu nasahetuko ca nahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1090]='*Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. Nahetuṃ naahetukaṃ dhammaṃ paṭicca nahetu nasahetuko ca nahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1091]='*Nahetuṃ nasahetukañca nahetuṃ naahetukañca dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. Nahetuṃ nasahetukañca nahetuṃ naahetukañca dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. Nahetuṃ nasahetukañca nahetuṃ naahetukañca dhammaṃ paṭicca ** nahetu nasahetuko ca nahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1092]='****14*. Hetuyā nava, ārammaṇe cattāri…pe… avigate nava.*';
P_HTM[1093]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[1094]='*Ārammaṇapaccayo*';
P_HTM[1095]='****15*. Nahetu nasahetuko dhammo nahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu nasahetuko dhammo nahetussa naahetukassa dhammassa ārammaṇapaccayena paccayo. (2)*';
P_HTM[1096]='*Nahetu naahetuko dhammo nahetussa naahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu naahetuko dhammo nahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. (2) (Saṃkhittaṃ.)*';
P_HTM[1097]='****16*. Ārammaṇe cattāri…pe… avigate satta.*';
P_HTM[1098]='*Hetugocchakaṃ niṭṭhitaṃ.*';
P_HTM[1099]='*7. Sappaccayadukaṃ*';
P_HTM[1100]='*1-7. Paṭiccavārādi*';
P_HTM[1101]='****17*. Naappaccayaṃ dhammaṃ paṭicca naappaccayo dhammo uppajjati hetupaccayā.*';
P_HTM[1102]='*Hetuyā ekaṃ. (Sabbattha vitthāro.)*';
P_HTM[1103]='****18*. Naappaccayo dhammo naappaccayassa dhammassa hetupaccayena paccayo.*';
P_HTM[1104]='*Nasappaccayo dhammo naappaccayassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[1105]='*Hetuyā ekaṃ, ārammaṇe dve. (Sabbattha vitthāro.)*';
P_HTM[1106]='*8. Saṅkhatadukaṃ*';
P_HTM[1107]='*1-7. Paṭiccavārādi*';
P_HTM[1108]='****19*. Naasaṅkhataṃ dhammaṃ paṭicca naasaṅkhato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Sappaccayadukasadisaṃ.)*';
P_HTM[1109]='*9. Sanidassanadukaṃ*';
P_HTM[1110]='*1-7. Paṭiccavārādi*';
P_HTM[1111]='****20*. Nasanidassanaṃ ** dhammaṃ paṭicca nasanidassano dhammo uppajjati hetupaccayā. Nasanidassanaṃ dhammaṃ paṭicca naanidassano dhammo uppajjati hetupaccayā. Nasanidassanaṃ dhammaṃ paṭicca nasanidassano ca naanidassano ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1112]='*Hetuyā tīṇi.*';
P_HTM[1113]='*10. Sappaṭighadukaṃ*';
P_HTM[1114]='*1-7. Paṭiccavārādi*';
P_HTM[1115]='****21*. Nasappaṭighaṃ dhammaṃ paṭicca nasappaṭigho dhammo uppajjati  Nasappaṭighaṃ dhammaṃ paṭicca naappaṭigho dhammo uppajjati hetupaccayā. Nasappaṭighaṃ dhammaṃ paṭicca nasappaṭigho ca naappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1116]='*Naappaṭighaṃ dhammaṃ paṭicca naappaṭigho dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1117]='*Nasappaṭighañca naappaṭighañca dhammaṃ paṭicca nasappaṭigho dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1118]='*Hetuyā nava, ārammaṇe ekaṃ.*';
P_HTM[1119]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[1120]='****22*. Nasappaṭigho dhammo nasappaṭighassa dhammassa hetupaccayena paccayo. Nasappaṭigho dhammo naappaṭighassa dhammassa hetupaccayena paccayo. Nasappaṭigho dhammo nasappaṭighassa ca naappaṭighassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1121]='*Nasappaṭigho dhammo nasappaṭighassa dhammassa ārammaṇapaccayena paccayo. Naappaṭigho dhammo nasappaṭighassa dhammassa ārammaṇapaccayena paccayo. (2) (Saṃkhittaṃ.)*';
P_HTM[1122]='****23*. Hetuyā tīṇi, ārammaṇe dve, adhipatiyā cattāri…pe… avigate nava.*';
P_HTM[1123]='*11. Rūpīdukaṃ*';
P_HTM[1124]='*1-7. Paṭiccavārādi*';
P_HTM[1125]='****24*. Narūpiṃ ** dhammaṃ paṭicca narūpī dhammo uppajjati hetupaccayā. Narūpiṃ dhammaṃ paṭicca naarūpī dhammo uppajjati hetupaccayā. Narūpiṃ dhammaṃ paṭicca narūpī ca naarūpī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1126]='*Naarūpiṃ dhammaṃ paṭicca naarūpī dhammo uppajjati  Naarūpiṃ dhammaṃ paṭicca narūpī dhammo uppajjati hetupaccayā. Naarūpiṃ dhammaṃ paṭicca narūpī ca naarūpī ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1127]='*Narūpiñca naarūpiñca dhammaṃ paṭicca narūpī dhammo uppajjati hetupaccayā. Narūpiñca naarūpiñca dhammaṃ paṭicca naarūpī dhammo uppajjati hetupaccayā. Narūpiñca naarūpiñca dhammaṃ paṭicca narūpī ca naarūpī ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1128]='****25*. Hetuyā nava, ārammaṇe tīṇi…pe… avigate nava.*';
P_HTM[1129]='*(Sahajātavārepi…pe… pañhāvārepi sabbattha vitthāro.)*';
P_HTM[1130]='*12. Lokiyadukaṃ*';
P_HTM[1131]='*1-7. Paṭiccavārādi*';
P_HTM[1132]='****26*. Nalokiyaṃ dhammaṃ paṭicca nalokiyo dhammo uppajjati hetupaccayā. Nalokiyaṃ dhammaṃ paṭicca nalokuttaro dhammo uppajjati hetupaccayā. Nalokiyaṃ dhammaṃ paṭicca nalokiyo ca nalokuttaro ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1133]='*Nalokuttaraṃ dhammaṃ paṭicca nalokuttaro dhammo uppajjati hetupaccayā.*';
P_HTM[1134]='*Nalokiyañca nalokuttarañca dhammaṃ paṭicca nalokuttaro dhammo uppajjati hetupaccayā. (2) (Saṃkhittaṃ.)*';
P_HTM[1135]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[1136]='*13. Kenaciviññeyyadukaṃ*';
P_HTM[1137]='*1-7. Paṭiccavārādi*';
P_HTM[1138]='****27*. Nakenaci viññeyyaṃ dhammaṃ paṭicca nakenaci viññeyyo dhammo uppajjati hetupaccayā. Nakenaci viññeyyaṃ dhammaṃ paṭicca nanakenaci viññeyyo dhammo uppajjati hetupaccayā. Nakenaci viññeyyaṃ dhammaṃ paṭicca nakenaci viññeyyo ca nanakenaci viññeyyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1139]='*Nanakenaci ** viññeyyaṃ dhammaṃ paṭicca nanakenaci viññeyyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1140]='*Nakenaci viññeyyañca nanakenaci viññeyyañca dhammaṃ paṭicca nakenaci viññeyyo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1141]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1142]='*Cūḷantaradukaṃ niṭṭhitaṃ.*';
P_HTM[1143]='*14. Āsavadukaṃ*';
P_HTM[1144]='*1-7. Paṭiccavārādi*';
P_HTM[1145]='****28*. Noāsavaṃ dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Noāsavaṃ dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā. Noāsavaṃ dhammaṃ paṭicca noāsavo ca nanoāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1146]='*Nanoāsavaṃ dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1147]='*Noāsavañca nanoāsavañca dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Noāsavañca nanoāsavañca dhammaṃ paṭicca nanoāsavo dhammo uppajjati hetupaccayā. Noāsavañca nanoāsavañca dhammaṃ paṭicca noāsavo ca nanoāsavo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1148]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava (sabbattha vitthāro).*';
P_HTM[1149]='*15. Sāsavadukaṃ*';
P_HTM[1150]='*1-7. Paṭiccavārādi*';
P_HTM[1151]='****29*. Nasāsavaṃ dhammaṃ paṭicca nasāsavo dhammo uppajjati  Nasāsavaṃ dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. Nasāsavaṃ dhammaṃ paṭicca nasāsavo ca naanāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1152]='*Naanāsavaṃ dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1153]='*Nasāsavañca ** naanāsavañca dhammaṃ paṭicca naanāsavo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1154]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca (sabbattha vitthāro).*';
P_HTM[1155]='*16. Āsavasampayuttadukaṃ*';
P_HTM[1156]='*1-7. Paṭiccavārādi*';
P_HTM[1157]='****30*. Naāsavasampayuttaṃ dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Naāsavasampayuttaṃ dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Naāsavasampayuttaṃ dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1158]='*Naāsavavippayuttaṃ dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Naāsavavippayuttaṃ dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Naāsavavippayuttaṃ dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1159]='*Naāsavasampayuttañca naāsavavippayuttañca dhammaṃ paṭicca naāsavasampayutto dhammo uppajjati hetupaccayā. Naāsavasampayuttañca naāsavavippayuttañca dhammaṃ paṭicca naāsavavippayutto dhammo uppajjati hetupaccayā. Naāsavasampayuttañca naāsavavippayuttañca dhammaṃ paṭicca naāsavasampayutto ca naāsavavippayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1160]='*Hetuyā nava, ārammaṇe cha…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1161]='*17. Āsavasāsavadukaṃ*';
P_HTM[1162]='*1-7. Paṭiccavārādi*';
P_HTM[1163]='****31*. Naāsavañceva naanāsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā. Naāsavañceva naanāsavañca dhammaṃ paṭicca naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā. Naāsavañceva naanāsavañca dhammaṃ paṭicca noāsavo ceva naanāsavo ca naanāsavo ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1164]='*Naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā. Naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā. Naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca naāsavo ceva naanāsavo ** ca naanāsavo ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1165]='*Naāsavañceva naanāsavañca naanāsavañceva nanoāsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā. Naāsavañceva naanāsavañca naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā. Naāsavañceva naanāsavañca naanāsavañceva nanoāsavañca dhammaṃ paṭicca naāsavo ceva naanāsavo ca naanāsavo ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1166]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava (sabbattha vitthāro).*';
P_HTM[1167]='*18. Āsavaāsavasampayuttadukaṃ*';
P_HTM[1168]='*1-7. Paṭiccavārādi*';
P_HTM[1169]='****32*. Naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā. Naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca naāsavavippayutto ceva nano ca āsavo dhammo uppajjati hetupaccayā. Naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca naāsavavippayutto ceva nanoāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1170]='*Naāsavavippayuttañceva nanoāsavañca dhammaṃ paṭicca naāsavavippayutto ceva nanoāsavo ca dhammo uppajjati hetupaccayā. Naāsavavippayuttañceva nanoāsavañca dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā. Naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca naāsavavippayutto ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1171]='*Naāsavañceva naāsavavippayuttañca naāsavavippayuttañceva nanoāsavañca dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā. Naāsavañceva naāsavavippayuttañca naāsavavippayuttañceva nano ca āsavañca dhammaṃ paṭicca naāsavavippayutto ceva nano ca āsavo dhammo uppajjati hetupaccayā. Naāsavañceva naāsavavippayuttañca naāsavavippayuttañceva nano ca āsavañca dhammaṃ paṭicca naāsavo ** ceva naāsavavippayutto ca naāsavavippayutto ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1172]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1173]='*19. Āsavavippayuttasāsavadukaṃ*';
P_HTM[1174]='*1-7. Paṭiccavārādi*';
P_HTM[1175]='****33*. Āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca āsavavippayutto nasāsavo dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca āsavavippayutto nasāsavo ca āsavavippayutto naanāsavo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1176]='*Āsavavippayuttaṃ naanāsavaṃ dhammaṃ paṭicca āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1177]='*Āsavavippayuttaṃ nasāsavañca āsavavippayuttaṃ naanāsavañca dhammaṃ paṭicca āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1178]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[1179]='*Āsavagocchakaṃ niṭṭhitaṃ.*';
P_HTM[1180]='*20. Saññojanadukaṃ*';
P_HTM[1181]='****34*. Nosaññojanaṃ dhammaṃ paṭicca nosaññojano dhammo uppajjati hetupaccayā. Nosaññojanaṃ dhammaṃ paṭicca nanosaññojano dhammo uppajjati hetupaccayā. Nosaññojanaṃ dhammaṃ paṭicca nosaññojano ca nanosaññojano ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1182]='*Nanosaññojanaṃ dhammaṃ paṭicca nanosaññojano dhammo uppajjati hetupaccayā. Nanosaññojanaṃ dhammaṃ paṭicca nosaññojano dhammo uppajjati hetupaccayā. Nanosaññojanaṃ dhammaṃ paṭicca nosaññojano ca nanosaññojano ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1183]='*Nosaññojanañca nanosaññojanañca dhammaṃ paṭicca nosaññojano dhammo uppajjati hetupaccayā. Nosaññojanañca nanosaññojanañca dhammaṃ ** paṭicca nanosaññojano dhammo uppajjati hetupaccayā. Nosaññojanañca nanosaññojanañca dhammaṃ paṭicca nosaññojano ca nanosaññojano ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1184]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1185]='*21. Saññojaniyadukaṃ*';
P_HTM[1186]='****35*. Nasaññojaniyaṃ dhammaṃ paṭicca nasaññojaniyo dhammo uppajjati hetupaccayā. Nasaññojaniyaṃ dhammaṃ paṭicca naasaññojaniyo dhammo uppajjati hetupaccayā. Nasaññojaniyaṃ dhammaṃ paṭicca nasaññojaniyo ca naasaññojaniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1187]='*Naasaññojaniyaṃ dhammaṃ paṭicca naasaññojaniyo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1188]='*Nasaññojaniyañca naasaññojaniyañca dhammaṃ paṭicca naasaññojaniyo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1189]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[1190]='*22. Saññojanasampayuttadukaṃ*';
P_HTM[1191]='****36*. Nasaññojanasampayuttaṃ dhammaṃ paṭicca nasaññojanasampayutto dhammo uppajjati hetupaccayā. Nasaññojanasampayuttaṃ dhammaṃ paṭicca nasaññojanavippayutto dhammo uppajjati hetupaccayā. Nasaññojanasampayuttaṃ dhammaṃ paṭicca nasaññojanasampayutto ca nasaññojanavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1192]='*Nasaññojanavippayuttaṃ dhammaṃ paṭicca nasaññojanavippayutto dhammo uppajjati hetupaccayā. Nasaññojanavippayuttaṃ dhammaṃ paṭicca nasaññojanasampayutto dhammo uppajjati hetupaccayā. Nasaññojanavippayuttaṃ dhammaṃ paṭicca nasaññojanasampayutto ca nasaññojanavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1193]='*Nasaññojanasampayuttañca nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojanasampayutto dhammo uppajjati hetupaccayā. Nasaññojanasampayuttañca nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojanavippayutto dhammo uppajjati hetupaccayā**. Nasaññojanasampayuttañca nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojanasampayutto ca nasaññojanavippayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1194]='*Hetuyā nava, ārammaṇe cha…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1195]='*23. Saññojanasaññojaniyadukaṃ*';
P_HTM[1196]='****37*. Nasaññojanañceva naasaññojaniyañca dhammaṃ paṭicca nasaññojano ceva naasaññojaniyo ca dhammo uppajjati hetupaccayā. Nasaññojanañceva naasaññojaniyañca dhammaṃ paṭicca naasaññojaniyo ceva nanoasaññojano ca dhammo uppajjati hetupaccayā. Nasaññojanañceva naasaññojaniyañca dhammaṃ paṭicca nasaññojano ceva naasaññojaniyo ca naasaññojaniyo ceva nano ca saññojano ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1197]='*Naasaññojaniyañceva nano ca saññojanaṃ dhammaṃ paṭicca naasaññojaniyo ceva nano ca saññojano dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1198]='*Nasaññojanañceva naasaññojaniyañca naasaññojaniyañceva nanosaññojanañca dhammaṃ paṭicca nasaññojano ceva naasaññojaniyo ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1199]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha )*';
P_HTM[1200]='*24. Saññojanasaññojanasampayuttadukaṃ*';
P_HTM[1201]='****38*. Nasaññojanañceva nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojano ceva nasaññojanavippayutto ca dhammo uppajjati hetupaccayā. Nasaññojanañceva nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojanavippayutto ceva nanosaññojano ca dhammo uppajjati hetupaccayā. Nasaññojanañceva nasaññojanavippayuttañca dhammaṃ paṭicca nasaññojano ceva nasaññojanavippayutto ca nasaññojanavippayutto ceva nano ca saññojano ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1202]='*Nasaññojanavippayuttañceva ** nano ca saññojanaṃ dhammaṃ paṭicca nasaññojanavippayutto ceva nano ca saññojano dhammo uppajjati hetupaccayā. Nasaññojanavippayuttañceva nano ca saññojanaṃ dhammaṃ paṭicca nasaññojano ceva nasaññojanavippayutto ca dhammo uppajjati hetupaccayā. Nasaññojanavippayuttañceva nano ca saññojanaṃ dhammaṃ paṭicca nasaññojano ceva nasaññojanavippayutto ca nasaññojanavippayutto ceva nano ca saññojano ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1203]='*Nasaññojanañceva nasaññojanavippayuttañca nasaññojanavippayuttañceva nano ca saññojanañca dhammaṃ paṭicca nasaññojano ceva nasaññojanavippayutto ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1204]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1205]='*25. Saññojanavippayuttasaññojaniyadukaṃ*';
P_HTM[1206]='****39*. Saññojanavippayuttaṃ nasaññojaniyaṃ dhammaṃ paṭicca saññojanavippayutto nasaññojaniyo dhammo uppajjati hetupaccayā. Saññojanavippayuttaṃ nasaññojaniyaṃ dhammaṃ paṭicca saññojanavippayutto naasaññojaniyo dhammo uppajjati hetupaccayā. Saññojanavippayuttaṃ nasaññojaniyaṃ dhammaṃ paṭicca saññojanavippayutto nasaññojaniyo ca saññojanavippayutto naasaññojaniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1207]='*Saññojanavippayuttaṃ naasaññojaniyaṃ dhammaṃ paṭicca saññojanavippayutto naasaññojaniyo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1208]='*Saññojanavippayutto nasaññojaniyañca saññojanavippayuttaṃ naasaññojaniyañca dhammaṃ paṭicca saññojanavippayutto naasaññojaniyo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1209]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[1210]='*Saññojanagocchakaṃ niṭṭhitaṃ.*';
P_HTM[1211]='*26. Ganthadukaṃ*';
P_HTM[1212]='****40*. Noganthaṃ ** dhammaṃ paṭicca nogantho dhammo uppajjati hetupaccayā. Noganthaṃ dhammaṃ paṭicca nanogantho dhammo uppajjati hetupaccayā. Noganthaṃ dhammaṃ paṭicca nogantho ca nanogantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1213]='*Nanoganthaṃ dhammaṃ paṭicca nanogantho dhammo uppajjati hetupaccayā. Nanoganthaṃ dhammaṃ paṭicca nogantho dhammo uppajjati hetupaccayā. Nanoganthaṃ dhammaṃ paṭicca nogantho ca nanogantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1214]='*Noganthañca nanoganthañca dhammaṃ paṭicca nogantho dhammo uppajjati hetupaccayā. Noganthañca nanoganthañca dhammaṃ paṭicca nanogantho dhammo uppajjati hetupaccayā. Noganthañca nanoganthañca dhammaṃ paṭicca nogantho ca nanogantho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1215]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1216]='*27. Ganthaniyadukaṃ*';
P_HTM[1217]='****41*. Naganthaniyaṃ dhammaṃ paṭicca naganthaniyo dhammo uppajjati hetupaccayā. Naganthaniyaṃ dhammaṃ paṭicca naaganthaniyo dhammo uppajjati hetupaccayā. Naganthaniyaṃ dhammaṃ paṭicca naganthaniyo ca naaganthaniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1218]='*Naaganthaniyaṃ dhammaṃ paṭicca naaganthaniyo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1219]='*Naganthaniyañca naaganthaniyañca dhammaṃ paṭicca naaganthaniyo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1220]='*Hetuyā pañca…pe… avigate pañca. (Sabbattha pañca.)*';
P_HTM[1221]='*28. Ganthasampayuttadukaṃ*';
P_HTM[1222]='****42*. Naganthasampayuttaṃ dhammaṃ paṭicca naganthasampayutto dhammo uppajjati hetupaccayā. Naganthasampayuttaṃ dhammaṃ paṭicca naganthavippayutto dhammo uppajjati hetupaccayā. Naganthasampayuttaṃ dhammaṃ paṭicca naganthasampayutto ca naganthavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1223]='*Naganthavippayuttaṃ ** dhammaṃ paṭicca naganthavippayutto dhammo uppajjati hetupaccayā. Naganthavippayuttaṃ dhammaṃ paṭicca naganthasampayutto dhammo uppajjati hetupaccayā. Naganthavippayuttaṃ dhammaṃ paṭicca naganthasampayutto ca naganthavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1224]='*Naganthasampayuttañca naganthavippayuttañca dhammaṃ paṭicca naganthasampayutto dhammo uppajjati hetupaccayā. Naganthasampayuttañca naganthavippayuttañca dhammaṃ paṭicca naganthavippayutto dhammo uppajjati hetupaccayā. Naganthasampayuttañca naganthavippayuttañca dhammaṃ paṭicca naganthasampayutto ca naganthavippayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1225]='*Hetuyā nava, ārammaṇe cha, adhipatiyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1226]='*29. Ganthaganthaniyadukaṃ*';
P_HTM[1227]='****43*. Naganthañceva naaganthaniyañca dhammaṃ paṭicca nagantho ceva naaganthaniyo ca dhammo uppajjati hetupaccayā. Naganthañceva naaganthaniyañca dhammaṃ paṭicca naaganthaniyo ceva nano ca gantho dhammo uppajjati hetupaccayā. Naganthañceva naaganthaniyañca dhammaṃ paṭicca nagantho ceva naaganthaniyo ca naaganthaniyo ceva nano ca gantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1228]='*Naaganthaniyañceva nano ca ganthaṃ dhammaṃ paṭicca naaganthaniyo ceva nanogantho ca dhammo uppajjati hetupaccayā. Naaganthaniyañceva nano ca ganthaṃ dhammaṃ paṭicca nagantho ceva naaganthaniyo ca dhammo uppajjati hetupaccayā. Naaganthaniyañceva nano ca ganthaṃ dhammaṃ paṭicca nagantho ceva naaganthaniyo ca naaganthaniyo ceva nano ca gantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1229]='*Naganthañceva naaganthaniyañca naaganthaniyañceva nano ca ganthañca dhammaṃ paṭicca nagantho ceva naaganthaniyo ca dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1230]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1231]='*30. Ganthaganthasampayuttadukaṃ*';
P_HTM[1232]='****44*. Naganthañceva ** naganthavippayuttañca dhammaṃ paṭicca nagantho ceva naganthavippayutto ca dhammo uppajjati hetupaccayā. Naganthañceva naganthavippayuttañca dhammaṃ paṭicca naganthavippayutto ceva nano ca gantho dhammo uppajjati hetupaccayā. Naganthañceva naganthavippayuttañca dhammaṃ paṭicca nagantho ceva naganthavippayutto ca naganthavippayutto ceva nano ca gantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1233]='*Naganthavippayuttañceva nano ca ganthaṃ dhammaṃ paṭicca naganthavippayutto ceva nano ca gantho dhammo uppajjati hetupaccayā. Naganthavippayuttañceva nano ca ganthaṃ dhammaṃ paṭicca nagantho ceva naganthavippayutto ca dhammo uppajjati hetupaccayā. Naganthavippayuttañceva nano ca ganthaṃ dhammaṃ paṭicca nagantho ceva naganthavippayutto ca naganthavippayutto ceva nano ca gantho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1234]='*Naganthañceva naganthavippayuttañca naganthavippayuttañceva nano ca ganthañca dhammaṃ paṭicca nagantho ceva naganthavippayutto ca dhammo uppajjati hetupaccayā. Naganthañceva naganthavippayuttañca naganthavippayuttañceva nano ca ganthañca dhammaṃ paṭicca naganthavippayutto ceva nano ca gantho dhammo uppajjati hetupaccayā. Naganthañceva naganthavippayuttañca naganthavippayuttañceva nano ca ganthañca dhammaṃ paṭicca nagantho ceva naganthavippayutto ca naganthavippayutto ceva nano ca gantho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1235]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1236]='*31. Ganthavippayuttaganthaniyadukaṃ*';
P_HTM[1237]='****45*. Ganthavippayuttaṃ naganthaniyaṃ dhammaṃ paṭicca ganthavippayutto naganthaniyo dhammo uppajjati hetupaccayā. Ganthavippayuttaṃ naganthaniyaṃ dhammaṃ paṭicca ganthavippayutto naaganthaniyo dhammo uppajjati hetupaccayā. Ganthavippayuttaṃ naganthaniyaṃ dhammaṃ paṭicca ganthavippayutto naganthaniyo ca ganthavippayutto naaganthaniyo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1238]='*Ganthavippayuttaṃ naaganthaniyaṃ dhammaṃ paṭicca ganthavippayutto naaganthaniyo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1239]='*Ganthavippayuttaṃ **naganthaniyañca ganthavippayuttaṃ naaganthaniyañca dhammaṃ paṭicca ganthavippayutto naaganthaniyo dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1240]='*Hetuyā pañca, ārammaṇe dve…pe… avigate pañca. (Sabbattha vitthāro.)*';
P_HTM[1241]='*Ganthagocchakaṃ niṭṭhitaṃ.*';
P_HTM[1242]='*32-49. Oghādidukāni*';
P_HTM[1243]='****46*. Nooghaṃ dhammaṃ paṭicca…pe… noyogaṃ dhammaṃ paṭicca…pe… (oghagocchakayogagocchakesu āmasanaṃ āsavagocchake āmasanasadisaṃ).*';
P_HTM[1244]='****47*. Nonīvaraṇaṃ dhammaṃ paṭicca…pe…. (Nīvaraṇagocchake āmasanaṃ saññojanagocchake āmasanasadisaṃ.)*';
P_HTM[1245]='*Nīvaraṇagocchakaṃ niṭṭhitaṃ.*';
P_HTM[1246]='*50-54. Parāmāsādidukāni*';
P_HTM[1247]='****48*. Noparāmāsaṃ dhammaṃ paṭicca noparāmāso dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1248]='****49*. Naparāmaṭṭhaṃ dhammaṃ paṭicca naparāmaṭṭho dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1249]='****50*. Naparāmāsasampayuttaṃ dhammaṃ paṭicca naparāmāsasampayutto dhammo uppajjati hetupaccayā.*';
P_HTM[1250]='****51*. Naparāmāsañceva naaparāmaṭṭhañca dhammaṃ paṭicca naparāmāso ceva naaparāmaṭṭho ca dhammo uppajjati hetupaccayā. Naparāmāsañceva naaparāmaṭṭhañca dhammaṃ paṭicca naaparāmaṭṭho ceva nano ca parāmāso dhammo uppajjati hetupaccayā. Naparāmāsañceva naaparāmaṭṭhañca dhammaṃ paṭicca naparāmāso ** ceva naaparāmaṭṭho ca naaparāmaṭṭho ceva nanoparāmāso ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1251]='*Naaparāmaṭṭhañceva nano ca parāmāsaṃ dhammaṃ paṭicca naparāmāso ceva naaparāmaṭṭho ca dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1252]='*Naparāmāsañceva naaparāmaṭṭhañca naaparāmaṭṭhañceva nano ca parāmāsañca dhammaṃ paṭicca naparāmāso ceva naaparāmaṭṭho ca dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1253]='****52*. Parāmāsavippayuttaṃ naparāmaṭṭhaṃ dhammaṃ paṭicca parāmāsavippayutto naparāmaṭṭho dhammo uppajjati hetupaccayā. Parāmāsavippayuttaṃ naparāmaṭṭhaṃ dhammaṃ paṭicca parāmāsavippayutto naaparāmaṭṭho dhammo uppajjati hetupaccayā. Parāmāsavippayuttaṃ naparāmaṭṭhaṃ dhammaṃ paṭicca parāmāsavippayutto naparāmaṭṭho ca parāmāsavippayutto naaparāmaṭṭho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1254]='*Parāmāsavippayuttaṃ naaparāmaṭṭhaṃ dhammaṃ paṭicca parāmāsavippayutto naaparāmaṭṭho dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1255]='*Parāmāsavippayuttaṃ naparāmaṭṭhañca parāmāsavippayuttaṃ naaparāmaṭṭhañca dhammaṃ paṭicca parāmāsavippayutto naaparāmaṭṭho dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1256]='*Hetuyā pañca, ārammaṇe dve…pe…. Avigate pañca.*';
P_HTM[1257]='*Parāmāsagocchakaṃ niṭṭhitaṃ.*';
P_HTM[1258]='*55. Sārammaṇadukaṃ*';
P_HTM[1259]='****53*. Nasārammaṇaṃ dhammaṃ paṭicca nasārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇaṃ dhammaṃ paṭicca naanārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇaṃ dhammaṃ paṭicca nasārammaṇo ca naanārammaṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1260]='*Naanārammaṇaṃ dhammaṃ paṭicca naanārammaṇo dhammo uppajjati hetupaccayā. Naanārammaṇaṃ dhammaṃ paṭicca nasārammaṇo dhammo uppajjati hetupaccayā**. Naanārammaṇaṃ dhammaṃ paṭicca nasārammaṇo ca naanārammaṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1261]='*Nasārammaṇañca naanārammaṇañca dhammaṃ paṭicca nasārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇañca naanārammaṇañca dhammaṃ paṭicca naanārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇañca naanārammaṇañca dhammaṃ paṭicca nasārammaṇo ca naanārammaṇo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1262]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1263]='*56. Cittadukaṃ*';
P_HTM[1264]='****54*. Nacittaṃ dhammaṃ paṭicca nacitto dhammo uppajjati hetupaccayā. Nacittaṃ dhammaṃ paṭicca nanocitto dhammo uppajjati hetupaccayā. Nacittaṃ dhammaṃ paṭicca nacitto ca nanocitto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1265]='*Nanocittaṃ dhammaṃ paṭicca nacitto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1266]='*Nacittañca nanocittañca dhammaṃ paṭicca nacitto dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1267]='*Hetuyā pañca…pe… (sabbattha pañca).*';
P_HTM[1268]='*57. Cetasikadukaṃ*';
P_HTM[1269]='****55*. Nacetasikaṃ dhammaṃ paṭicca nacetasiko dhammo uppajjati hetupaccayā. Nacetasikaṃ dhammaṃ paṭicca naacetasiko dhammo uppajjati hetupaccayā. Nacetasikaṃ dhammaṃ paṭicca nacetasiko ca naacetasiko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1270]='*Naacetasikaṃ dhammaṃ paṭicca naacetasiko dhammo uppajjati hetupaccayā. Naacetasikaṃ dhammaṃ paṭicca nacetasiko dhammo uppajjati hetupaccayā. Naacetasikaṃ dhammaṃ paṭicca nacetasiko ca naacetasiko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1271]='*Nacetasikañca naacetasikañca dhammaṃ paṭicca nacetasiko dhammo uppajjati hetupaccayā. Nacetasikañca naacetasikañca dhammaṃ paṭicca naacetasiko dhammo ** uppajjati hetupaccayā. Nacetasikañca naacetasikañca dhammaṃ paṭicca nacetasiko ca naacetasiko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1272]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1273]='*58. Cittasampayuttadukaṃ*';
P_HTM[1274]='****56*. Nacittasampayuttaṃ dhammaṃ paṭicca nacittasampayutto dhammo uppajjati hetupaccayā – cittaṃ paṭicca cittasamuṭṭhānaṃ rūpaṃ. Nacittasampayuttaṃ dhammaṃ paṭicca nacittavippayutto dhammo uppajjati hetupaccayā – cittaṃ paṭicca cittasampayuttakā khandhā.*';
P_HTM[1275]='*(Paccanīyadukamattāni na vattabbaṃ dhammaṃ pūretuṃ nava nava pañhāni karotu.)*';
P_HTM[1276]='*59. Cittasaṃsaṭṭhadukaṃ*';
P_HTM[1277]='****57*. Nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[1278]='*60. Cittasamuṭṭhānadukaṃ*';
P_HTM[1279]='****58*. Nacittasamuṭṭhānaṃ dhammaṃ paṭicca nacittasamuṭṭhāno dhammo uppajjati hetupaccayā….*';
P_HTM[1280]='*Hetuyā nava.*';
P_HTM[1281]='*61. Cittasahabhūdukaṃ*';
P_HTM[1282]='****59*. Nacittasahabhuṃ dhammaṃ paṭicca nacittasahabhū dhammo uppajjati hetupaccayā….*';
P_HTM[1283]='*Hetuyā nava.*';
P_HTM[1284]='*62. Cittānuparivattidukaṃ*';
P_HTM[1285]='****60*. Nacittānuparivattiṃ dhammaṃ paṭicca nacittānuparivatti dhammo uppajjati hetupaccayā…. Hetuyā nava.*';
P_HTM[1286]='*63. Cittasaṃsaṭṭhasamuṭṭhānadukaṃ*';
P_HTM[1287]='****61*. Nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā…. Hetuyā nava.*';
P_HTM[1288]='*64. Cittasaṃsaṭṭhasamuṭṭhānasahabhūdukaṃ*';
P_HTM[1289]='****62*. Nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ ** dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā…. Hetuyā nava.*';
P_HTM[1290]='*65. Cittasaṃsaṭṭhasamuṭṭhānānuparivattidukaṃ*';
P_HTM[1291]='****63*. Nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca nacittasaṃsaṭṭhasamuṭṭhānānuparivatti dhammo uppajjati hetupaccayā….*';
P_HTM[1292]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1293]='*66. Ajjhattikadukaṃ*';
P_HTM[1294]='****64*. Naajjhattikaṃ dhammaṃ paṭicca naajjhattiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1295]='*Nabāhiraṃ dhammaṃ paṭicca nabāhiro dhammo uppajjati hetupaccayā – paṭisandhikkhaṇe cittaṃ paṭicca ajjhattikaṃ kaṭattārūpaṃ. (Saṃkhittaṃ.)*';
P_HTM[1296]='*Hetuyā nava…pe… avigate nava. (Sabbattha vitthāro.)*';
P_HTM[1297]='*67. Upādādukaṃ*';
P_HTM[1298]='****65*. Naupādā dhammaṃ paṭicca naupādā dhammo uppajjati hetupaccayā. Naupādā dhammaṃ paṭicca nanoupādā dhammo uppajjati hetupaccayā. Naupādā dhammaṃ paṭicca naupādā ca nanoupādā ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1299]='*Nanoupādā dhammaṃ paṭicca naupādā dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1300]='*Naupādā ca nanoupādā ca dhammaṃ paṭicca naupādā dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1301]='*Hetuyā pañca.*';
P_HTM[1302]='*68. Upādinnadukaṃ*';
P_HTM[1303]='****66*. Naupādinnaṃ dhammaṃ paṭicca naupādinno dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1304]='*Naanupādinnaṃ dhammaṃ paṭicca naanupādinno dhammo uppajjati hetupaccayā. Naanupādinnaṃ dhammaṃ paṭicca naupādinno dhammo uppajjati hetupaccayā. Naanupādinnaṃ ** dhammaṃ paṭicca naupādinno ca naanupādinno ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1305]='*Naupādinnañca naanupādinnañca dhammaṃ paṭicca naupādinno dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1306]='*Hetuyā pañca. (Sabbattha vitthāro.)*';
P_HTM[1307]='*Mahantaradukaṃ niṭṭhitaṃ.*';
P_HTM[1308]='*69-74. Upādānagocchakaṃ*';
P_HTM[1309]='****67*. Naupādānaṃ dhammaṃ paṭicca naupādāno dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1310]='*75. Kilesadukaṃ*';
P_HTM[1311]='****68*. Nokilesaṃ dhammaṃ paṭicca nokileso dhammo uppajjati hetupaccayā. Nokilesaṃ dhammaṃ paṭicca nanokileso dhammo uppajjati hetupaccayā. Nokilesaṃ dhammaṃ paṭicca nokileso ca nanokileso ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1312]='*Nanokilesaṃ dhammaṃ paṭicca nanokileso dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1313]='*Nokilesañca nanokilesañca dhammaṃ paṭicca nokileso dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
