P_HTM[1442]='*Dhammapaccanīye dukatikapaṭṭhānaṃ*';
P_HTM[1443]='*1-1. Hetuduka-kusalattikaṃ*';
P_HTM[1444]='*1-7. Paṭiccavārādi*';
P_HTM[1445]='*Paccayacatukkaṃ*';
P_HTM[1446]='*Hetupaccayo*';
P_HTM[1447]='****1*. Nahetuṃ *nakusalaṃ dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā – nahetuṃ akusalaṃ abyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ. Nahetuṃ nakusalaṃ dhammaṃ paṭicca nanahetuṃ nakusalo dhammo uppajjati hetupaccayā – nahetū akusale abyākate khandhe paṭicca hetū. Nahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1448]='*Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nanahetu nakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ nakusalaṃ dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1449]='*Nahetuṃ nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nahetu nakusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nanahetu nakusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalañca nanahetuṃ nakusalañca dhammaṃ paṭicca nahetu nakusalo ca nanahetu nakusalo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1450]='****2*. Hetuyā * nava…pe… avigate nava.*';
P_HTM[1451]='*Nahetuyā dve.*';
P_HTM[1452]='*(Sahajātavārepi…pe… sampayuttavārepi sabbattha vitthāro.)*';
P_HTM[1453]='*Hetu-ārammaṇapaccayā*';
P_HTM[1454]='****3*. Nanahetu nakusalo dhammo nanahetussa nakusalassa dhammassa hetupaccayena paccayo. Nanahetu nakusalo dhammo nahetussa nakusalassa dhammassa hetupaccayena paccayo. Nanahetu nakusalo dhammo nahetussa nakusalassa ca nanahetussa nakusalassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1455]='*Nahetu nakusalo dhammo nahetussa nakusalassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[1456]='****4*. Hetuyā tīṇi, ārammaṇe nava…pe… avigate nava. (Pañhāvāraṃ evaṃ vitthāretabbaṃ).*';
P_HTM[1457]='****5*. Nahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā – nahetuṃ kusalaṃ abyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… dve khandhe…pe… nahetuṃ naakusalaṃ dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā – nahetū kusale abyākate khandhe paṭicca hetū. Nahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1458]='*Nanahetuṃ naakusalaṃ dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. Nanahetuṃ naakusalaṃ dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1459]='*Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nahetu naakusalo dhammo uppajjati hetupaccayā. Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nanahetu naakusalo dhammo uppajjati hetupaccayā**. Nahetuṃ naakusalañca nanahetuṃ naakusalañca dhammaṃ paṭicca nahetu naakusalo ca nanahetu naakusalo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ).*';
P_HTM[1460]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1461]='****6*. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu naabyākato dhammo uppajjati hetupaccayā – kusalākusalaṃ nahetuṃ ekaṃ khandhaṃ paṭicca tayo khandhā, tayo khandhe paṭicca eko khandho. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu naabyākato ca nanahetu naabyākato ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1462]='*Nanahetuṃ naabyākataṃ dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1463]='*Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nanahetu naabyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nahetu naabyākato ca nanahetu naabyākato ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1464]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1465]='*1-2 Hetuduka-vedanāttikaṃ*';
P_HTM[1466]='****7*. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nanahetu nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1467]='*Hetuyā nava. (Sabbattha nava.)*';
P_HTM[1468]='****8*. Nahetuṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1469]='*Hetuyā nava. (Sabbattha nava.)*';
