P_HTM[1527]='*1-22. Hetuduka-sanidassanattikaṃ*';
P_HTM[1528]='*1-7. Paṭiccavārādi*';
P_HTM[1529]='*Paccayacatukkaṃ*';
P_HTM[1530]='*Hetupaccayo*';
P_HTM[1531]='****29*. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1532]='*Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca ** nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1533]='*Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nanahetu nasanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ nasanidassanasappaṭighañca nanahetuṃ nasanidassanasappaṭighañca dhammaṃ paṭicca nahetu nasanidassanasappaṭigho ca nanahetu nasanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1534]='*Hetuyā nava…pe… avigate nava. (Sabbattha nava.)*';
P_HTM[1535]='****30*. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1536]='*Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nanahetuṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1537]='*Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca dhammaṃ paṭicca nahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca * dhammaṃ paṭicca nanahetu naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nahetuṃ naanidassanasappaṭighañca nanahetuṃ naanidassanasappaṭighañca dhammaṃ paṭicca nahetu naanidassanasappaṭigho ca nanahetu naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1538]='*Hetuyā nava…pe… avigate nava. (Sahajātavārepi…pe… sampayuttavārepi sabbattha vitthāro.)*';
P_HTM[1539]='*Hetu-ārammaṇapaccayā*';
P_HTM[1540]='****31*. Nanahetu ** naanidassanasappaṭigho dhammo nanahetussa naanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Nanahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Nanahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa ca nanahetussa naanidassanasappaṭighassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[1541]='*Nahetu naanidassanasappaṭigho dhammo nahetussa naanidassanasappaṭighassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[1542]='*Hetuyā tīṇi, ārammaṇe nava…pe… upanissaye nava, purejāte pacchājāte tīṇi, āsevane nava, kamme tīṇi, vipāke nava, āhāre tīṇi, indriye nava, jhāne tīṇi, magge sampayutte nava, vippayutte pañca…pe… avigate nava. (Pañhāvāraṃ evaṃ vitthāretabbaṃ.)*';
P_HTM[1543]='****32*. Nahetuṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca nahetu naanidassanaappaṭigho dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1544]='*Hetuyā ekaṃ. (Sabbattha vitthāro.)*';
P_HTM[1545]='*2-3-1. Sahetukadukādi-kusalattikaṃ*';
P_HTM[1546]='****33*. Nasahetukaṃ nakusalaṃ dhammaṃ paṭicca nasahetuko nakusalo dhammo uppajjati hetupaccayā – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca cittasamuṭṭhānaṃ rūpaṃ, ekaṃ mahābhūtaṃ paṭicca tayo mahābhūtā…pe… dve mahābhūte…pe… nasahetukaṃ nakusalaṃ dhammaṃ paṭicca naahetuko nakusalo dhammo uppajjati hetupaccayā – vicikicchāsahagataṃ uddhaccasahagataṃ mohaṃ paṭicca sampayuttakā khandhā; paṭisandhikkhaṇe vatthuṃ paṭicca sahetukā khandhā. Nasahetukaṃ nakusalaṃ dhammaṃ paṭicca nasahetuko nakusalo ca naahetuko nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1547]='*Naahetukaṃ nakusalaṃ dhammaṃ paṭicca naahetuko nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1548]='*Nasahetukaṃ ** nakusalañca naahetukaṃ nakusalañca dhammaṃ paṭicca nasahetuko nakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1549]='*Hetuyā nava.*';
P_HTM[1550]='****34*. Nasahetukaṃ naakusalaṃ dhammaṃ paṭicca nasahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1551]='*Naahetukaṃ naakusalaṃ dhammaṃ paṭicca naahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1552]='*Nasahetukaṃ naakusalañca naahetukaṃ naakusalañca dhammaṃ paṭicca nasahetuko naakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1553]='*Hetuyā nava.*';
P_HTM[1554]='****35*. Nasahetukaṃ naabyākataṃ dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1555]='*Naahetukaṃ naabyākataṃ dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1)*';
P_HTM[1556]='*Nasahetukaṃ naabyākatañca naahetukaṃ naabyākatañca dhammaṃ paṭicca naahetuko naabyākato dhammo uppajjati hetupaccayā. (1) (Saṃkhittaṃ.)*';
P_HTM[1557]='*Hetuyā tīṇi.*';
P_HTM[1558]='*(Hetusampayuttadukaṃ sahetukadukasadisaṃ.)*';
P_HTM[1559]='*4-5-1. Hetusahetukadukādi-kusalattikaṃ*';
P_HTM[1560]='****36*. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca naahetuko ceva nana ca hetu nakusalo dhammo uppajjati hetupaccayā. Nahetuñceva naahetukañca nakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo ca naahetuko ceva nana ca hetu nakusalo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1561]='*Naahetukañceva ** nana ca hetuṃ nakusalaṃ dhammaṃ paṭicca naahetuko ceva nana ca hetu nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1562]='*Nahetuñceva naahetukañca nakusalañca naahetukañceva nana ca hetuṃ nakusalañca dhammaṃ paṭicca nahetu ceva naahetuko ca nakusalo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1563]='*Hetuyā nava.*';
P_HTM[1564]='****37*. Nahetuñceva naahetukañca naakusalaṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1565]='*Hetuyā nava.*';
P_HTM[1566]='****38*. Nahetuñceva naahetukañca naabyākataṃ dhammaṃ paṭicca nahetu ceva naahetuko ca naabyākato dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1567]='*Hetuyā nava.*';
P_HTM[1568]='*(Hetuhetusampayuttadukaṃ hetusahetukadukasadisaṃ.)*';
P_HTM[1569]='*6-1. Nahetusahetukaduka-kusalattikaṃ*';
P_HTM[1570]='****39*. Nahetuṃ nasahetukaṃ nakusalaṃ dhammaṃ paṭicca nahetu nasahetuko nakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1571]='*Hetuyā nava.*';
P_HTM[1572]='****40*. Nahetuṃ nasahetukaṃ naakusalaṃ dhammaṃ paṭicca nahetu nasahetuko naakusalo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[1573]='*Hetuyā nava.*';
P_HTM[1574]='****41*. Nahetuṃ naahetukaṃ naabyākataṃ dhammaṃ paṭicca nahetu naahetuko naabyākato dhammo uppajjati hetupaccayā. (Ekapañhameva. Etena upāyena kusalākusaladukaṃ kusalattikameva ettha vaṭṭati.)*';
P_HTM[1575]='*7-13-1. Cūḷantaradukāni-kusalattikaṃ*';
P_HTM[1576]='****42*. Naapaccayaṃ ** nakusalaṃ dhammaṃ paṭicca…pe…. (Sabbattha ekaṃ.) Naasaṅkhataṃ nakusalaṃ dhammaṃ paṭicca…pe….*';
P_HTM[1577]='****43*. Nasanidassanaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1578]='****44*. Nasappaṭighaṃ nakusalaṃ dhammaṃ paṭicca…pe… naappaṭighaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1579]='****45*. Narūpiṃ nakusalaṃ dhammaṃ paṭicca…pe… naarūpiṃ nakusalaṃ dhammaṃ paṭicca .*';
P_HTM[1580]='****46*. Nalokiyaṃ nakusalaṃ dhammaṃ paṭicca…pe… nalokuttaraṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1581]='****47*. Nakenaci viññeyyaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanakenaci viññeyyaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1582]='*14-19-1. Āsavagocchaka-kusalattikaṃ*';
P_HTM[1583]='****48*. Naāsavaṃ nakusalaṃ dhammaṃ paṭicca…pe… nanoāsavaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1584]='****49*. Nasāsavaṃ nakusalaṃ dhammaṃ paṭicca…pe… naanāsavaṃ kusalaṃ dhammaṃ paṭicca….*';
P_HTM[1585]='****50*. Naāsavasampayuttaṃ nakusalaṃ dhammaṃ paṭicca…pe… naāsavavippayuttaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1586]='****51*. Naāsavañceva naanāsavañca nakusalaṃ dhammaṃ paṭicca…pe… naanāsavañceva nano ca āsavaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1587]='****52*. Naāsavañceva naāsavavippayuttañca nakusalaṃ dhammaṃ paṭicca…pe… naāsavavippayuttañceva nano ca āsavaṃ nakusalaṃ dhammaṃ paṭicca….*';
P_HTM[1588]='****53*. Āsavavippayuttaṃ nasāsavaṃ nakusalaṃ dhammaṃ paṭicca…pe… āsavavippayuttaṃ naanāsavaṃ nakusalaṃ dhammaṃ paṭicca….*';
