P_HTM[1660]='*Hetupaccayo*';
P_HTM[1661]='****1*. Nakusalaṃ **nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1662]='****2*. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1663]='****3*. Naabyākataṃ **nahetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Cha.*';
P_HTM[1664]='****4*. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1665]='****5*. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[1666]='****6*. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca nakusalo ** nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1667]='*Hetuyā ekūnatiṃsa, ārammaṇe catuvīsa…pe… avigate ekūnatiṃsa (sabbattha vitthāro).*';
P_HTM[1668]='****7*. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu ca naabyākato nanahetu ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca nakusalo nanahetu ca naakusalo nanahetu ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1669]='*Naakusalaṃ nanahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1670]='*Naabyākataṃ nanahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1671]='*Nakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca nakusalo nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1672]='*Naakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1673]='*Nakusalaṃ nanahetuñca naakusalaṃ nanahetuñca dhammaṃ paṭicca nakusalo nanahetu dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1674]='*Hetuyā catuvīsa, ārammaṇe catuvīsa…pe… avigate catuvīsa. (Sabbattha vitthāro.)*';
P_HTM[1675]='*1-2. Kusalattika-sahetukadukaṃ*';
P_HTM[1676]='****8*. Nakusalaṃ nasahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ nasahetukaṃ dhammaṃ paṭicca naakusalo nasahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ nasahetukaṃ dhammaṃ ** paṭicca nakusalo nasahetuko ca naakusalo nasahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1677]='*Naakusalaṃ nasahetukaṃ dhammaṃ paṭicca naakusalo nasahetuko dhammo uppajjati hetupaccayā. Naakusalaṃ nasahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā. Naakusalaṃ nasahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko ca naakusalo nasahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1678]='*Naabyākataṃ nasahetukaṃ dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1679]='*Nakusalaṃ nasahetukañca naabyākataṃ nasahetukañca dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1680]='*Nakusalaṃ nasahetukañca naakusalaṃ nasahetukañca dhammaṃ paṭicca nakusalo nasahetuko dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1681]='*Hetuyā pannarasa, ārammaṇe nava…pe… adhipatiyā nava…pe… vipāke nava…pe… avigate pannarasa. (Sabbattha vitthāro.)*';
P_HTM[1682]='****9*. Nakusalaṃ naahetukaṃ dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1683]='*Naakusalaṃ naahetukaṃ dhammaṃ paṭicca naakusalo naahetuko dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1684]='*Naabyākataṃ naahetukaṃ dhammaṃ paṭicca naabyākato naahetuko dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1685]='*Nakusalaṃ naahetukañca naabyākataṃ naahetukañca dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1686]='*Naakusalaṃ naahetukañca naabyākataṃ naahetukañca dhammaṃ paṭicca naakusalo naahetuko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[1687]='*Nakusalaṃ naahetukañca naakusalaṃ naahetukañca dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1688]='*Hetuyā catuvīsa…pe… avigate catuvīsa. (Sabbattha vitthāro.)*';
P_HTM[1689]='*1-3-6. Kusalattika-hetusampayuttādidukāni*';
P_HTM[1690]='****10*. Nakusalaṃ **nahetusampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1691]='****11*. Nakusalaṃ nahetuvippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1692]='****12*. Nakusalaṃ nahetuñceva naahetukañca dhammaṃ paṭicca…pe… nakusalaṃ naahetukañceva nanahetuñca dhammaṃ paṭicca…pe… nakusalaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca…pe… nakusalaṃ nahetuvippayuttañceva nanahetuñca dhammaṃ paṭicca….*';
P_HTM[1693]='****13*. Nakusalaṃ nahetuṃ nasahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1694]='*Nakusalaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1695]='*1-7-13. Kusalattika-cūḷantaradukāni*';
P_HTM[1696]='****14*. Nakusalaṃ naappaccayaṃ dhammaṃ paṭicca…pe… nakusalaṃ naasaṅkhataṃ dhammaṃ paṭicca….*';
P_HTM[1697]='****15*. Nakusalaṃ nasanidassanaṃ dhammaṃ paṭicca….*';
P_HTM[1698]='****16*. Nakusalaṃ nasappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[1699]='****17*. Nakusalaṃ naappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[1700]='****18*. Nakusalaṃ narūpiṃ dhammaṃ paṭicca….*';
P_HTM[1701]='****19*. Nakusalaṃ naarūpiṃ dhammaṃ paṭicca….*';
P_HTM[1702]='****20*. Nakusalaṃ nalokiyaṃ dhammaṃ paṭicca….*';
P_HTM[1703]='****21*. Nakusalaṃ nalokuttaraṃ dhammaṃ paṭicca….*';
P_HTM[1704]='****22*. Nakusalaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca…pe… nakusalaṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca….*';
P_HTM[1705]='*1-14-19. Kusalattika-āsavagocchakaṃ*';
P_HTM[1706]='****23*. Nakusalaṃ noāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1707]='*Nakusalaṃ nanoāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1708]='****24*. Nakusalaṃ ** nasāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1709]='*Nakusalaṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1710]='****25*. Nakusalaṃ naāsavasampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1711]='*Nakusalaṃ naāsavavippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1712]='****26*. Nakusalaṃ noāsavañceva naanāsavañca dhammaṃ paṭicca….*';
P_HTM[1713]='*Nakusalaṃ naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[1714]='****27*. Nakusalaṃ naanāsavañceva naāsavavippayuttañca dhammaṃ paṭicca….*';
P_HTM[1715]='*Nakusalaṃ naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca….*';
P_HTM[1716]='****28*. Nakusalaṃ āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1717]='*Nakusalaṃ āsavavippayuttaṃ naanāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1718]='*1-20-54. Kusalattika-saññojanādigocchakāni*';
P_HTM[1719]='****29*. Nakusalaṃ nosaññojanaṃ dhammaṃ paṭicca….*';
P_HTM[1720]='****30*. Nakusalaṃ noganthaṃ dhammaṃ paṭicca…pe… nakusalaṃ nooghaṃ dhammaṃ paṭicca…pe… nakusalaṃ noyogaṃ dhammaṃ paṭicca…pe… nakusalaṃ nonīvaraṇaṃ dhammaṃ paṭicca…pe… nakusalaṃ noparāmāsaṃ dhammaṃ paṭicca….*';
P_HTM[1721]='*1-55-68. Kusalattika-mahantaradukāni*';
P_HTM[1722]='****31*. Nakusalaṃ nasārammaṇaṃ dhammaṃ paṭicca….*';
P_HTM[1723]='*Nakusalaṃ naanārammaṇaṃ dhammaṃ paṭicca… (saṃkhittaṃ.)*';
P_HTM[1724]='****32*. Nakusalaṃ nacittaṃ dhammaṃ paṭicca… (saṃkhittaṃ, nanocittapadaṃ na labbhati).*';
P_HTM[1725]='****33*. Nakusalaṃ nacetasikaṃ dhammaṃ paṭicca….*';
P_HTM[1726]='****34*. Nakusalaṃ nacittasampayuttaṃ dhammaṃ paṭicca…pe… nakusalaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca…pe… nakusalaṃ nacittasamuṭṭhānaṃ dhammaṃ paṭicca….*';
P_HTM[1727]='****35*. Nakusalaṃ ** nacittasahabhuṃ dhammaṃ paṭicca….*';
P_HTM[1728]='****36*. Nakusalaṃ nacittānuparivattiṃ dhammaṃ paṭicca…pe… nakusalaṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nakusalaṃ nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca…pe… nakusalaṃ nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[1729]='****37*. Nakusalaṃ naajjhattikaṃ dhammaṃ paṭicca….*';
P_HTM[1730]='*Nakusalaṃ nabāhiraṃ dhammaṃ paṭicca….*';
P_HTM[1731]='****38*. Nakusalaṃ naupādā dhammaṃ paṭicca….*';
P_HTM[1732]='****39*. Nakusalaṃ naupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[1733]='*Nakusalaṃ naanupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[1734]='*1-69-82. Kusalattika-upādānādidukāni*';
P_HTM[1735]='****40*. Nakusalaṃ noupādānaṃ dhammaṃ paṭicca….*';
P_HTM[1736]='*Nakusalaṃ nanoupādānaṃ dhammaṃ paṭicca….*';
P_HTM[1737]='****41*. Nakusalaṃ nokilesaṃ dhammaṃ paṭicca….*';
P_HTM[1738]='*Nakusalaṃ nanokilesaṃ dhammaṃ paṭicca….*';
P_HTM[1739]='*1-83. Kusalattika-piṭṭhidukaṃ*';
P_HTM[1740]='****42*. Nakusalaṃ nadassanena pahātabbaṃ dhammaṃ paṭicca…pe… nakusalaṃ nanadassanena pahātabbaṃ dhammaṃ paṭicca…pe… nakusalaṃ nabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe… nakusalaṃ nanabhāvanāya pahātabbaṃ dhammaṃ paṭicca…pe… nakusalaṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nakusalaṃ nanadassanena pahātabbahetukaṃ dhammaṃ paṭicca…pe… nakusalaṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1741]='*Nakusalaṃ nanabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1742]='****43*. Nakusalaṃ nasavitakkaṃ dhammaṃ paṭicca…pe… nakusalaṃ naavitakkaṃ dhammaṃ paṭicca…pe… nakusalaṃ nasavicāraṃ dhammaṃ paṭicca….*';
P_HTM[1743]='*Nakusalaṃ naavicāraṃ dhammaṃ paṭicca….*';
P_HTM[1744]='****44*. Nakusalaṃ ** nasappītikaṃ dhammaṃ paṭicca…pe… nakusalaṃ naappītikaṃ dhammaṃ paṭicca…pe… nakusalaṃ napītisahagataṃ dhammaṃ paṭicca…pe… nakusalaṃ nanapītisahagataṃ dhammaṃ paṭicca…pe… nakusalaṃ nasukhasahagataṃ dhammaṃ paṭicca…pe… nakusalaṃ nanasukhasahagataṃ dhammaṃ paṭicca…pe… nakusalaṃ naupekkhāsahagataṃ dhammaṃ paṭicca….*';
P_HTM[1745]='*Nakusalaṃ nanaupekkhāsahagataṃ dhammaṃ paṭicca….*';
P_HTM[1746]='****45*. Nakusalaṃ nakāmāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[1747]='*Nakusalaṃ nanakāmāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[1748]='****46*. Nakusalaṃ narūpāvacaraṃ dhammaṃ paṭicca…pe… nakusalaṃ nanarūpāvacaraṃ dhammaṃ paṭicca…pe… nakusalaṃ naarūpāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[1749]='*Nakusalaṃ nanaarūpāvacaraṃ dhammaṃ paṭicca….*';
P_HTM[1750]='****47*. Nakusalaṃ napariyāpannaṃ dhammaṃ paṭicca….*';
P_HTM[1751]='*Nakusalaṃ naapariyāpannaṃ dhammaṃ paṭicca….*';
P_HTM[1752]='****48*. Nakusalaṃ naniyyānikaṃ dhammaṃ paṭicca….*';
P_HTM[1753]='*Nakusalaṃ naaniyyānikaṃ dhammaṃ paṭicca….*';
P_HTM[1754]='****49*. Nakusalaṃ naniyataṃ dhammaṃ paṭicca….*';
P_HTM[1755]='*Nakusalaṃ naaniyataṃ dhammaṃ paṭicca….*';
P_HTM[1756]='****50*. Nakusalaṃ nasauttaraṃ dhammaṃ paṭicca….*';
P_HTM[1757]='*Nakusalaṃ naanuttaraṃ dhammaṃ paṭicca….*';
P_HTM[1758]='****51*. Nakusalaṃ nasaraṇaṃ dhammaṃ paṭicca nakusalo nasaraṇo dhammo uppajjati hetupaccayā. Nakusalaṃ nasaraṇaṃ dhammaṃ paṭicca naakusalo nasaraṇo dhammo uppajjati hetupaccayā. Nakusalaṃ nasaraṇaṃ dhammaṃ paṭicca nakusalo nasaraṇo ca naakusalo nasaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1759]='*Naakusalaṃ nasaraṇaṃ dhammaṃ paṭicca naakusalo nasaraṇo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1760]='*Naabyākataṃ ** nasaraṇaṃ dhammaṃ paṭicca naabyākato nasaraṇo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1761]='*Naakusalaṃ nasaraṇañca naabyākataṃ nasaraṇañca dhammaṃ paṭicca nakusalo nasaraṇo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1762]='*Nakusalaṃ nasaraṇañca naakusalaṃ nasaraṇañca dhammaṃ paṭicca nakusalo nasaraṇo dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[1763]='*Hetuyā ekavīsa, ārammaṇe sattarasa…pe… avigate ekavīsa. (Sabbattha vitthāro.)*';
P_HTM[1764]='*Nakusalaṃ naaraṇaṃ dhammaṃ paṭicca nakusalo naaraṇo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā nava.*';
P_HTM[1765]='*Kusalattikapiṭṭhidukaṃ niṭṭhitaṃ.*';
P_HTM[1766]='*2-1. Vedanāttika-hetudukaṃ*';
P_HTM[1767]='****52*. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā…pe… satta. (Saṃkhittaṃ.)*';
P_HTM[1768]='*Nadukkhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā… satta. (Saṃkhittaṃ.)*';
P_HTM[1769]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca… satta. (Saṃkhittaṃ.)*';
P_HTM[1770]='*Nasukhāya vedanāya sampayuttaṃ nanahetuṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nanahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1771]='*3-21-1. Vipākādittikāni-hetudukaṃ*';
P_HTM[1772]='****53*. Navipākaṃ **nahetuṃ dhammaṃ paṭicca…pe… navipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca…pe… nanevavipākanavipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1773]='****54*. Naupādinnupādāniyaṃ nahetuṃ dhammaṃ paṭicca…pe… naanupādinnupādāniyaṃ nahetuṃ dhammaṃ paṭicca…pe… naanupādinnaanupādāniyaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1774]='****55*. Nasaṃkiliṭṭhasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca…pe… naasaṃkiliṭṭhaasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1775]='****56*. Nasavitakkasavicāraṃ nahetuṃ dhammaṃ paṭicca…pe… naavitakkavicāramattaṃ nahetuṃ dhammaṃ paṭicca…pe… naavitakkaavicāraṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1776]='****57*. Napītisahagataṃ nahetuṃ dhammaṃ paṭicca…pe… nasukhasahagataṃ nahetuṃ dhammaṃ paṭicca…pe… naupekkhāsahagataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1777]='****58*. Nadassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nanevadassanena nabhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca…pe… nadassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nabhāvanāya pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… nanevadassanena nabhāvanāya pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1778]='****59*. Naācayagāmiṃ nahetuṃ dhammaṃ paṭicca…pe… naapacayagāmiṃ nahetuṃ dhammaṃ paṭicca…pe… nanevācayagāmināpacayagāmiṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1779]='*Nasekkhaṃ nahetuṃ dhammaṃ paṭicca…pe… naasekkhaṃ nahetuṃ dhammaṃ paṭicca…pe… nanevasekkhanāsekkhaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1780]='****60*. Naparittaṃ nahetuṃ dhammaṃ paṭicca…pe… namahaggataṃ nahetuṃ dhammaṃ paṭicca…pe… naappamāṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1781]='****61*. Naparittārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… namahaggatārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… naappamāṇārammaṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1782]='****62*. Nahīnaṃ ** nahetuṃ dhammaṃ paṭicca…pe… namajjhimaṃ nahetuṃ dhammaṃ paṭicca…pe… napaṇītaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1783]='****63*. Namicchattaniyataṃ nahetuṃ dhammaṃ paṭicca…pe… nasammattaniyataṃ nahetuṃ dhammaṃ paṭicca…pe… naaniyataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1784]='****64*. Namaggārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… namaggahetukaṃ nahetuṃ dhammaṃ paṭicca…pe… namaggādhipatiṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1785]='****65*. Naanuppannaṃ nahetuṃ dhammaṃ paṭicca…pe… nauppādiṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1786]='****66*. Naatītaṃ nahetuṃ dhammaṃ paṭicca…pe… naanāgataṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1787]='****67*. Naatītārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… naanāgatārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… napaccuppannārammaṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1788]='****68*. Naajjhattaṃ nahetuṃ dhammaṃ paṭicca…pe… nabahiddhā nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1789]='*Naajjhattārammaṇaṃ nahetuṃ dhammaṃ paṭicca…pe… nabahiddhārammaṇaṃ nahetuṃ dhammaṃ paṭicca….*';
P_HTM[1790]='*22-1-6. Sanidassanattika-hetvādidukāni*';
P_HTM[1791]='****69*. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1792]='*Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho ** nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nahetu ca naanidassanaappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. Naanidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1793]='*Naanidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1794]='*Nasanidassanasappaṭighaṃ nahetuñca naanidassanaappaṭighaṃ nahetuñca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1795]='*Nasanidassanasappaṭighaṃ nahetuñca naanidassanasappaṭighaṃ nahetuñca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā… cha. (Saṃkhittaṃ.)*';
P_HTM[1796]='*Hetuyā tiṃsa, ārammaṇe nava. (Sabbattha vitthāro.)*';
P_HTM[1797]='****70*. Nasanidassanasappaṭighaṃ nanahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanahetu dhammo uppajjati hetupaccayā… (nava).*';
P_HTM[1798]='*Nasanidassanasappaṭighaṃ nasahetukaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1799]='*Nasanidassanasappaṭighaṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1800]='****71*. Nasanidassanasappaṭighaṃ nahetusampayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1801]='*Nasanidassanasappaṭighaṃ nahetuvippayuttaṃ dhammaṃ paṭicca….*';
P_HTM[1802]='****72*. Nasanidassanasappaṭighaṃ nahetuñceva naahetukañca dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naahetukañceva nanahetuñca dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca….*';
P_HTM[1803]='*Nasanidassanasappaṭighaṃ nahetuvippayuttañceva nanahetuñca dhammaṃ paṭicca….*';
P_HTM[1804]='*Nasanidassanasappaṭighaṃ ** nahetuṃ nasahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1805]='*Nasanidassanasappaṭighaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca….*';
P_HTM[1806]='*22-7-13. Sanidassanattika-cūḷantaradukāni*';
P_HTM[1807]='****73*. Nasanidassanasappaṭighaṃ naappaccayaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naasaṅkhataṃ dhammaṃ paṭicca….*';
P_HTM[1808]='****74*. Nasanidassanasappaṭighaṃ nasanidassanaṃ dhammaṃ paṭicca….*';
P_HTM[1809]='****75*. Nasanidassanasappaṭighaṃ nasappaṭighaṃ dhammaṃ paṭicca….*';
P_HTM[1810]='*Nasanidassanasappaṭighaṃ naappaṭighaṃ dhammaṃ paṭicca…. (Saṃkhittaṃ.)*';
P_HTM[1811]='****76*. Nasanidassanasappaṭighaṃ narūpiṃ dhammaṃ paṭicca… nasanidassanasappaṭighaṃ naarūpiṃ dhammaṃ paṭicca….*';
P_HTM[1812]='****77*. Nasanidassanasappaṭighaṃ nalokiyaṃ dhammaṃ paṭicca….*';
P_HTM[1813]='*Nasanidassanasappaṭighaṃ nalokuttaraṃ dhammaṃ paṭicca….*';
P_HTM[1814]='****78*. Nasanidassanasappaṭighaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca….*';
P_HTM[1815]='*22-14-54. Sanidassanattika-āsavādigocchakāni*';
P_HTM[1816]='****79*. Nasanidassanasappaṭighaṃ noāsavaṃ dhammaṃ paṭicca….*';
P_HTM[1817]='****80*. Nasanidassanasappaṭighaṃ nosaññojanaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ noganthaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nooghaṃ dhammaṃ paṭicca…pe…. Nasanidassanasappaṭighaṃ noyogaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nonīvaraṇaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ noparāmāsaṃ dhammaṃ paṭicca….*';
P_HTM[1818]='*22-55-68. Sanidassanattika-mahantaradukāni*';
P_HTM[1819]='****81*. Nasanidassanasappaṭighaṃ nasārammaṇaṃ dhammaṃ paṭicca….*';
P_HTM[1820]='****82*. Nasanidassanasappaṭighaṃ ** nacittaṃ dhammaṃ paṭicca…. (Nanocittapadaṃ na labbhati.)*';
P_HTM[1821]='****83*. Nasanidassanasappaṭighaṃ nacetasikaṃ dhammaṃ paṭicca….*';
P_HTM[1822]='****84*. Nasanidassanasappaṭighaṃ nacittasampayuttaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca….*';
P_HTM[1823]='****85*. Nasanidassanasappaṭighaṃ nacittasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasahabhuṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittānuparivattiṃ dhammaṃ paṭicca pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca….*';
P_HTM[1824]='****86*. Nasanidassanasappaṭighaṃ naajjhattikaṃ dhammaṃ paṭicca….*';
P_HTM[1825]='*Nasanidassanasappaṭighaṃ nabāhiraṃ dhammaṃ paṭicca….*';
P_HTM[1826]='****87*. Nasanidassanasappaṭighaṃ naupādā dhammaṃ paṭicca….*';
P_HTM[1827]='****88*. Nasanidassanasappaṭighaṃ naupādinnaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ naanupādinnaṃ dhammaṃ paṭicca….*';
P_HTM[1828]='*22-69-82. Sanidassanattika-upādānādidukāni*';
P_HTM[1829]='****89*. Nasanidassanasappaṭighaṃ noupādānaṃ dhammaṃ paṭicca…pe… nasanidassanasappaṭighaṃ nokilesaṃ dhammaṃ paṭicca….*';
P_HTM[1830]='*22-83. Sanidassanattika-piṭṭhidukaṃ*';
P_HTM[1831]='****90*. Nasanidassanasappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paṭicca….*';
P_HTM[1832]='*Hetuyā tiṃsa, ārammaṇe nava…pe… aññamaññe pañcavīsa…pe… avigate tiṃsa. (Piṭṭhidukaṃ vitthāretabbaṃ.)*';
P_HTM[1833]='****91*. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ ** paṭicca naanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaraṇo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1834]='*Naanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā…pe… cha.*';
P_HTM[1835]='*Naanidassanaappaṭighaṃ nasaraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1836]='*Nasanidassanasappaṭighaṃ nasaraṇañca naanidassanaappaṭighaṃ nasaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1837]='*Nasanidassanasappaṭighaṃ nasaraṇañca naanidassanasappaṭighaṃ nasaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[1838]='*Hetuyā tiṃsa, ārammaṇe nava…pe… avigate tiṃsa. (Sabbattha vitthāro.)*';
P_HTM[1839]='****92*. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1840]='****93*. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ naaraṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[1841]='****94*. Nasanidassanasappaṭighaṃ ** naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca naanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ naaraṇañca naanidassanasappaṭighaṃ naaraṇañca dhammaṃ paṭicca nasanidassanasappaṭigho naaraṇo ca naanidassanasappaṭigho naaraṇo ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1842]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sahajātavārepi paccayavārepi nissayavārepi saṃsaṭṭhavārepi sampayuttavārepi sabbattha nava.)*';
P_HTM[1843]='*Dhammapaccanīye tikadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[1844]='*Dhammapaccanīye tikatikapaṭṭhānaṃ*';
P_HTM[1845]='*1-1. Kusalattika-vedanāttikaṃ*';
P_HTM[1846]='*1-7. Paṭiccavārādi*';
P_HTM[1847]='*Hetupaccayo*';
P_HTM[1848]='****1*. Nakusalaṃ *nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1849]='****2*. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto **dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1850]='****3*. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naabyākataṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (6)*';
P_HTM[1851]='****4*. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā**. Nakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1852]='****5*. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naabyākato nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto ca naabyākato nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Naakusalaṃ nasukhāya vedanāya sampayuttañca naabyākataṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1853]='****6*. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nasukhāya vedanāya sampayuttañca naakusalaṃ nasukhāya vedanāya sampayuttañca dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[1854]='*Hetuyā ekūnatiṃsa, ārammaṇe catuvīsa…pe… avigate ekūnatiṃsa. (Sahajātavārepi…pe… pañhāvārepi vitthāro.)*';
P_HTM[1855]='*Dukkhāyavedanāyasampayuttapadaṃ*';
P_HTM[1856]='*Hetupaccayo*';
P_HTM[1857]='****7*. Nakusalaṃ *nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naabyākato nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Nakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naakusalo nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (5)*';
P_HTM[1858]='*Naakusalaṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[1859]='*Naabyākataṃ nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naabyākato nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… cha.*';
