P_HTM[1940]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya ** vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ nakusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1941]='****40*. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā…pe… satta.*';
P_HTM[1942]='*Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ nakusalañca naadukkhamasukhāya vedanāya sampayuttaṃ nakusalañca dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā…pe… satta. (Saṃkhittaṃ.)*';
