P_HTM[2972]='*100-1. Saraṇaduka-kusalattikaṃ*';
P_HTM[2973]='****79*. Araṇaṃ ** kusalaṃ dhammaṃ paṭicca nasaraṇo nakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[2974]='*Saraṇaṃ akusalaṃ dhammaṃ paṭicca nasaraṇo naakusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
