P_HTM[2978]='*100-2. Saraṇaduka-vedanāttikaṃ*';
P_HTM[2979]='****81*. Saraṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Saraṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Saraṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto ca naaraṇo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[2980]='*Araṇaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[2981]='*Hetuyā cattāri.*';
P_HTM[2982]='****82*. Saraṇaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[2983]='*Hetuyā tīṇi.*';
P_HTM[2984]='*Saraṇaṃ ** adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nasaraṇo naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā….*';
P_HTM[2985]='*Hetuyā cattāri.*';
