P_HTM[2988]='*Saraṇaṃ vipākadhammadhammaṃ paṭicca nasaraṇo navipākadhammadhammo uppajjati hetupaccayā. Araṇaṃ vipākadhammadhammaṃ paṭicca nasaraṇo navipākadhammadhammo uppajjati hetupaccayā. Hetuyā dve.*';
