P_HTM[3044]='*100-17. Saraṇaduka-uppannattikaṃ*';
P_HTM[3045]='****98*. Saraṇo anuppanno dhammo nasaraṇassa naanuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cattāri.*';
P_HTM[3046]='*Araṇo uppādī dhammo naaraṇassa nauppādissa dhammassa ārammaṇapaccayena paccayo. Araṇo uppādī dhammo nasaraṇassa nauppādissa dhammassa ārammaṇapaccayena  Ārammaṇe dve.*';
