P_HTM[3077]='****1*. Kusalaṃ **hetuṃ dhammaṃ paṭicca nakusalo nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naabyākato nahetu dhammo uppajjati hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca naakusalo nahetu ca naabyākato nahetu ca dhammā uppajjanti hetupaccayā. Kusalaṃ hetuṃ dhammaṃ paṭicca nakusalo nahetu ca naakusalo nahetu ca dhammā uppajjanti hetupaccayā. (5)*';
