P_HTM[3086]='*Hetu-ārammaṇapaccayā*';
P_HTM[3087]='****3*. Kusalo hetu dhammo nakusalassa nahetussa dhammassa hetupaccayena paccayo. Kusalo hetu dhammo naakusalassa nahetussa dhammassa hetupaccayena paccayo. Kusalo hetu dhammo naabyākatassa nahetussa dhammassa hetupaccayena paccayo. Kusalo hetu dhammo naakusalassa nahetussa ca naabyākatassa nahetussa ca dhammassa hetupaccayena paccayo. Kusalo hetu dhammo nakusalassa nahetussa ca naakusalassa nahetussa ca dhammassa hetupaccayena paccayo. (5)*';
P_HTM[3088]='*Akusalo hetu dhammo naakusalassa nahetussa dhammassa hetupaccayena paccayo… pañca.*';
P_HTM[3089]='*Abyākato hetu dhammo nakusalassa nahetussa dhammassa hetupaccayena paccayo… tīṇi.*';
