P_HTM[3091]='****4*. Hetuyā terasa, ārammaṇe aṭṭhārasa…pe… avigate terasa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[3092]='****5*. Kusalaṃ ** nahetuṃ dhammaṃ paṭicca naakusalo nanahetu dhammo uppajjati hetupaccayā. Kusalaṃ nahetuṃ dhammaṃ paṭicca naabyākato nanahetu dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3093]='*Hetuyā nava, ārammaṇe nava…pe… avigate nava. (Sabbattha nava.)*';
