P_HTM[3106]='****9*. Akusalaṃ ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko dhammo uppajjati hetupaccayā. Akusalaṃ ahetukaṃ dhammaṃ paṭicca naabyākato naahetuko dhammo uppajjati hetupaccayā. Akusalaṃ ahetukaṃ dhammaṃ paṭicca nakusalo naahetuko ca naabyākato naahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
