P_HTM[3113]='*Akusalaṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3114]='*Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca naakusalo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Abyākataṃ hetuñceva sahetukañca dhammaṃ paṭicca nakusalo nahetu ceva naahetuko ca naakusalo nahetu ceva naahetuko ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.)*';
P_HTM[3115]='*Hetuyā nava.*';
P_HTM[3116]='****12*. Kusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naabyākato naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca naabyākato naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3117]='*Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naabyākato naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Akusalaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca naabyākato naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3118]='*Abyākataṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Abyākataṃ ** sahetukañceva na ca hetuṃ dhammaṃ paṭicca naakusalo naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Abyākataṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nakusalo naahetuko ceva nanahetu ca naakusalo naahetuko ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
