P_HTM[3120]='****13*. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naakusalo nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naabyākato nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Kusalaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naakusalo nahetu ceva nahetuvippayutto ca naabyākato nahetu ceva nahetuvippayutto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3121]='*(Akusalaṃ tīṇi kātabbaṃ, abyākataṃ tīṇi kātabbaṃ.)*';
P_HTM[3122]='*Hetuyā nava.*';
P_HTM[3123]='****14*. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naakusalo nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naabyākato nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā. Kusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca naakusalo nahetuvippayutto ceva nanahetu ca naabyākato nahetuvippayutto ceva nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3124]='*Akusalaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca… tīṇi. Abyākataṃ… tīṇi. Hetuyā nava.*';
P_HTM[3125]='*1-6. Kusalattika-hetusahetukadukaṃ*';
P_HTM[3126]='****15*. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo nahetu nasahetuko dhammo uppajjati hetupaccayā. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca naakusalo nahetu nasahetuko dhammo uppajjati ** hetupaccayā. Kusalaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo nahetu nasahetuko ca naakusalo nahetu nasahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3127]='*Akusalaṃ nahetuṃ sahetukaṃ… tīṇi.*';
P_HTM[3128]='*Abyākataṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nakusalo…pe… naakusalo…pe… nakusalo nahetu nasahetuko ca naakusalo nahetu nasahetuko ca dhammā uppajjanti hetupaccayā… tīṇi.*';
P_HTM[3129]='****16*. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nakusalo nahetu naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca naakusalo nahetu naahetuko dhammo uppajjati hetupaccayā. Abyākataṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nakusalo nahetu naahetuko ca naakusalo nahetu naahetuko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[3130]='*Hetugocchakaṃ niṭṭhitaṃ.*';
P_HTM[3131]='*1-7-8. Kusalattika-sappaccayādidukāni*';
P_HTM[3132]='****17*. Abyākato appaccayo dhammo naabyākatassa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo nakusalassa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo naakusalassa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo naakusalassa naappaccayassa ca naabyākatassa naappaccayassa ca dhammassa ārammaṇapaccayena paccayo. Abyākato appaccayo dhammo nakusalassa naappaccayassa ca naakusalassa naappaccayassa ca dhammassa ārammaṇapaccayena paccayo. (5)*';
P_HTM[3133]='*Ārammaṇe pañca. (Asaṅkhataṃ appaccayasadisaṃ.)*';
P_HTM[3134]='*1-9. Kusalattika-sanidassanadukaṃ*';
P_HTM[3135]='****18*. Abyākato ** sanidassano dhammo naabyākatassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. Abyākato sanidassano dhammo nakusalassa nasanidassanassa…pe… (cha pañhā kātabbā).*';
P_HTM[3136]='*Kusalaṃ anidassanaṃ dhammaṃ paṭicca nakusalo naanidassano dhammo uppajjati hetupaccayā. Akusalena tīṇiyeva. Abyākatena tīṇiyeva. Hetuyā nava.*';
P_HTM[3137]='*1-10. Kusalattika-sappaṭighadukaṃ*';
P_HTM[3138]='****19*. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca nakusalo nasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca naakusalo nasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ sappaṭighaṃ dhammaṃ paṭicca nakusalo nasappaṭigho ca naakusalo nasappaṭigho ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3139]='*Kusalaṃ appaṭighena tīṇi. Akusalaṃ appaṭighena tīṇi. Abyākataṃ appaṭighena tīṇi. Kusalaṃ appaṭighañca abyākataṃ appaṭighañca tīṇi. Akusalaṃ appaṭighañca abyākataṃ appaṭighañca tīṇi. Hetuyā pannarasa.*';
P_HTM[3140]='*1-11. Kusalattika-rūpīdukaṃ*';
P_HTM[3141]='****20*. Abyākataṃ rūpiṃ dhammaṃ paṭicca nakusalo narūpī dhammo uppajjati hetupaccayā. Abyākataṃ rūpiṃ dhammaṃ paṭicca naakusalo narūpī dhammo uppajjati hetupaccayā. Abyākataṃ rūpiṃ dhammaṃ paṭicca nakusalo narūpī ca naakusalo narūpī ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3142]='*Kusalaṃ arūpiṃ dhammaṃ paṭicca tīṇi. Akusalaṃ arūpiṃ dhammaṃ paṭicca tīṇi. Abyākataṃ arūpiṃ dhammaṃ paṭicca tīṇi. Hetuyā nava.*';
P_HTM[3143]='*1-12. Kusalattika-lokiyadukaṃ*';
P_HTM[3144]='****21*. Abyākataṃ lokiyaṃ dhammaṃ paccayā naabyākato nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā nakusalo nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ ** dhammaṃ paccayā naakusalo nalokiyo dhammo uppajjati hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā naakusalo nalokiyo ca naabyākato nalokiyo ca dhammā uppajjanti hetupaccayā. Abyākataṃ lokiyaṃ dhammaṃ paccayā nakusalo nalokiyo ca naakusalo nalokiyo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3145]='*Kusalaṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro dhammo uppajjati hetupaccayā. Kusalaṃ lokuttaraṃ dhammaṃ paṭicca naakusalo nalokuttaro dhammo uppajjati hetupaccayā. Kusalaṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro ca naakusalo nalokuttaro ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3146]='*Abyākataṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro dhammo uppajjati hetupaccayā. Abyākataṃ lokuttaraṃ dhammaṃ paṭicca naakusalo nalokuttaro dhammo uppajjati hetupaccayā. Abyākataṃ lokuttaraṃ dhammaṃ paṭicca nakusalo nalokuttaro ca naakusalo nalokuttaro ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3147]='*1-13. Kusalattika-kenaciviññeyyadukaṃ*';
P_HTM[3148]='****22*. Kusalaṃ kenaci viññeyyaṃ dhammaṃ paṭicca nakusalo nakenaci viññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naakusalo nakenaci viññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naabyākato nakenaci viññeyyo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā ekūnavīsati.*';
P_HTM[3149]='****23*. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca nakusalo nakenaci naviññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca naakusalo nakenaci naviññeyyo dhammo uppajjati hetupaccayā. Kusalaṃ kenaci naviññeyyaṃ dhammaṃ paṭicca naabyākato nakenaci naviññeyyo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3150]='*(Etena upāyena kenaci naviññeyye ekūnavīsati pañhā kātabbā.)*';
P_HTM[3151]='*1-14-19. Kusalattika-āsavagocchakaṃ*';
P_HTM[3152]='****24*. Akusalaṃ ** āsavaṃ dhammaṃ paṭicca naakusalo naāsavo dhammo…pe… nakusalo naāsavo dhammo…pe… naabyākato naāsavo dhammo…pe… nakusalo naāsavo ca naabyākato naāsavo ca dhammā…pe… nakusalo naāsavo ca naakusalo naāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca, ārammaṇe tīṇi…pe… avigate pañca.*';
P_HTM[3153]='*Akusalaṃ noāsavaṃ dhammaṃ paṭicca nakusalo nanoāsavo dhammo uppajjati hetupaccayā. Akusalaṃ noāsavaṃ dhammaṃ paṭicca naabyākato nanoāsavo dhammo…pe… nakusalo nanoāsavo ca naabyākato nanoāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[3154]='****25*. Abyākataṃ sāsavaṃ dhammaṃ paṭicca…pe… (lokiyadukasadisaṃ).*';
P_HTM[3155]='****26*. Akusalaṃ āsavasampayuttaṃ dhammaṃ paṭicca naakusalo naāsavasampayutto dhammo pe… nakusalo naāsavasampayutto dhammo…pe… naabyākato naāsavasampayutto dhammo…pe… nakusalo naāsavasampayutto ca naabyākato naāsavasampayutto ca dhammā…pe… nakusalo naāsavasampayutto ca naakusalo naāsavasampayutto ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3156]='*Akusalaṃ āsavavippayuttaṃ dhammaṃ paṭicca nakusalo naāsavavippayutto dhammo…pe… naabyākato naāsavavippayutto dhammo…pe… nakusalo naāsavavippayutto ca naabyākato naāsavavippayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3157]='****27*. Akusalaṃ āsavañceva sāsavañca dhammaṃ paṭicca naakusalo naāsavo ceva naanāsavo ca dhammo…pe… nakusalo naāsavo ceva naanāsavo ca dhammo…pe… naabyākato naāsavo ceva naanāsavo ca dhammo…pe… nakusalo naāsavo ceva naanāsavo ca naabyākato naāsavo ceva naanāsavo ca dhammā…pe… nakusalo naāsavo ** ceva naanāsavo ca naakusalo naāsavo ceva naanāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā pañca.*';
P_HTM[3158]='*Akusalaṃ sāsavañceva no ca āsavaṃ dhammaṃ paṭicca naakusalo naanāsavo ceva nano ca āsavo dhammo…pe… naabyākato naanāsavo ceva nano ca āsavo dhammo…pe… nakusalo naanāsavo ceva nano ca āsavo naabyākato naanāsavo ceva nano āsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3159]='****28*. Akusalaṃ āsavañceva āsavasampayuttañca dhammaṃ paṭicca nakusalo naāsavo ceva naāsavavippayutto ca dhammo…pe… naabyākato naāsavo ceva naāsavavippayutto ca dhammo…pe… nakusalo naāsavo ceva naāsavavippayutto ca naabyākato naāsavo ceva naāsavavippayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3160]='*Akusalaṃ āsavasampayuttañceva no ca āsavaṃ dhammaṃ paṭicca nakusalo naāsavavippayutto ceva nano ca āsavo dhammo…pe… naabyākato naāsavavippayutto ceva nano ca āsavo dhammo pe… nakusalo naāsavavippayutto ceva nanoāsavo ca naabyākato naāsavavippayutto ceva nano ca āsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3161]='****29*. Abyākataṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paṭicca…pe… (lokiyadukasadisaṃ).*';
P_HTM[3162]='*1-20-54. Kusalattika-chagocchakadukāni*';
P_HTM[3163]='****30*. Akusalaṃ saññojanaṃ dhammaṃ paṭicca…pe… ganthaṃ…pe… oghaṃ…pe… yogaṃ…pe… nīvaraṇaṃ…pe… parāmāsaṃ. (Saṃkhittaṃ.)*';
P_HTM[3164]='*1-55. Kusalattika-sārammaṇadukaṃ*';
P_HTM[3165]='****31*. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca naakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Kusalaṃ sārammaṇaṃ dhammaṃ paṭicca ** nakusalo nasārammaṇo ca naakusalo nasārammaṇo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3166]='*Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca naakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Akusalaṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo ca naakusalo nasārammaṇo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3167]='*Abyākataṃ sārammaṇaṃ dhammaṃ paṭicca nakusalo nasārammaṇo dhammo uppajjati hetupaccayā. Tīṇi.*';
P_HTM[3168]='*Hetuyā nava.*';
P_HTM[3169]='****32*. Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca nakusalo naanārammaṇo dhammo uppajjati hetupaccayā. Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca naakusalo naanārammaṇo dhammo uppajjati  Abyākataṃ anārammaṇaṃ dhammaṃ paṭicca nakusalo naanārammaṇo ca naakusalo naanārammaṇo ca dhammā uppajjanti hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi.*';
P_HTM[3170]='*1-56. Kusalattika-cittadukaṃ*';
P_HTM[3171]='****33*. Kusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naabyākato nacitto dhammo uppajjati hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto ca naabyākato nacitto ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3172]='*Akusalaṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca naabyākato nacitto dhammo uppajjati hetupaccayā. Akusalaṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naabyākato nacitto ca dhammā uppajjanti  Akusalaṃ ** cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3173]='*Abyākataṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto dhammo uppajjati hetupaccayā. Abyākataṃ cittaṃ dhammaṃ paṭicca naakusalo nacitto dhammo uppajjati hetupaccayā. Abyākataṃ cittaṃ dhammaṃ paṭicca nakusalo nacitto ca naakusalo nacitto ca dhammā uppajjanti hetupaccayā. Tīṇi. Hetuyā terasa.*';
P_HTM[3174]='****34*. Kusalaṃ nocittaṃ dhammaṃ paṭicca naakusalo nanocitto dhammo uppajjati hetupaccayā. Kusalaṃ nocittaṃ dhammaṃ paṭicca naabyākato nanocitto dhammo uppajjati hetupaccayā. Kusalaṃ nocittaṃ dhammaṃ paṭicca naakusalo nanocitto ca naabyākato nanocitto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3175]='*Akusalaṃ nocittaṃ dhammaṃ paṭicca nakusalo nanocitto dhammo uppajjati hetupaccayā. Akusalaṃ nocittaṃ dhammaṃ paṭicca naabyākato nanocitto dhammo uppajjati hetupaccayā. Akusalaṃ nocittaṃ dhammaṃ paṭicca nakusalo nanocitto ca naabyākato nanocitto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3176]='*Abyākatāni tīṇi. Hetuyā nava.*';
P_HTM[3177]='*1-57. Kusalattika-cetasikadukaṃ*';
P_HTM[3178]='****35*. Kusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naabyākato nacetasiko dhammo uppajjati hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko ca naabyākato nacetasiko ca dhammā uppajjanti hetupaccayā. Kusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3179]='*Akusalaṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ** dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca naabyākato nacetasiko dhammo uppajjati hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naabyākato nacetasiko ca dhammā uppajjanti hetupaccayā. Akusalaṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3180]='*Abyākataṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko dhammo uppajjati hetupaccayā. Abyākataṃ cetasikaṃ dhammaṃ paṭicca naakusalo nacetasiko dhammo uppajjati hetupaccayā. Abyākataṃ cetasikaṃ dhammaṃ paṭicca nakusalo nacetasiko ca naakusalo nacetasiko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3181]='*Hetuyā terasa. Acetasikāni nava.*';
P_HTM[3182]='*1-58. Kusalattika-cittasampayuttadukaṃ*';
P_HTM[3183]='****36*. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naabyākato nacittasampayutto dhammo uppajjati hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto ca naabyākato nacittasampayutto ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto ca naakusalo nacittasampayutto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3184]='*Akusalaṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3185]='*Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca naakusalo nacittasampayutto dhammo uppajjati hetupaccayā. Abyākataṃ cittasampayuttaṃ dhammaṃ paṭicca nakusalo nacittasampayutto ca naakusalo nacittasampayutto ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā terasa. Cittavippayutte tīṇi.*';
P_HTM[3186]='*1-59. Kusalattika-cittasaṃsaṭṭhadukaṃ*';
P_HTM[3187]='****37*. Kusalaṃ ** cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naabyākato nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho ca naabyākato nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Kusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3188]='*Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati  Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naabyākato nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naabyākato nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Akusalaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti  Pañca.*';
P_HTM[3189]='*Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naakusalo nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Abyākataṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nakusalo nacittasaṃsaṭṭho ca naakusalo nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā terasa.*';
P_HTM[3190]='*1-60. Kusalattika-cittasamuṭṭhānadukaṃ*';
P_HTM[3191]='****38*. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naabyākato nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Kusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno ca naabyākato nacittasamuṭṭhāno ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3192]='*Akusalaṃ ** cittasamuṭṭhānaṃ dhammaṃ paṭicca naakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Akusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca naabyākato nacittasamuṭṭhāno dhammo uppajjati hetupaccayā. Akusalaṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca nakusalo nacittasamuṭṭhāno ca naabyākato nacittasamuṭṭhāno ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3193]='*Abyākataṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca nakusalo nacittasamuṭṭhāno dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava…pe… avigate nava.*';
