P_HTM[3252]='****64*. Akusalaṃ saraṇaṃ dhammaṃ paṭicca naakusalo nasaraṇo dhammo uppajjati hetupaccayā. Akusalaṃ saraṇaṃ dhammaṃ paṭicca nakusalo nasaraṇo dhammo uppajjati hetupaccayā. Akusalaṃ saraṇaṃ dhammaṃ paṭicca nakusalo nasaraṇo ca naakusalo nasaraṇo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3253]='*Abyākataṃ araṇaṃ dhammaṃ paccayā naabyākato naaraṇo dhammo uppajjati hetupaccayā. Abyākataṃ araṇaṃ dhammaṃ paccayā nakusalo naaraṇo dhammo uppajjati hetupaccayā. Abyākataṃ araṇaṃ dhammaṃ paccayā nakusalo naaraṇo ca naabyākato naaraṇo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3254]='*2-1. Vedanāttika-hetudukaṃ*';
P_HTM[3255]='****65*. Sukhāya vedanāya sampayuttaṃ hetuṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ hetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ hetuṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā…pe… satta pañhā.*';
P_HTM[3256]='*Dukkhāya vedanāya sampayuttaṃ hetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā… satta pañhā.*';
P_HTM[3257]='*Adukkhamasukhāya ** vedanāya sampayuttaṃ hetuṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā… satta pañhā. Hetuyā ekavīsa…pe… avigate ekavīsa. (Sabbattha ekavīsa.)*';
P_HTM[3258]='****66*. Sukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nanahetu dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nanahetu dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nanahetu ca naadukkhamasukhāya vedanāya sampayutto nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3259]='*Dukkhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3260]='*Adukkhamasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nanahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā nava.*';
P_HTM[3261]='*3-1. Vipākattika-hetudukaṃ*';
P_HTM[3262]='****67*. Vipākaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu dhammo uppajjati hetupaccayā. Vipākaṃ hetuṃ dhammaṃ paṭicca navipākadhammadhammo nahetu dhammo uppajjati hetupaccayā. Vipākaṃ hetuṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo nahetu dhammo uppajjati hetupaccayā. Vipākaṃ hetuṃ dhammaṃ paṭicca navipākadhammadhammo nahetu ca nanevavipākanavipākadhammadhammo nahetu ca dhammā uppajjanti hetupaccayā. Vipākaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu ca navipākadhammadhammo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3263]='*Vipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipākadhammadhammo nahetu dhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu dhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo nahetu dhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipāko ** nahetu ca nanevavipākanavipākadhammadhammo nahetu ca dhammā uppajjanti hetupaccayā. Vipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu ca navipākadhammadhammo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3264]='*Nevavipākanavipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu dhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipākadhammadhammo nahetu dhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ hetuṃ dhammaṃ paṭicca navipāko nahetu ca navipākadhammadhammo nahetu ca dhammā uppajjanti hetupaccayā. Tīṇi… hetuyā terasa.*';
P_HTM[3265]='****68*. Vipākaṃ nahetuṃ dhammaṃ paṭicca navipākadhammadhammo nanahetu dhammo uppajjati hetupaccayā. Vipākaṃ nahetuṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo nanahetu dhammo uppajjati hetupaccayā. Vipākaṃ nahetuṃ dhammaṃ paṭicca navipākadhammadhammo nanahetu ca nanevavipākanavipākadhammadhammo nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3266]='*Vipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca navipāko nanahetu dhammo uppajjati hetupaccayā. Vipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo nanahetu dhammo uppajjati  Vipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca navipāko nanahetu ca nanevavipākanavipākadhammadhammo nanahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3267]='*Nevavipākanavipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca nanevavipākanavipākadhammadhammo nanahetu dhammo uppajjati hetupaccayā. Nevavipākanavipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca navipāko nanahetu dhammo uppajjati hetupaccayā…pe…. Nevavipākanavipākadhammadhammaṃ nahetuñca dhammaṃ paṭicca navipāko nanahetu ca navipākadhammadhammo nanahetu ca dhammā uppajjanti hetupaccayā… pañca.*';
P_HTM[3268]='*Vipākaṃ nahetuñca nevavipākanavipākadhammadhammaṃ nahetuñca dhammaṃ paṭicca navipākadhammadhammo nanahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cuddasa.*';
P_HTM[3269]='*4-1. Upādinnattika-hetudukaṃ*';
P_HTM[3270]='****69*. Upādinnupādāniyaṃ hetuṃ dhammaṃ paṭicca naupādinnupādāniyo nahetu dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ hetuṃ dhammaṃ paṭicca naanupādinnupādāniyo nahetu dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ ** hetuṃ dhammaṃ paṭicca naanupādinnaanupādāniyo nahetu dhammo uppajjati hetupaccayā. Upādinnupādāniyaṃ hetuṃ dhammaṃ paṭicca naupādinnupādāniyo nahetu ca naanupādinnaanupādāniyo nahetu ca dhammā uppajjanti hetupaccayā. Upādinnupādāniyaṃ hetuṃ dhammaṃ paṭicca naanupādinnupādāniyo nahetu ca naanupādinnaanupādāniyo nahetu ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3271]='*Anupādinnupādāniyaṃ hetuṃ dhammaṃ paṭicca naupādinnupādāniyo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3272]='*Anupādinnaanupādāniyaṃ hetuṃ dhammaṃ paṭicca naanupādinnaanupādāniyo nahetu dhammo uppajjati hetupaccayā… pañca… hetuyā terasa.*';
P_HTM[3273]='****70*. Upādinnupādāniyaṃ nahetuṃ dhammaṃ paṭicca naanupādinnupādāniyo nanahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā nava.*';
P_HTM[3274]='*5-1. Saṃkiliṭṭhattika-hetudukaṃ*';
P_HTM[3275]='****71*. Saṃkiliṭṭhasaṃkilesikaṃ hetuṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3276]='*Saṃkiliṭṭhasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca naasaṃkiliṭṭhasaṃkilesiko nanahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā nava.*';
P_HTM[3277]='*6-1. Vitakkattika-hetudukaṃ*';
P_HTM[3278]='****72*. Savitakkasavicāraṃ hetuṃ dhammaṃ paṭicca nasavitakkasavicāro nahetu dhammo uppajjati hetupaccayā… hetuyā pannarasa.*';
P_HTM[3279]='*Savitakkasavicāraṃ nahetuṃ dhammaṃ paṭicca naavitakkavicāramatto nanahetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhavīsa.*';
P_HTM[3280]='*7-1. Pītittika-hetudukaṃ*';
P_HTM[3281]='****73*. Pītisahagataṃ hetuṃ dhammaṃ paṭicca napītisahagato nahetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhavīsa.*';
P_HTM[3282]='*Pītisahagataṃ ** nahetuṃ dhammaṃ paṭicca naupekkhāsahagato nanahetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa *[hetuyā aṭṭha?]*.*';
P_HTM[3283]='*8-1. Dassanattika-hetudukaṃ*';
P_HTM[3284]='****74*. Dassanena pahātabbaṃ hetuṃ dhammaṃ paṭicca nadassanena pahātabbo nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3285]='*Dassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca nabhāvanāya pahātabbo nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3286]='*9-1. Dassanahetuttika-hetudukaṃ*';
P_HTM[3287]='****75*. Dassanena pahātabbahetukaṃ hetuṃ dhammaṃ paṭicca nadassanena pahātabbahetuko nahetu dhammo uppajjati hetupaccayā… hetuyā soḷasa.*';
P_HTM[3288]='*Dassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca nabhāvanāya pahātabbahetuko nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3289]='*10-1. Ācayagāmittika-hetudukaṃ*';
P_HTM[3290]='****76*. Ācayagāmiṃ hetuṃ dhammaṃ paṭicca naācayagāmī nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3291]='*Ācayagāmiṃ nahetuṃ dhammaṃ paṭicca naapacayagāmī nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3292]='*11-1. Sekkhattika-hetudukaṃ*';
P_HTM[3293]='****77*. Sekkhaṃ hetuṃ dhammaṃ paṭicca nasekkho nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3294]='*Sekkhaṃ nahetuṃ dhammaṃ paṭicca naasekkho nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3295]='*12-1. Parittattika-hetudukaṃ*';
P_HTM[3296]='****78*. Parittaṃ * hetuṃ dhammaṃ paṭicca namahaggato nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3297]='*Parittaṃ nahetuṃ dhammaṃ paṭicca naparitto nanahetu dhammo uppajjati hetupaccayā… hetuyā cuddasa.*';
P_HTM[3298]='*13-1. Parittārammaṇattika-hetudukaṃ*';
P_HTM[3299]='****79*. Parittārammaṇaṃ hetuṃ dhammaṃ paṭicca naparittārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[3300]='*Parittārammaṇaṃ nahetuṃ dhammaṃ paṭicca namahaggatārammaṇo nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3301]='*14-1. Hīnattika-hetudukaṃ*';
P_HTM[3302]='****80*. Hīnaṃ hetuṃ dhammaṃ paṭicca nahīno nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3303]='*Hīnaṃ nahetuṃ dhammaṃ paṭicca namajjhimo nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3304]='*15-1. Micchattaniyatattika-hetudukaṃ*';
P_HTM[3305]='****81*. Micchattaniyataṃ hetuṃ dhammaṃ paṭicca namicchattaniyato nahetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3306]='*Micchattaniyataṃ nahetuṃ dhammaṃ paṭicca nasammattaniyato nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3307]='*16-1. Maggārammaṇattika-hetudukaṃ*';
P_HTM[3308]='****82*. Maggārammaṇaṃ hetuṃ dhammaṃ paṭicca namaggārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā pañcavīsa.*';
P_HTM[3309]='*Maggārammaṇaṃ nahetuṃ dhammaṃ paṭicca namaggahetuko nanahetu dhammo uppajjati hetupaccayā… hetuyā terasa *[hetuyā aṭṭha?]*.*';
P_HTM[3310]='*17-1. Uppannattika-hetudukaṃ*';
P_HTM[3311]='****83*. Uppanno **hetu dhammo naanupannassa nahetussa dhammassa hetupaccayena paccayo. Uppanno hetu dhammo nauppādissa nahetussa dhammassa hetupaccayena paccayo. Uppanno hetu dhammo naanuppannassa nahetussa ca nauppādissa nahetussa ca dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[3312]='*18-1. Atītattika-hetudukaṃ*';
P_HTM[3313]='****84*. Paccuppanno hetu dhammo naatītassa nahetussa dhammassa hetupaccayena paccayo. Paccuppanno hetu dhammo naanāgatassa nahetussa dhammassa hetupaccayena paccayo. Paccuppanno hetu dhammo naatītassa nahetussa ca naanāgatassa nahetussa ca dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[3314]='*19-1. Atītārammaṇattika-hetudukaṃ*';
P_HTM[3315]='****85*. Atītārammaṇaṃ hetuṃ dhammaṃ paṭicca naatītārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[3316]='*Atītārammaṇaṃ nahetuṃ dhammaṃ paṭicca naanāgatārammaṇo nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3317]='*20-1. Ajjhattattika-hetudukaṃ*';
P_HTM[3318]='****86*. Ajjhattaṃ hetuṃ dhammaṃ paṭicca nabahiddhā nahetu dhammo uppajjati hetupaccayā. Bahiddhā hetuṃ dhammaṃ paṭicca naajjhatto nahetu dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3319]='*Ajjhattaṃ nahetuṃ dhammaṃ paṭicca nabahiddhā nanahetu dhammo uppajjati hetupaccayā. Bahiddhā nahetuṃ dhammaṃ paṭicca naajjhatto nanahetu dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3320]='*21-1. Ajjhattārammaṇattika-hetudukaṃ*';
P_HTM[3321]='****87*. Ajjhattārammaṇaṃ hetuṃ dhammaṃ paṭicca naajjhattārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3322]='*Ajjhattārammaṇaṃ ** nahetuṃ dhammaṃ paṭicca nabahiddhārammaṇo nanahetu dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[3323]='*22-1. Sanidassanattika-hetudukaṃ*';
P_HTM[3324]='****88*. Anidassanaappaṭighaṃ hetuṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ hetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ hetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ca naanidassanasappaṭigho nahetu ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3325]='****89*. Anidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanahetu dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca naanidassanasappaṭigho nanahetu dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ nahetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanahetu ca naanidassanasappaṭigho nanahetu ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3326]='*22-2. Sanidassanattika-sahetukadukaṃ*';
P_HTM[3327]='****90*. Anidassanaappaṭighaṃ sahetukaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasahetuko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasahetuko dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ sahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasahetuko ca naanidassanasappaṭigho nasahetuko ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3328]='*Anidassanaappaṭighaṃ ahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi.*';
P_HTM[3329]='*22-3. Sanidassanattika-hetusampayuttadukaṃ*';
P_HTM[3330]='****91*. Anidassanaappaṭighaṃ hetusampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetusampayutto dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ ** hetusampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetusampayutto dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ hetusampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetusampayutto ca naanidassanasappaṭigho nahetusampayutto ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3331]='*Anidassanaappaṭighaṃ hetuvippayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetuvippayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3332]='*22-4. Sanidassanattika-hetusahetukadukaṃ*';
P_HTM[3333]='****92*. Anidassanaappaṭighaṃ hetuñceva sahetukañca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3334]='*Anidassanaappaṭighaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3335]='*22-5. Sanidassanattika-hetuhetusampayuttadukaṃ*';
P_HTM[3336]='****93*. Anidassanaappaṭighaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca nasanidassanasappaṭigho nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3337]='*Anidassanaappaṭighaṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3338]='*22-6. Sanidassanattika-nahetusahetukadukaṃ*';
P_HTM[3339]='****94*. Anidassanaappaṭighaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca naanidassanaappaṭigho nahetu nasahetuko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3340]='*Anidassanaappaṭighaṃ ** nahetuṃ ahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nahetu naahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3341]='*22-7. Sanidassanattika-sappaccayadukaṃ*';
P_HTM[3342]='****95*. Anidassanaappaṭigho appaccayo dhammo nasanidassanasappaṭighassa naappaccayassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[3343]='*Ārammaṇe tīṇi, adhipatiyā tīṇi, upanissaye tīṇi. (Saṃkhittaṃ.)*';
P_HTM[3344]='*22-9. Sanidassanattika-sanidassanadukaṃ*';
P_HTM[3345]='****96*. Sanidassanasappaṭigho nasanidassano dhammo nasanidassanasappaṭighassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe tīṇi, adhipatiyā tīṇi, upanissaye purejāte atthiyā avigate tīṇi.*';
P_HTM[3346]='*Anidassanasappaṭighaṃ anidassanaṃ dhammaṃ paṭicca naanidassanasappaṭigho naanidassano dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3347]='*22-10. Sanidassanattika-sappaṭighadukaṃ*';
P_HTM[3348]='****97*. Anidassanasappaṭighaṃ sappaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho nasappaṭigho dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ sappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasappaṭigho dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ sappaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasappaṭigho ca naanidassanasappaṭigho nasappaṭigho ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3349]='*Anidassanaappaṭighaṃ appaṭighaṃ dhammaṃ paṭicca naanidassanaappaṭigho naappaṭigho dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ appaṭighaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naappaṭigho dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ appaṭighaṃ dhammaṃ paṭicca naanidassanasappaṭigho naappaṭigho ca naanidassanaappaṭigho naappaṭigho ca dhammā uppajjanti hetupaccayā… hetuyā pañca.*';
P_HTM[3350]='*22-11. Sanidassanattika-rūpīdukaṃ*';
P_HTM[3351]='****98*. Anidassanaappaṭighaṃ ** rūpiṃ dhammaṃ paṭicca nasanidassanasappaṭigho narūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3352]='*Anidassanaappaṭighaṃ arūpiṃ dhammaṃ paṭicca naanidassanaappaṭigho naarūpī dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ arūpiṃ dhammaṃ paṭicca nasanidassanasappaṭigho naarūpī dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ arūpiṃ dhammaṃ paṭicca nasanidassanasappaṭigho naarūpī ca naanidassanasappaṭigho naarūpī ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3353]='*22-12. Sanidassanattika-lokiyadukaṃ*';
P_HTM[3354]='****99*. Anidassanaappaṭighaṃ lokiyaṃ dhammaṃ paccayā nasanidassanasappaṭigho nalokiyo dhammo uppajjati hetupaccayā… (saṃkhittaṃ). Hetuyā tīṇi… avigate tīṇi.*';
P_HTM[3355]='*Anidassanaappaṭighaṃ lokuttaraṃ dhammaṃ paṭicca naanidassanaappaṭigho nalokuttaro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3356]='*22-13. Sanidassanattika-kenaciviññeyyadukaṃ*';
P_HTM[3357]='****100*. Anidassanasappaṭighaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naanidassanasappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ kenaci viññeyyaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā…pe… anidassanasappaṭighaṃ kenaci viññeyyaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakenaci viññeyyo ca naanidassanasappaṭigho nakenaci viññeyyo ca dhammā uppajjanti hetupaccayā… cha.*';
P_HTM[3358]='*Anidassanaappaṭighaṃ kenaci viññeyyaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā… cha.*';
P_HTM[3359]='*Anidassanasappaṭighaṃ kenaci viññeyyañca anidassanaappaṭighaṃ kenaci viññeyyañca dhammaṃ paṭicca nasanidassanasappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā… cha… hetuyā aṭṭhārasa.*';
P_HTM[3360]='*Anidassanasappaṭighaṃ ** kenaci viññeyyaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanakenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[3361]='*22-14. Sanidassanattika-āsavadukaṃ*';
P_HTM[3362]='****101*. Anidassanaappaṭighaṃ āsavaṃ dhammaṃ paṭicca naanidassanaappaṭigho noāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho noāsavo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ āsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho noāsavo ca naanidassanasappaṭigho noāsavo ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3363]='*Anidassanaappaṭighaṃ noāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanoāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ noāsavaṃ dhammaṃ paṭicca naanidassanasappaṭigho nanoāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ noāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanoāsavo ca naanidassanasappaṭigho nanoāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3364]='*22-15. Sanidassanattika-sāsavadukaṃ*';
P_HTM[3365]='****102*. Anidassanaappaṭighaṃ sāsavaṃ dhammaṃ paccayā nasanidassanasappaṭigho nasāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sāsavaṃ dhammaṃ paccayā naanidassanasappaṭigho nasāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sāsavaṃ dhammaṃ paccayā nasanidassanasappaṭigho nasāsavo ca naanidassanasappaṭigho nasāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3366]='*Anidassanaappaṭighaṃ anāsavaṃ dhammaṃ paṭicca naanidassanaappaṭigho naanāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ anāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naanāsavo dhammo uppajjati hetupaccayā…pe…. Anidassanaappaṭighaṃ anāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naanāsavo ca naanidassanasappaṭigho naanāsavo ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3367]='*22-16. Sanidassanattika-āsavasampayuttadukaṃ*';
P_HTM[3368]='****103*. Anidassanaappaṭighaṃ ** āsavasampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho naāsavasampayutto dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavasampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naāsavasampayutto dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ āsavasampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naāsavasampayutto ca naanidassanasappaṭigho naāsavasampayutto ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3369]='*Anidassanaappaṭighaṃ āsavavippayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naāsavavippayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3370]='*22-17. Sanidassanattika-āsavasāsavadukaṃ*';
P_HTM[3371]='****104*. Anidassanaappaṭighaṃ āsavañceva sāsavañca dhammaṃ paṭicca naanidassanaappaṭigho naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavañceva sāsavañca dhammaṃ paṭicca nasanidassanasappaṭigho naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ āsavañceva sāsavañca dhammaṃ paṭicca nasanidassanasappaṭigho naāsavo ceva naanāsavo ca naanidassanasappaṭigho naāsavo ceva naanāsavo ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3372]='*Anidassanaappaṭighaṃ sāsavañceva no ca āsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naanāsavo ceva nanoāsavo ca dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sāsavañceva no ca āsavaṃ dhammaṃ paṭicca naanidassanasappaṭigho naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā. Anidassanasappaṭighaṃ sāsavañceva no ca āsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naanāsavo ceva nano ca āsavo naanidassanasappaṭigho naanāsavo ceva nano āsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3373]='*22-18. Sanidassanattika-āsavaāsavasampayuttadukaṃ*';
P_HTM[3374]='****105*. Anidassanaappaṭighaṃ ** āsavañceva āsavasampayuttañca dhammaṃ paṭicca nasanidassanasappaṭigho naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavañceva āsavasampayuttañca dhammaṃ paṭicca naanidassanasappaṭigho naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavañceva āsavasampayuttañca dhammaṃ paṭicca nasanidassanasappaṭigho naāsavo ceva naāsavavippayutto ca naanidassanasappaṭigho naāsavo ceva naāsavavippayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3375]='*Anidassanaappaṭighaṃ āsavasampayuttañceva no ca āsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naāsavavippayutto ceva nano ca āsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3376]='*22-19. Sanidassanattika-āsavavippayuttasāsavadukaṃ*';
P_HTM[3377]='****106*. Anidassanaappaṭighaṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paccayā nasanidassanasappaṭigho āsavavippayutto nasāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paccayā naanidassanasappaṭigho āsavavippayutto nasāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paccayā nasanidassanasappaṭigho āsavavippayutto nasāsavo ca naanidassanasappaṭigho āsavavippayutto nasāsavo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3378]='*Anidassanaappaṭighaṃ āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca naanidassanaappaṭigho āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca nasanidassanasappaṭigho āsavavippayutto naanāsavo ca naanidassanasappaṭigho āsavavippayutto naanāsavo ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3379]='*22-20-54. Sanidassanattika-saññojanādidukāni*';
P_HTM[3380]='****107*. Anidassanaappaṭighaṃ ** saññojanaṃ dhammaṃ paṭicca naanidassanaappaṭigho nosaññojano dhammo uppajjati hetupaccayā.*';
P_HTM[3381]='****108*. Anidassanaappaṭighaṃ ganthaṃ dhammaṃ paṭicca naanidassanaappaṭigho nogantho dhammo uppajjati hetupaccayā…pe….*';
P_HTM[3382]='*Anidassanaappaṭighaṃ oghaṃ dhammaṃ paṭicca naanidassanaappaṭigho noogho dhammo uppajjati hetupaccayā…pe….*';
P_HTM[3383]='*Anidassanaappaṭighaṃ yogaṃ dhammaṃ paṭicca naanidassanaappaṭigho noyogo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3384]='****109*. Anidassanaappaṭighaṃ nīvaraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nonīvaraṇo dhammo uppajjati hetupaccayā.*';
P_HTM[3385]='****110*. Anidassanaappaṭighaṃ parāmāsaṃ dhammaṃ paṭicca naanidassanaappaṭigho noparāmāso dhammo uppajjati hetupaccayā.*';
P_HTM[3386]='*22-55. Sanidassanattika-sārammaṇadukaṃ*';
P_HTM[3387]='****111*. Anidassanaappaṭighaṃ sārammaṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasārammaṇo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasārammaṇo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ sārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasārammaṇo ca naanidassanasappaṭigho nasārammaṇo ca dhammā uppajjanti hetupaccayā.*';
P_HTM[3388]='*Anidassanaappaṭighaṃ anārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naanārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3389]='*22-56. Sanidassanattika-cittadukaṃ*';
P_HTM[3390]='****112*. Anidassanaappaṭighaṃ cittaṃ dhammaṃ paṭicca naanidassanaappaṭigho nocitto dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ cittaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nocitto dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ ** cittaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nocitto ca naanidassanasappaṭigho nocitto ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3391]='*Anidassanaappaṭighaṃ nocittaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanocitto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3392]='*22-57. Sanidassanattika-cetasikadukaṃ*';
P_HTM[3393]='****113*. Anidassanaappaṭighaṃ cetasikaṃ dhammaṃ paṭicca naanidassanaappaṭigho nacetasiko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ cetasikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacetasiko dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ cetasikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacetasiko ca naanidassanasappaṭigho nacetasiko ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3394]='*22-58. Sanidassanattika-cittasampayuttadukaṃ*';
P_HTM[3395]='****114*. Anidassanaappaṭighaṃ cittasampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho nacittasampayutto dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ cittasampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacittasampayutto dhammo uppajjati hetupaccayā …pe… anidassanaappaṭighaṃ cittasampayuttaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacittasampayutto ca naanidassanasappaṭigho nacittasampayutto ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3396]='*22-59. Sanidassanattika-cittasaṃsaṭṭhadukaṃ*';
P_HTM[3397]='****115*. Anidassanaappaṭighaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca naanidassanaappaṭigho nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nacittasaṃsaṭṭho ca naanidassanasappaṭigho nacittasaṃsaṭṭho ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3398]='*22-60. Sanidassanattika-cittasamuṭṭhānadukaṃ*';
P_HTM[3399]='****116*. Anidassanaappaṭighaṃ ** cittasamuṭṭhānaṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3400]='*22-61. Sanidassanattika-cittasahabhūdukaṃ*';
P_HTM[3401]='****117*. Anidassanaappaṭighaṃ * cittasahabhuṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittasahabhū dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3402]='*22-62. Sanidassanattika-cittānuparivattidukaṃ*';
P_HTM[3403]='****118*. Anidassanaappaṭighaṃ cittānuparivattiṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittānuparivattī dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3404]='*22-63-65. Sanidassanattika-cittasaṃsaṭṭhasamuṭṭhānādidukāni*';
P_HTM[3405]='****119*. Anidassanaappaṭighaṃ cittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3406]='****120*. Anidassanaappaṭighaṃ cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā  hetuyā cha.*';
P_HTM[3407]='****121*. Anidassanaappaṭighaṃ cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca naanidassanaappaṭigho nocittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3408]='*22-66. Sanidassanattika-ajjhattadukaṃ*';
P_HTM[3409]='****122*. Anidassanaappaṭighaṃ ajjhattikaṃ dhammaṃ paṭicca naanidassanaappaṭigho naajjhattiko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ ajjhattikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naajjhattiko dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ ajjhattikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naajjhattiko ca naanidassanasappaṭigho naajjhattiko ca dhammā uppajjanti hetupaccayā… hetuyā cha. Ārammaṇe tīṇi…pe… avigate cha.*';
P_HTM[3410]='*Anidassanasappaṭighaṃ **bāhiraṃ dhammaṃ paṭicca nasanidassanasappaṭigho nabāhiro dhammo uppajjati hetupaccayā… hetuyā ekādasa.*';
P_HTM[3411]='*22-67. Sanidassanattika-upādādukaṃ*';
P_HTM[3412]='****123*. Anidassanaappaṭighaṃ upādā dhammaṃ paṭicca nasanidassanasappaṭigho noupādā dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3413]='*Anidassanasappaṭighaṃ noupādā dhammaṃ paṭicca naanidassanasappaṭigho nanoupādā dhammo uppajjati hetupaccayā… cha.*';
P_HTM[3414]='*Anidassanaappaṭighaṃ noupādā dhammaṃ paṭicca naanidassanaappaṭigho nanoupādā dhammo uppajjati hetupaccayā… cha.*';
P_HTM[3415]='*Anidassanasappaṭighaṃ noupādā ca anidassanaappaṭighaṃ noupādā ca dhammaṃ paṭicca nasanidassanasappaṭigho nanoupādā dhammo uppajjati hetupaccayā… cha. Hetuyā aṭṭhārasa.*';
P_HTM[3416]='*22-68. Sanidassanattika-upādinnadukaṃ*';
P_HTM[3417]='****124*. Anidassanaappaṭighaṃ upādinnaṃ dhammaṃ paṭicca naanidassanaappaṭigho naupādinno dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ upādinnaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naupādinno dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ upādinnaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naupādinno ca naanidassanasappaṭigho naupādinno ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3418]='****125*. Sanidassanasappaṭigho anupādinno dhammo nasanidassanasappaṭighassa naanupādinnassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe nava.*';
P_HTM[3419]='*22-69-82. Sanidassanattika-upādānādidukāni*';
P_HTM[3420]='****126*. Anidassanaappaṭighaṃ upādānaṃ dhammaṃ paṭicca naanidassanaappaṭigho noupādāno dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3421]='****127*. Anidassanaappaṭighaṃ kilesaṃ dhammaṃ paṭicca naanidassanaappaṭigho nokileso dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3422]='*22-83. Sanidassanattika-dassanenapahātabbadukaṃ*';
P_HTM[3423]='****128*. Anidassanaappaṭighaṃ ** dassanena pahātabbaṃ dhammaṃ paṭicca naanidassanaappaṭigho nadassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3424]='*Anidassanaappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paccayā nasanidassanasappaṭigho nanadassanena pahātabbo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paccayā naanidassanasappaṭigho nanadassanena pahātabbo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ nadassanena pahātabbaṃ dhammaṃ paccayā nasanidassanasappaṭigho nanadassanena pahātabbo ca naanidassanasappaṭigho nanadassanena pahātabbo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3425]='*22-84. Sanidassanattika-bhāvanāyapahātabbadukaṃ*';
P_HTM[3426]='****129*. Anidassanaappaṭighaṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca naanidassanaappaṭigho nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3427]='*Anidassanaappaṭighaṃ nabhāvanāya pahātabbaṃ dhammaṃ paccayā nasanidassanasappaṭigho nanabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3428]='*22-85. Sanidassanattika-dassanenapahātabbahetukadukaṃ*';
P_HTM[3429]='****130*. Anidassanaappaṭighaṃ dassanena pahātabbahetukaṃ dhammaṃ paṭicca naanidassanaappaṭigho nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3430]='*Anidassanaappaṭighaṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3431]='*22-86. Sanidassanattika-bhāvanāyapahātabbahetukadukaṃ*';
P_HTM[3432]='****131*. Anidassanaappaṭighaṃ ** bhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca naanidassanaappaṭigho nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3433]='*Anidassanaappaṭighaṃ nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3434]='*22-87. Sanidassanattika-savitakkadukaṃ*';
P_HTM[3435]='****132*. Anidassanaappaṭighaṃ savitakkaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasavitakko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ savitakkaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasavitakko dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ savitakkaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasavitakko ca naanidassanasappaṭigho nasavitakko ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3436]='****133*. Anidassanaappaṭighaṃ avitakkaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naavitakko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ avitakkaṃ dhammaṃ paṭicca naanidassanasappaṭigho naavitakko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ avitakkaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naavitakko ca naanidassanasappaṭigho naavitakko ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3437]='*22-88. Sanidassanattika-savicāradukaṃ*';
P_HTM[3438]='****134*. Anidassanaappaṭighaṃ savicāraṃ dhammaṃ paṭicca naanidassanaappaṭigho nasavicāro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3439]='*Anidassanaappaṭighaṃ avicāraṃ dhammaṃ paṭicca nasanidassanasappaṭigho naavicāro dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ avicāraṃ dhammaṃ paṭicca naanidassanasappaṭigho naavicāro dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ avicāraṃ dhammaṃ paṭicca nasanidassanasappaṭigho naavicāro ca naanidassanasappaṭigho naavicāro ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3440]='*22-89. Sanidassanattika-sappītikadukaṃ*';
P_HTM[3441]='****135*. Anidassanaappaṭighaṃ ** sappītikaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasappītiko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ sappītikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasappītiko dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ sappītikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nasappītiko ca naanidassanasappaṭigho nasappītiko ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3442]='*Anidassanaappaṭighaṃ appītikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naappītiko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ appītikaṃ dhammaṃ paṭicca naanidassanasappaṭigho naappītiko dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ appītikaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naappītiko ca naanidassanasappaṭigho naappītiko ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3443]='*22-90. Sanidassanattika-pītisahagatadukaṃ*';
P_HTM[3444]='****136*. Anidassanaappaṭighaṃ pītisahagataṃ dhammaṃ paṭicca naanidassanaappaṭigho napītisahagato dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ pītisahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho napītisahagato dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ pītisahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho napītisahagato ca naanidassanasappaṭigho napītisahagato ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3445]='*Anidassanaappaṭighaṃ napītisahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanapītisahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3446]='*22-91. Sanidassanattika-sukhasahagatadukaṃ*';
P_HTM[3447]='****137*. Anidassanaappaṭighaṃ sukhasahagataṃ dhammaṃ paṭicca naanidassanaappaṭigho nasukhasahagato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3448]='*Anidassanaappaṭighaṃ nasukhasahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanasukhasahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3449]='*22-92. Sanidassanattika-upekkhāsahagatadukaṃ*';
P_HTM[3450]='****138*. Anidassanaappaṭighaṃ ** upekkhāsahagataṃ dhammaṃ paṭicca naanidassanaappaṭigho naupekkhāsahagato dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ upekkhāsahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho naupekkhāsahagato dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ upekkhāsahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho naupekkhāsahagato ca naanidassanasappaṭigho naupekkhāsahagato ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3451]='*Anidassanaappaṭighaṃ naupekkhāsahagataṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanaupekkhāsahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3452]='*22-93. Sanidassanattika-kāmāvacaradukaṃ*';
P_HTM[3453]='****139*. Anidassanaappaṭighaṃ kāmāvacaraṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakāmāvacaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3454]='*Anidassanaappaṭighaṃ nakāmāvacaraṃ dhammaṃ paṭicca naanidassanaappaṭigho nanakāmāvacaro dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ nakāmāvacaraṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanakāmāvacaro ca naanidassanasappaṭigho nanakāmāvacaro ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3455]='*22-94. Sanidassanattika-rūpāvacaradukaṃ*';
P_HTM[3456]='****140*. Anidassanaappaṭighaṃ rūpāvacaraṃ dhammaṃ paṭicca naanidassanaappaṭigho narūpāvacaro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3457]='*Anidassanaappaṭighaṃ narūpāvacaraṃ dhammaṃ paṭicca nasanidassanasappaṭigho nanarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3458]='*22-95. Sanidassanattika-arūpāvacaradukaṃ*';
P_HTM[3459]='****141*. Anidassanaappaṭighaṃ arūpāvacaraṃ dhammaṃ paṭicca naanidassanaappaṭigho naarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3460]='*Anidassanaappaṭighaṃ * naarūpāvacaraṃ dhammaṃ paccayā nasanidassanasappaṭigho nanaarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3461]='*22-96. Sanidassanattika-pariyāpannadukaṃ*';
P_HTM[3462]='****142*. Anidassanaappaṭighaṃ pariyāpannaṃ dhammaṃ paccayā nasanidassanasappaṭigho napariyāpanno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3463]='*Anidassanaappaṭighaṃ apariyāpannaṃ dhammaṃ paṭicca naanidassanaappaṭigho naapariyāpanno dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ apariyāpannaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naapariyāpanno dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ apariyāpannaṃ dhammaṃ paṭicca nasanidassanasappaṭigho naapariyāpanno ca naanidassanasappaṭigho naapariyāpanno ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3464]='*22-97. Sanidassanattika-niyyānikadukaṃ*';
P_HTM[3465]='****143*. Anidassanaappaṭighaṃ niyyānikaṃ dhammaṃ paṭicca naanidassanaappaṭigho naniyyāniko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3466]='*Anidassanaappaṭighaṃ aniyyānikaṃ dhammaṃ paccayā nasanidassanasappaṭigho naaniyyāniko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3467]='*22-98. Sanidassanattika-niyatadukaṃ*';
P_HTM[3468]='****144*. Anidassanaappaṭighaṃ niyataṃ dhammaṃ paṭicca naanidassanaappaṭigho naniyato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3469]='*Anidassanaappaṭighaṃ aniyataṃ dhammaṃ paccayā nasanidassanasappaṭigho naaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3470]='*22-99. Sanidassanattika-sauttaradukaṃ*';
P_HTM[3471]='****145*. Anidassanaappaṭighaṃ sauttaraṃ dhammaṃ paccayā nasanidassanasappaṭigho nasauttaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3472]='*Anidassanaappaṭighaṃ anuttaraṃ dhammaṃ paṭicca naanidassanaappaṭigho naanuttaro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3473]='*22-100. Sanidassanattika-saraṇadukaṃ*';
P_HTM[3474]='****146*. Anidassanaappaṭighaṃ *saraṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaraṇo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3475]='*Anidassanaappaṭighaṃ araṇaṃ dhammaṃ paccayā nasanidassanasappaṭigho naaraṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3476]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[3477]='****147*. Sanidassanasappaṭigho araṇo dhammo nasanidassanasappaṭighassa naaraṇassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[3478]='*(Yathā kusalattike pañhāvārassa anulomampi paccanīyampi anulomapaccanīyampi paccanīyānulomampi gaṇitaṃ, evaṃ gaṇetabbaṃ.)*';
P_HTM[3479]='*Dhammānulomapaccanīye tikadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3480]='*Dhammānulomapaccanīye tikatikapaṭṭhānaṃ*';
P_HTM[3481]='*1-1. Kusalattika-vedanāttikaṃ*';
P_HTM[3482]='****1*. Kusalaṃ **sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Kusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā…pe… kusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3483]='*Akusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Akusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā…pe… akusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3484]='*Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya ** sampayutto dhammo uppajjati hetupaccayā. Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Tīṇi. (Saṃkhittaṃ.)*';
P_HTM[3485]='*Hetuyā terasa, ārammaṇe nava…pe… avigate terasa.*';
P_HTM[3486]='*Paccanīyaṃ*';
P_HTM[3487]='*Nahetunaārammaṇapaccayādi*';
P_HTM[3488]='****2*. Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati nahetupaccayā  tīṇi.*';
P_HTM[3489]='****3*. Kusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati naārammaṇapaccayā. Kusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati naārammaṇapaccayā. Kusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti naārammaṇapaccayā. Tīṇi.*';
P_HTM[3490]='*Akusalaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati naārammaṇapaccayā… tīṇi.*';
P_HTM[3491]='*Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto dhammo uppajjati naārammaṇapaccayā. Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nasukhāya vedanāya sampayutto dhammo uppajjati naārammaṇapaccayā. Abyākataṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nasukhāya vedanāya sampayutto ca naakusalo nasukhāya vedanāya sampayutto ca dhammā uppajjanti naārammaṇapaccayā. Tīṇi.*';
P_HTM[3492]='****4*. Nahetuyā tīṇi, naārammaṇe nava, naadhipatiyā terasa…pe… novigate nava.*';
P_HTM[3493]='*Hetupaccayā naārammaṇe nava.*';
P_HTM[3494]='*Nahetupaccayā * ārammaṇe tīṇi.*';
P_HTM[3495]='*(Sahajātavārampi ** paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[3496]='****5*. Kusalo sukhāya vedanāya sampayutto dhammo nakusalassa nasukhāya vedanāya sampayuttassa dhammassa hetupaccayena paccayo…pe….*';
P_HTM[3497]='*Ārammaṇe aṭṭhārasa. (Pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[3498]='*Akusalapadaṃ*';
P_HTM[3499]='*Hetupaccayo*';
P_HTM[3500]='****6*. Akusalaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Akusalaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā…pe… akusalaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naakusalo nadukkhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Hetuyā pañca, ārammaṇe cha…pe… avigate aṭṭha.*';
P_HTM[3501]='*Abyākatapadaṃ*';
P_HTM[3502]='*Paccanīyaṃ*';
P_HTM[3503]='****7*. Abyākataṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati nahetupaccayā. Abyākataṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naakusalo nadukkhāya vedanāya sampayutto dhammo uppajjati nahetupaccayā. Abyākataṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo nadukkhāya vedanāya sampayutto ca naakusalo nadukkhāya vedanāya sampayutto ca dhammā uppajjanti nahetupaccayā.*';
P_HTM[3504]='*Nahetuyā tīṇi. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[3505]='****8*. Kusalaṃ adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nakusalo naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā terasa. (Sabbattha vitthāro).*';
P_HTM[3506]='*1-2. Kusalattika-vipākattikaṃ*';
P_HTM[3507]='****9*. Abyākataṃ ** vipākaṃ dhammaṃ paṭicca nakusalo navipāko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3508]='****10*. Kusalaṃ vipākadhammadhammaṃ paṭicca nakusalo navipākadhammadhammo uppajjati hetupaccayā. Kusalaṃ vipākadhammadhammaṃ paṭicca naakusalo navipākadhammadhammo uppajjati hetupaccayā. Kusalaṃ vipākadhammadhammaṃ paṭicca nakusalo navipākadhammadhammo ca naakusalo navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3509]='*Akusalaṃ vipākadhammadhammaṃ paṭicca naakusalo navipākadhammadhammo uppajjati hetupaccayā. Akusalaṃ vipākadhammadhammaṃ paṭicca nakusalo navipākadhammadhammo uppajjati hetupaccayā. Akusalaṃ vipākadhammadhammaṃ paṭicca nakusalo navipākadhammadhammo ca naakusalo navipākadhammadhammo ca dhammā uppajjanti hetupaccayā. (3) …Hetuyā cha.*';
P_HTM[3510]='****11*. Abyākataṃ nevavipākanavipākadhammadhammaṃ paṭicca nakusalo nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Abyākataṃ nevavipākanavipākadhammadhammaṃ paṭicca naakusalo nanevavipākanavipākadhammadhammo uppajjati hetupaccayā. Abyākataṃ nevavipākanavipākadhammadhammaṃ paṭicca nakusalo nanevavipākanavipākadhammadhammo ca naakusalo nevavipākanavipākadhammadhammo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3511]='*1-3. Kusalattika-upādinnattikaṃ*';
P_HTM[3512]='****12*. Abyākataṃ upādinnupādāniyaṃ dhammaṃ paṭicca nakusalo naupādinnupādāniyo dhammo uppajjati hetupaccayā. Abyākataṃ upādinnupādāniyaṃ dhammaṃ paṭicca naakusalo naupādinnupādāniyo dhammo uppajjati hetupaccayā. Abyākataṃ upādinnupādāniyaṃ dhammaṃ paṭicca nakusalo naupādinnupādāniyo ca naakusalo naupādinnupādāniyo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3513]='****13*. Kusalo anupādinnupādāniyo dhammo nakusalassa naanupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Kusalo anupādinnupādāniyo ** dhammo naakusalassa naanupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Kusalo anupādinnupādāniyo dhammo nakusalassa naanupādinnupādāniyassa ca naakusalassa naanupādinnupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. Tīṇi.*';
P_HTM[3514]='*Akusale tīṇi. Abyākataṃ anupādinnupādāniye tīṇiyeva…pe….*';
P_HTM[3515]='****14*. Kusalaṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca nakusalo naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3516]='*Abyākataṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca nakusalo naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā… tīṇi. …Hetuyā cha.*';
P_HTM[3517]='*1-4. Kusalattika-saṃkiliṭṭhattikaṃ*';
P_HTM[3518]='****15*. Akusalaṃ saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naakusalo nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3519]='*Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā naabyākato naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā nakusalo naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā naakusalo naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā nakusalo naasaṃkiliṭṭhasaṃkilesiko ca naabyākato naasaṃkiliṭṭhasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā naakusalo naasaṃkiliṭṭhasaṃkilesiko ca naabyākato naasaṃkiliṭṭhasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Abyākataṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā nakusalo naasaṃkiliṭṭhasaṃkilesiko ca naakusalo naasaṃkiliṭṭhasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Hetuyā cha.*';
P_HTM[3520]='****16*. Kusalaṃ asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nakusalo naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3521]='*Abyākataṃ ** asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca nakusalo naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… tīṇi… hetuyā cha.*';
P_HTM[3522]='*1-5. Kusalattika-vitakkattikaṃ*';
P_HTM[3523]='****17*. Kusalaṃ savitakkasavicāraṃ dhammaṃ paṭicca nakusalo nasavitakkasavicāro dhammo uppajjati hetupaccayā… hetuyā terasa. (Kusale pañca, akusale pañca, abyākate tīṇi.)*';
P_HTM[3524]='*Kusalaṃ avitakkavicāramattaṃ dhammaṃ paṭicca nakusalo naavitakkavicāramatto dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3525]='*Kusalaṃ avitakkaavicāraṃ dhammaṃ paṭicca nakusalo naavitakkaavicāro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3526]='*Abyākataṃ avitakkaavicāraṃ dhammaṃ paṭicca nakusalo naavitakkaavicāro dhammo uppajjati hetupaccayā… tīṇi… hetuyā cha.*';
P_HTM[3527]='*1-6. Kusalattika-pītittikaṃ*';
P_HTM[3528]='****18*. Kusalaṃ pītisahagataṃ dhammaṃ paṭicca nakusalo napītisahagato dhammo uppajjati hetupaccayā… pañca… hetuyā terasa.*';
P_HTM[3529]='*Kusalaṃ sukhasahagataṃ dhammaṃ paṭicca nakusalo nasukhasahagato dhammo uppajjati hetupaccayā… pañca… hetuyā terasa.*';
P_HTM[3530]='*Kusalaṃ upekkhāsahagataṃ dhammaṃ paṭicca nakusalo naupekkhāsahagato dhammo uppajjati hetupaccayā… pañca… hetuyā terasa.*';
P_HTM[3531]='*1-7. Kusalattika-dassanattikaṃ*';
P_HTM[3532]='****19*. Akusalaṃ dassanena pahātabbaṃ dhammaṃ paṭicca naakusalo nadassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3533]='*Akusalaṃ bhāvanāya pahātabbaṃ dhammaṃ paṭicca naakusalo nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3534]='*Abyākataṃ ** nevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paccayā naabyākato nanevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3535]='*1-8. Kusalattika-dassanahetuttikaṃ*';
P_HTM[3536]='****20*. Akusalaṃ dassanena pahātabbahetukaṃ dhammaṃ paṭicca naakusalo nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3537]='*Akusalaṃ bhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca naakusalo nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3538]='*Akusalaṃ nevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nakusalo nanevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3539]='*Abyākataṃ nevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paccayā naabyākato nanevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3540]='*1-9. Kusalattika-ācayagāmittikaṃ*';
P_HTM[3541]='****21*. Kusalaṃ ācayagāmiṃ dhammaṃ paṭicca nakusalo naācayagāmī dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3542]='*Kusalaṃ apacayagāmiṃ dhammaṃ paṭicca nakusalo naapacayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3543]='*Abyākataṃ nevācayagāmināpacayagāmiṃ dhammaṃ paccayā naabyākato nanevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3544]='*1-10. Kusalattika-sekkhattikaṃ*';
P_HTM[3545]='****22*. Kusalaṃ sekkhaṃ dhammaṃ paṭicca nakusalo nasekkho dhammo uppajjati hetupaccayā. (Dve mūlāni.)… Hetuyā cha.*';
P_HTM[3546]='*Abyākataṃ ** asekkhaṃ dhammaṃ paṭicca nakusalo naasekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3547]='*Abyākataṃ nevasekkhanāsekkhaṃ dhammaṃ paccayā naabyākato nanevasekkhanāsekkho dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3548]='*1-11. Kusalattika-parittattikaṃ*';
P_HTM[3549]='****23*. Abyākataṃ parittaṃ dhammaṃ paṭicca nakusalo naparitto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3550]='*Kusalaṃ mahaggataṃ dhammaṃ paṭicca nakusalo namahaggato dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3551]='*Kusalaṃ appamāṇaṃ dhammaṃ paṭicca nakusalo naappamāṇo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3552]='*1-12. Kusalattika-parittārammaṇattikaṃ*';
P_HTM[3553]='****24*. Kusalaṃ parittārammaṇaṃ dhammaṃ paṭicca nakusalo naparittārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3554]='*Kusalaṃ mahaggatārammaṇaṃ dhammaṃ paṭicca nakusalo namahaggatārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3555]='*Kusalaṃ appamāṇārammaṇaṃ dhammaṃ paṭicca nakusalo naappamāṇārammaṇo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3556]='*1-13. Kusalattika-hīnattikaṃ*';
P_HTM[3557]='****25*. Akusalaṃ hīnaṃ dhammaṃ paṭicca naakusalo nahīno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3558]='*Abyākataṃ majjhimaṃ dhammaṃ paccayā naabyākato namajjhimo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3559]='*Kusalaṃ paṇītaṃ dhammaṃ paṭicca nakusalo napaṇīto dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3560]='*1-14. Kusalattika-micchattaniyatattikaṃ*';
P_HTM[3561]='****26*. Akusalaṃ ** micchattaniyataṃ dhammaṃ paṭicca naakusalo namicchattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3562]='*Kusalaṃ sammattaniyataṃ dhammaṃ paṭicca nakusalo nasammattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3563]='*Abyākataṃ aniyataṃ dhammaṃ paccayā naabyākato naaniyato dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3564]='*1-15. Kusalattika-maggārammaṇattikaṃ*';
P_HTM[3565]='****27*. Kusalaṃ maggārammaṇaṃ dhammaṃ paṭicca nakusalo namaggārammaṇo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3566]='*Kusalaṃ maggahetukaṃ dhammaṃ paṭicca nakusalo namaggahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3567]='*Kusalaṃ maggādhipatiṃ dhammaṃ paṭicca nakusalo namaggādhipati dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3568]='*1-16. Kusalattika-uppannattikaṃ*';
P_HTM[3569]='****28*. Kusalo anuppanno dhammo nakusalassa naanuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe aṭṭhārasa. (Uppādī anuppannasadisaṃ.)*';
P_HTM[3570]='*1-17. Kusalattika-atītattikaṃ*';
P_HTM[3571]='****29*. Kusalo atīto dhammo nakusalassa naatītassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[3572]='*Ārammaṇe aṭṭhārasa. (Anāgataṃ atītasadisaṃ.)*';
P_HTM[3573]='*1-18. Kusalattika-atītārammaṇattikaṃ*';
P_HTM[3574]='****30*. Kusalaṃ atītārammaṇaṃ dhammaṃ paṭicca nakusalo naatītārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3575]='*Kusalaṃ **anāgatārammaṇaṃ dhammaṃ paṭicca nakusalo naanāgatārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3576]='*Kusalaṃ paccuppannārammaṇaṃ dhammaṃ paṭicca nakusalo napaccuppannārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3577]='*1-19-20. Kusalattika-ajjhattattikadvayaṃ*';
P_HTM[3578]='****31*. Kusalo ajjhatto dhammo naajjhattassa nakusalassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)… Ārammaṇe aṭṭhārasa.*';
P_HTM[3579]='*Kusalo bahiddhā dhammo nabahiddhā nakusalassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)… Ārammaṇe aṭṭhārasa.*';
P_HTM[3580]='****32*. Kusalaṃ ajjhattārammaṇaṃ dhammaṃ paṭicca nakusalo naajjhattārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3581]='*Kusalaṃ bahiddhārammaṇaṃ dhammaṃ paṭicca nakusalo nabahiddhārammaṇo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3582]='*1-21. Kusalattika-sanidassanattikaṃ*';
P_HTM[3583]='****33*. Abyākato sanidassanasappaṭigho dhammo naabyākatassa nasanidassanasappaṭighassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha. (Tīṇi veditakaṃ kātabbaṃ.)*';
P_HTM[3584]='****34*. Abyākataṃ anidassanasappaṭighaṃ dhammaṃ paṭicca kusalo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ anidassanasappaṭighaṃ dhammaṃ paṭicca naakusalo naanidassanasappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ anidassanasappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanasappaṭigho ca naakusalo naanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3585]='****35*. Kusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Kusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca naakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā**. Kusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho ca naakusalo naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3586]='*Akusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca naakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Akusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Akusalaṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho ca naakusalo naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3587]='*Abyākataṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ anidassanaappaṭighaṃ dhammaṃ paṭicca naakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā. Abyākataṃ anidassanaappaṭighaṃ dhammaṃ paṭicca nakusalo naanidassanaappaṭigho ca naakusalo naanidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3588]='*Kusalaṃ anidassanaappaṭighañca abyākataṃ anidassanaappaṭighañca dhammaṃ paṭicca nakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3589]='*Akusalaṃ anidassanaappaṭighañca abyākataṃ anidassanaappaṭighañca dhammaṃ paṭicca nakusalo naanidassanaappaṭigho dhammo uppajjati hetupaccayā… tīṇi… hetuyā pannarasa.*';
P_HTM[3590]='*2-1. Vedanāttika-kusalattikaṃ*';
P_HTM[3591]='****36*. Sukhāya * vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā**. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca nadukkhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā. Sukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo ca nadukkhāya vedanāya sampayutto nakusalo ca naadukkhamasukhāya vedanāya sampayutto nakusalo ca dhammā uppajjanti hetupaccayā. Satta.*';
P_HTM[3592]='*Adukkhamasukhāya vedanāya sampayuttaṃ kusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā… satta… hetuyā cuddasa.*';
P_HTM[3593]='****37*. Sukhāya vedanāya sampayuttaṃ akusalaṃ dhammaṃ paṭicca nasukhāya vedanāya sampayutto nakusalo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3594]='*Dukkhāya vedanāya sampayuttaṃ akusalaṃ dhammaṃ paṭicca nadukkhāya vedanāya sampayutto naakusalo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3595]='*Adukkhamasukhāya vedanāya sampayuttaṃ akusalaṃ dhammaṃ paṭicca naadukkhamasukhāya vedanāya sampayutto naakusalo dhammo uppajjati hetupaccayā… satta. (Ekavīsati pañhā.)*';
P_HTM[3596]='****38*. Sukhāya vedanāya sampayutto abyākato dhammo nasukhāya vedanāya sampayuttassa naabyākatassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[3597]='*Ārammaṇe ekavīsati. (Dukkhāya vedanāya sampayuttaabyākatamūlaṃ adukkhamasukhāya vedanāya sampayuttaabyākatamūlampi kātabbaṃ.)*';
P_HTM[3598]='*3-1. Vipākattika-kusalattikaṃ*';
P_HTM[3599]='****39*. Vipākadhammadhammaṃ kusalaṃ dhammaṃ paṭicca navipākadhammadhammo nakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3600]='*Vipākadhammadhammaṃ ** akusalaṃ dhammaṃ paṭicca navipākadhammadhammo naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3601]='*Nevavipākanavipākadhammadhammaṃ abyākataṃ dhammaṃ paccayā nanevavipākanavipākadhammadhammo naabyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3602]='*4-1. Upādinnattika-kusalattikaṃ*';
P_HTM[3603]='****40*. Anupādinnupādāniyaṃ kusalaṃ dhammaṃ paṭicca naupādinnupādāniyo nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3604]='*Anupādinnaanupādāniyaṃ kusalaṃ dhammaṃ paṭicca naanupādinnaanupādāniyo nakusalo dhammo uppajjati hetupaccayā… tīṇi hetuyā cha.*';
P_HTM[3605]='*Anupādinnupādāniyaṃ akusalaṃ dhammaṃ paṭicca naupādinnupādāniyo naakusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3606]='*Upādinnupādāniyaṃ abyākataṃ dhammaṃ paccayā naupādinnupādāniyo naabyākato dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3607]='*5-1. Saṃkiliṭṭhattika-kusalattikaṃ*';
P_HTM[3608]='****41*. Asaṃkiliṭṭhasaṃkilesikaṃ kusalaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3609]='*Asaṃkiliṭṭhaasaṃkilesikaṃ kusalaṃ dhammaṃ paṭicca naasaṃkiliṭṭhaasaṃkilesiko nakusalo dhammo uppajjati hetupaccayā… tīṇi… hetuyā cha.*';
P_HTM[3610]='*Saṃkiliṭṭhasaṃkilesikaṃ akusalaṃ dhammaṃ paṭicca nasaṃkiliṭṭhasaṃkilesiko naakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3611]='*Asaṃkiliṭṭhasaṃkilesikaṃ abyākataṃ dhammaṃ paccayā naasaṃkiliṭṭhasaṃkilesiko naabyākato dhammo uppajjati hetupaccayā… (saṃkhittaṃ.) Hetuyā cha…pe… avigate cha.*';
P_HTM[3612]='*6-1. Vitakkattika-kusalattikaṃ*';
P_HTM[3613]='****42*. Savitakkasavicāraṃ kusalaṃ dhammaṃ paṭicca nasavitakkasavicāro nakusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3614]='*Avitakkavicāramattaṃ ** kusalaṃ dhammaṃ paṭicca naavitakkavicāramatto nakusalo dhammo uppajjati hetupaccayā… hetuyā pannarasa.*';
P_HTM[3615]='*Savitakkasavicāraṃ akusalaṃ dhammaṃ paṭicca nasavitakkasavicāro naakusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3616]='*7-1. Pītittika-kusalattikaṃ*';
P_HTM[3617]='****43*. Pītisahagataṃ kusalaṃ dhammaṃ paṭicca napītisahagato nakusalo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3618]='*Sukhasahagataṃ kusalaṃ dhammaṃ paṭicca nasukhasahagato nakusalo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3619]='*Upekkhāsahagataṃ kusalaṃ dhammaṃ paṭicca naupekkhāsahagato nakusalo dhammo uppajjati hetupaccayā…  (Vedanāttikasadisaṃ. Saṃkhittaṃ.)*';
P_HTM[3620]='*22-1. Sanidassanattika-kusalattikaṃ*';
P_HTM[3621]='****44*. Anidassanaappaṭighaṃ kusalaṃ dhammaṃ paṭicca naanidassanaappaṭigho nakusalo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ kusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ kusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo ca naanidassanasappaṭigho nakusalo ca dhammā uppajjanti hetupaccayā… hetuyā cha.*';
P_HTM[3622]='*Anidassanaappaṭighaṃ akusalaṃ dhammaṃ paṭicca naanidassanaappaṭigho naakusalo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ akusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ akusalaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nakusalo ca naanidassanasappaṭigho naakusalo ca dhammā uppajjanti hetupaccayā (saṃkhittaṃ.) Hetuyā cha…pe… avigate cha.*';
P_HTM[3623]='*Anidassanaappaṭighaṃ abyākataṃ dhammaṃ paccayā nasanidassanasappaṭigho naabyākato dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ abyākataṃ dhammaṃ paccayā naanidassanasappaṭigho naabyākato dhammo uppajjati hetupaccayā**. Anidassanaappaṭighaṃ abyākataṃ dhammaṃ paccayā nasanidassanasappaṭigho naabyākato ca naanidassanasappaṭigho naabyākato ca dhammā uppajjanti hetupaccayā… hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[3624]='*22-2. Sanidassanattika-vedanāttikaṃ*';
P_HTM[3625]='****45*. Anidassanaappaṭighaṃ sukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3626]='*Anidassanaappaṭighaṃ dukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho nadukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3627]='*Anidassanaappaṭighaṃ adukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca naanidassanaappaṭigho naadukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3628]='*22-3. Sanidassanattika-vipākattikaṃ*';
P_HTM[3629]='****46*. Anidassanaappaṭighaṃ vipākaṃ dhammaṃ paṭicca naanidassanaappaṭigho navipāko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3630]='*Anidassanaappaṭighaṃ vipākadhammadhammaṃ paṭicca naanidassanaappaṭigho navipākadhammadhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3631]='*Anidassanaappaṭighaṃ nevavipākanavipākadhammadhammaṃ paṭicca nasanidassanasappaṭigho nanevavipākanavipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3632]='*22-4. Sanidassanattika-upādinnattikaṃ*';
P_HTM[3633]='****47*. Anidassanaappaṭighaṃ upādinnupādāniyaṃ dhammaṃ paṭicca naanidassanaappaṭigho naupādinnupādāniyo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3634]='*Sanidassanasappaṭigho anupādinnupādāniyo dhammo nasanidassanasappaṭighassa naanupādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo… (saṃkhittaṃ.) ** Ārammaṇe nava, anantare tīṇi…pe… upanissaye purejāte nava…pe… avigate nava.*';
P_HTM[3635]='*Anidassanaappaṭighaṃ anupādinnaanupādāniyaṃ dhammaṃ paṭicca naanidassanaappaṭigho naanupādinnaanupādāniyo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3636]='*22-5. Sanidassanattika-saṃkiliṭṭhattikaṃ*';
P_HTM[3637]='****48*. Anidassanaappaṭighaṃ saṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca naanidassanaappaṭigho nasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3638]='*Anidassanaappaṭighaṃ asaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā nasanidassanasappaṭigho naasaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3639]='*Anidassanaappaṭighaṃ asaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca naanidassanaappaṭigho naasaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3640]='*22-6-20. Sanidassanattika-vitakkattikādi*';
P_HTM[3641]='****49*. Anidassanaappaṭighaṃ savitakkasavicāraṃ dhammaṃ paṭicca naanidassanaappaṭigho nasavitakkasavicāro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3642]='*Anidassanaappaṭighaṃ avitakkavicāramattaṃ dhammaṃ paṭicca naanidassanaappaṭigho naavitakkavicāramatto dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3643]='*Anidassanaappaṭighaṃ avitakkaavicāraṃ dhammaṃ paṭicca nasanidassanasappaṭigho naavitakkaavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3644]='*22-21. Sanidassanattika-ajjhattārammaṇattikaṃ*';
P_HTM[3645]='****50*. Anidassanaappaṭighaṃ ajjhattārammaṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho naajjhattārammaṇo dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[3646]='*Anidassanaappaṭighaṃ ** bahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanaappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ bahiddhārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā. Anidassanaappaṭighaṃ bahiddhārammaṇaṃ dhammaṃ paṭicca naanidassanasappaṭigho nabahiddhārammaṇo dhammo uppajjati hetupaccayā…pe… anidassanaappaṭighaṃ bahiddhārammaṇaṃ dhammaṃ paṭicca nasanidassanasappaṭigho nabahiddhārammaṇo ca naanidassanasappaṭigho nabahiddhārammaṇo ca dhammā uppajjanti hetupaccayā. Hetuyā cha…pe… avigate cha. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[3647]='*Dhammānulomapaccanīye tikatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3648]='*Dhammānulomapaccanīye dukadukapaṭṭhānaṃ*';
P_HTM[3649]='*1-1. Hetuduka-sahetukadukaṃ*';
P_HTM[3650]='****1*. Hetuṃ **sahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. Nahetuṃ sahetukaṃ dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. Hetuṃ sahetukañca nahetuṃ sahetukañca dhammaṃ paṭicca nahetu nasahetuko dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi, ārammaṇe ekaṃ…pe… avigate pañca.*';
P_HTM[3651]='****2*. Nahetuṃ sahetukaṃ dhammaṃ paṭicca nanahetu nasahetuko dhammo uppajjati nahetupaccayā… (saṃkhittaṃ.) Nahetuyā ekaṃ, naārammaṇe tīṇi…pe… novigate tīṇi.*';
P_HTM[3652]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[3653]='*Hetu-ārammaṇapaccayā*';
P_HTM[3654]='****3*. Hetu sahetuko dhammo nahetussa nasahetukassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[3655]='*Hetu sahetuko dhammo nahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko dhammo nanahetussa nasahetukassa * dhammassa ārammaṇapaccayena paccayo. Hetu sahetuko dhammo nahetussa nasahetukassa ca nanahetussa nasahetukassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[3656]='*Nahetu sahetuko dhammo nanahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu sahetuko dhammo nahetussa nasahetukassa dhammassa ārammaṇapaccayena paccayo. Nahetu sahetuko dhammo nahetussa nasahetukassa ca nanahetussa nasahetukassa ca dhammassa ārammaṇapaccayena paccayo. (3) (Saṃkhittaṃ.)*';
P_HTM[3657]='*Hetuyā ekaṃ, ārammaṇe cha, adhipatiyā dve…pe… avigate pañca. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[3658]='****4*. Hetuṃ ahetukaṃ dhammaṃ paṭicca nahetu naahetuko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[3659]='*Nahetuṃ ahetukaṃ dhammaṃ paṭicca nanahetu naahetuko dhammo uppajjati hetupaccayā… tīṇi. (Saṃkhittaṃ.) Hetuyā cattāri.*';
P_HTM[3660]='*1-2. Hetuduka-hetusampayuttadukaṃ*';
P_HTM[3661]='****5*. Hetuṃ hetusampayuttaṃ dhammaṃ paṭicca nahetu nahetusampayutto dhammo uppajjati hetupaccayā… tīṇi. (Sahetukasadisaṃ.)*';
P_HTM[3662]='*Hetuṃ hetuvippayuttaṃ dhammaṃ paṭicca nahetu nahetuvippayutto dhammo uppajjati hetupaccayā. (1)*';
P_HTM[3663]='*Nahetuṃ hetuvippayuttaṃ dhammaṃ paṭicca nanahetu nahetuvippayutto dhammo uppajjati hetupaccayā… tīṇi. Hetuyā cattāri.*';
P_HTM[3664]='*1-3-5. Hetuduka-hetusahetukādidukāni*';
P_HTM[3665]='****6*. Hetuṃ hetuñceva sahetukañca dhammaṃ paṭicca nahetu nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3666]='*Nahetuṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca nanahetu naahetuko ceva nanahetu ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3667]='****7*. Hetuṃ **hetuñceva hetusampayuttañca dhammaṃ paṭicca nahetu nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3668]='*Nahetuṃ hetusampayuttañceva na ca hetuṃ dhammaṃ paṭicca nanahetu nahetuvippayutto ceva nanahetu ca dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3669]='****8*. Nahetuṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nahetu nahetu nasahetuko dhammo uppajjati hetupaccayā. Hetuyā adhipatiyā ekaṃ.*';
P_HTM[3670]='*Nahetuṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nahetu nahetu naahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3671]='*1-6-12. Hetuduka-cūḷantaradukādi*';
P_HTM[3672]='****9*. Nahetu appaccayo dhammo nanahetussa naappaccayassa dhammassa ārammaṇapaccayena paccayo…pe… nahetu appaccayo dhammo nahetussa naappaccayassa dhammassa ārammaṇapaccayena paccayo. Nahetu appaccayo dhammo nahetussa naappaccayassa ca nanahetussa naappaccayassa ca dhammassa ārammaṇapaccayena paccayo…pe…. (Asaṅkhataṃ appaccayasadisaṃ.)*';
P_HTM[3673]='****10*. Nahetu sanidassano dhammo nanahetussa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. Nahetu sanidassano dhammo nahetussa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. Nahetu sanidassano dhammo nahetussa nasanidassanassa ca nanahetussa nasanidassanassa ca dhammassa ārammaṇapaccayena paccayo. Ārammaṇe tīṇi.*';
P_HTM[3674]='*Hetuṃ anidassanaṃ dhammaṃ paṭicca nahetu naanidassano dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3675]='****11*. Nahetuṃ sappaṭighaṃ dhammaṃ paṭicca nahetu nasappaṭigho dhammo uppajjati hetupaccayā… hetuyā ekaṃ.*';
P_HTM[3676]='*Hetuṃ appaṭighaṃ dhammaṃ paṭicca nahetu naappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3677]='****12*. Nahetuṃ ** rūpiṃ dhammaṃ paṭicca nanahetu narūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3678]='*Hetuṃ arūpiṃ dhammaṃ paṭicca nahetu naarūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3679]='****13*. Nahetuṃ lokiyaṃ dhammaṃ paccayā nanahetu nalokiyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3680]='*Hetuṃ lokuttaraṃ dhammaṃ paṭicca nahetu nalokuttaro dhammo uppajjati hetupaccayā. Nahetuṃ lokuttaraṃ dhammaṃ paṭicca nahetu nalokuttaro dhammo uppajjati hetupaccayā. Hetuṃ lokuttarañca nahetuṃ lokuttarañca dhammaṃ paṭicca nahetu nalokuttaro dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3681]='****14*. Hetuṃ kenaci viññeyyaṃ dhammaṃ paṭicca nahetu nakenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3682]='*Hetuṃ nakenaci viññeyyaṃ dhammaṃ paṭicca nahetu nanakenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3683]='*1-13-18. Hetuduka-āsavagocchakaṃ*';
P_HTM[3684]='****15*. Hetuṃ āsavaṃ dhammaṃ paṭicca nahetu naāsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3685]='*Hetuṃ noāsavaṃ dhammaṃ paṭicca nanahetu nanoāsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3686]='****16*. Nahetuṃ sāsavaṃ dhammaṃ paccayā nanahetu nasāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3687]='*Hetuṃ anāsavaṃ dhammaṃ paṭicca nahetu naanāsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3688]='****17*. Hetuṃ āsavasampayuttaṃ dhammaṃ paṭicca nahetu naāsavasampayutto dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3689]='*Hetuṃ ** āsavavippayuttaṃ dhammaṃ paṭicca nahetu naāsavavippayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3690]='****18*. Hetuṃ āsavañceva sāsavañca dhammaṃ paṭicca nahetu naāsavo ceva naanāsavo ca dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3691]='*Hetuṃ sāsavañceva no ca āsavaṃ dhammaṃ paṭicca nanahetu naanāsavo ceva nano ca āsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3692]='****19*. Hetuṃ āsavañceva āsavasampayuttañca dhammaṃ paṭicca nahetu naāsavo ceva naāsavavippayutto ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3693]='*Nahetuṃ āsavasampayuttañceva no ca āsavaṃ dhammaṃ paṭicca nanahetu naāsavavippayutto ceva nanoāsavo ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3694]='****20*. Nahetuṃ āsavavippayuttaṃ sāsavaṃ dhammaṃ paccayā nanahetu āsavavippayutto nasāsavo dhammo uppajjati hetupaccayā. (Lokiyasadisaṃ.)*';
P_HTM[3695]='*Hetuṃ āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca nahetu āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. Nahetuṃ āsavavippayuttaṃ anāsavaṃ dhammaṃ paṭicca nahetu āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. Hetuṃ āsavavippayuttaṃ anāsavañca nahetuṃ āsavavippayuttaṃ anāsavañca dhammaṃ paṭicca nahetu āsavavippayutto naanāsavo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3696]='*1-19-53. Hetuduka-saññojanādigocchakaṃ*';
P_HTM[3697]='****21*. Hetuṃ saññojanaṃ dhammaṃ paṭicca nahetu nosaññojano dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3698]='****22*. Hetuṃ ganthaṃ dhammaṃ paṭicca nahetu nogantho dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3699]='****23*. Hetuṃ ** oghaṃ dhammaṃ paṭicca nahetu noogho dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3700]='****24*. Hetuṃ yogaṃ dhammaṃ paṭicca nahetu noyogo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3701]='****25*. Hetuṃ nīvaraṇaṃ dhammaṃ paṭicca nahetu nonīvaraṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3702]='****26*. Nahetuṃ parāmāsaṃ dhammaṃ paṭicca nanahetu noparāmāso dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3703]='*1-54-81. Hetuduka-mahantaradukādi*';
P_HTM[3704]='****27*. Hetuṃ sārammaṇaṃ dhammaṃ paṭicca nahetu nasārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3705]='*Nahetuṃ anārammaṇaṃ dhammaṃ paṭicca nanahetu naanārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3706]='****28*. Nahetuṃ cittaṃ dhammaṃ paṭicca nanahetu nocitto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3707]='*Hetuṃ nocittaṃ dhammaṃ paṭicca nahetu nanocitto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3708]='****29*. Hetuṃ cetasikaṃ dhammaṃ paṭicca nahetu nacetasiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3709]='*Nahetuṃ acetasikaṃ dhammaṃ paṭicca nanahetu naacetasiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3710]='****30*. Hetuṃ cittasampayuttaṃ dhammaṃ paṭicca nahetu nacittasampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3711]='*Nahetuṃ cittavippayuttaṃ dhammaṃ paṭicca nanahetu nacittavippayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3712]='****31*. Hetuṃ ** cittasaṃsaṭṭhaṃ dhammaṃ paṭicca nahetu nacittasaṃsaṭṭho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3713]='*Nahetuṃ cittavisaṃsaṭṭhaṃ dhammaṃ paṭicca nanahetu nacittavisaṃsaṭṭho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3714]='****32*. Hetuṃ cittasamuṭṭhānaṃ dhammaṃ paṭicca nahetu nocittasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3715]='*Nahetuṃ nocittasamuṭṭhānaṃ dhammaṃ paṭicca nanahetu nanocittasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3716]='****33*. Hetuṃ cittasahabhuṃ dhammaṃ paṭicca nahetu nocittasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3717]='*Nahetuṃ nocittasahabhuṃ dhammaṃ paṭicca nanahetu nanocittasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3718]='****34*. Hetuṃ cittānuparivattiṃ dhammaṃ paṭicca nahetu nocittānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3719]='*Nahetuṃ nocittānuparivattiṃ dhammaṃ paṭicca nanahetu nanocittānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3720]='****35*. Hetuṃ cittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3721]='*Nahetuṃ nocittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca nanahetu nanocittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3722]='****36*. Hetuṃ cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3723]='*Nahetuṃ nocittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca nanahetu nanocittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3724]='****37*. Hetuṃ cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca nahetu nocittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3725]='*Nahetuṃ ** nocittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca nanahetu nanocittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā tīṇi (saṃkhittaṃ. Nayavasena vitthāretabbaṃ).*';
P_HTM[3726]='*1-82-98. Hetuduka-dassanenapahātabbadukādi*';
P_HTM[3727]='****38*. Hetuṃ dassanena pahātabbaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3728]='*Nahetuṃ nadassanena pahātabbaṃ dhammaṃ paccayā nanahetu nanadassanena pahātabbo dhammo uppajjati hetupaccayā… tīṇimeva.*';
P_HTM[3729]='****39*. Hetuṃ dassanena pahātabbahetukaṃ dhammaṃ paṭicca nahetu nadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3730]='*Nahetuṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca nanahetu nanadassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā ekaṃ.*';
P_HTM[3731]='*1-99. Hetuduka-saraṇadukaṃ*';
P_HTM[3732]='****40*. Hetuṃ saraṇaṃ dhammaṃ paṭicca nahetu nasaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ saraṇaṃ dhammaṃ paṭicca nahetu nasaraṇo dhammo uppajjati hetupaccayā. Hetuṃ saraṇañca nahetuṃ saraṇañca dhammaṃ paṭicca nahetu nasaraṇo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3733]='*Nahetuṃ araṇaṃ dhammaṃ paccayā nanahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ araṇaṃ dhammaṃ paccayā nahetu naaraṇo dhammo uppajjati hetupaccayā. Nahetuṃ araṇaṃ dhammaṃ paccayā nahetu naaraṇo ca nanahetu naaraṇo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3734]='*2-1. Sahetukaduka-hetudukaṃ*';
P_HTM[3735]='****41*. Sahetukaṃ hetuṃ dhammaṃ paṭicca nasahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3736]='*Ahetukaṃ ** hetuṃ dhammaṃ paṭicca naahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cha.*';
P_HTM[3737]='*Sahetukaṃ nahetuṃ dhammaṃ paṭicca naahetuko nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3738]='*3-1. Hetusampayuttaduka-hetudukaṃ*';
P_HTM[3739]='****42*. Hetusampayuttaṃ hetuṃ dhammaṃ paṭicca nahetusampayutto nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3740]='*Hetuvippayuttaṃ hetuṃ dhammaṃ paṭicca nahetuvippayutto nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cha.*';
P_HTM[3741]='*Hetusampayuttaṃ nahetuṃ dhammaṃ paṭicca nahetuvippayutto nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3742]='*4-1. Hetusahetukaduka-hetudukaṃ*';
P_HTM[3743]='****43*. Hetuñceva sahetukaṃ hetuṃ dhammaṃ paṭicca nahetu ceva naahetuko ca nahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3744]='*Sahetukañceva na ca hetuṃ nahetuṃ dhammaṃ paṭicca naahetuko ceva nana ca hetu nanahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3745]='*5-1. Hetuhetusampayuttaduka-hetudukaṃ*';
P_HTM[3746]='****44*. Hetuñceva hetusampayuttañca hetuṃ dhammaṃ paṭicca nahetu ceva nahetuvippayutto ca nahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3747]='*Hetusampayuttañceva na ca hetuṃ nahetuṃ dhammaṃ paṭicca nahetuvippayutto ceva nana ca hetu nanahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3748]='*7-13-1. Cūḷantaradukādi-hetudukaṃ*';
P_HTM[3749]='****45*. Sappaccayaṃ hetuṃ dhammaṃ paṭicca naappaccayo nahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3750]='*Sappaccayaṃ **nahetuṃ dhammaṃ paṭicca naappaccayo nanahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Saṅkhataṃ sappaccayasadisaṃ).*';
P_HTM[3751]='****46*. Anidassanaṃ hetuṃ dhammaṃ paṭicca naanidassano nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3752]='*Anidassanaṃ nahetuṃ dhammaṃ paṭicca nasanidassano nanahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3753]='****47*. Appaṭighaṃ hetuṃ dhammaṃ paṭicca naappaṭigho nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3754]='*Appaṭighaṃ nahetuṃ dhammaṃ paṭicca nasappaṭigho nanahetu dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3755]='****48*. Arūpiṃ hetuṃ dhammaṃ paṭicca naarūpī nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3756]='*Rūpiṃ nahetuṃ dhammaṃ paṭicca narūpī nanahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3757]='*Arūpiṃ nahetuṃ dhammaṃ paṭicca naarūpī nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3758]='****49*. Lokiyaṃ hetuṃ dhammaṃ paṭicca nalokuttaro nahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3759]='*Lokuttaraṃ hetuṃ dhammaṃ paṭicca nalokuttaro nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cattāri.*';
P_HTM[3760]='*Lokiyaṃ nahetuṃ dhammaṃ paṭicca nalokuttaro nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3761]='*Lokuttaraṃ nahetuṃ dhammaṃ paṭicca nalokiyo nanahetu dhammo uppajjati hetupaccayā ekaṃ… hetuyā dve.*';
P_HTM[3762]='****50*. Kenaci viññeyyaṃ hetuṃ dhammaṃ paṭicca nakenaci viññeyyo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3763]='*Nakenaci viññeyyaṃ hetuṃ dhammaṃ paṭicca nanakenaci viññeyyo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3764]='*Kenaci ** viññeyyaṃ hetuñca nakenaci viññeyyaṃ hetuñca dhammaṃ paṭicca nakenaci viññeyyo nahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3765]='*Kenaci viññeyyaṃ nahetuṃ dhammaṃ paṭicca nakenaci viññeyyo nanahetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[3766]='*14-1. Āsavaduka-hetudukaṃ*';
P_HTM[3767]='****51*. Āsavaṃ hetuṃ dhammaṃ paṭicca noāsavo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3768]='*Noāsavaṃ hetuṃ dhammaṃ paṭicca nanoāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3769]='*Āsavaṃ hetuñca noāsavaṃ hetuñca dhammaṃ paṭicca noāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ (sabbattha pañca.)*';
P_HTM[3770]='*Noāsavaṃ nahetuṃ dhammaṃ paṭicca nanoāsavo nanahetu dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3771]='*15-1. Sāsavaduka-hetudukaṃ*';
P_HTM[3772]='****52*. Sāsavaṃ hetuṃ dhammaṃ paṭicca naanāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3773]='*Anāsavaṃ hetuṃ dhammaṃ paṭicca naanāsavo nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cattāri. (Lokiyadukasadisaṃ.)*';
P_HTM[3774]='*16-1. Āsavasampayuttaduka-hetudukaṃ*';
P_HTM[3775]='****53*. Āsavasampayuttaṃ hetuṃ dhammaṃ paṭicca naāsavasampayutto nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3776]='*Āsavavippayuttaṃ hetuṃ dhammaṃ paṭicca naāsavavippayutto nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3777]='*Āsavasampayuttaṃ hetuñca āsavavippayuttaṃ hetuñca dhammaṃ paṭicca naāsavasampayutto nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā nava.*';
P_HTM[3778]='*Āsavasampayuttaṃ nahetuṃ dhammaṃ paṭicca naāsavasampayutto nanahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3779]='*Āsavavippayuttaṃ ** nahetuṃ dhammaṃ paṭicca naāsavasampayutto nanahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3780]='*17-1. Āsavasāsavaduka-hetudukaṃ*';
P_HTM[3781]='****54*. Āsavañceva sāsavañca hetuṃ dhammaṃ paṭicca naāsavo ceva naanāsavo ca nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3782]='*Sāsavañceva no ca āsavaṃ hetuṃ dhammaṃ paṭicca naāsavo ceva naanāsavo ca nahetu dhammo uppajjati hetupaccayā… ekaṃ.*';
P_HTM[3783]='*Āsavañceva sāsavaṃ hetuñca sāsavañceva no ca āsavaṃ hetuñca dhammaṃ paṭicca naāsavo ceva naanāsavo ca nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā pañca.*';
P_HTM[3784]='*Āsavañceva sāsavañca nahetuṃ dhammaṃ paṭicca naanāsavo ceva nanoāsavo ca nanahetu dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[3785]='*18-1. Āsavaāsavasampayuttaduka-hetudukaṃ*';
P_HTM[3786]='****55*. Āsavañceva āsavasampayuttañca hetuṃ dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3787]='*Āsavasampayuttañceva no ca āsavaṃ hetuṃ dhammaṃ paṭicca naāsavo ceva naāsavavippayutto ca nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3788]='*Āsavañceva āsavasampayuttañca nahetuṃ dhammaṃ paṭicca naāsavavippayutto ceva nano ca āsavo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3789]='*Āsavasampayuttañceva no ca āsavaṃ nahetuṃ dhammaṃ paṭicca naāsavavippayutto ceva nano ca āsavo nanahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cattāri.*';
P_HTM[3790]='*19-1. Āsavavippayuttasāsavaduka-hetudukaṃ*';
P_HTM[3791]='****56*. Āsavavippayuttaṃ sāsavaṃ hetuṃ dhammaṃ paṭicca āsavavippayutto naanāsavo nahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3792]='*Āsavavippayuttaṃ ** anāsavaṃ hetuṃ dhammaṃ paṭicca āsavavippayutto naanāsavo nahetu dhammo uppajjati hetupaccayā… tīṇi… hetuyā cattāri.*';
P_HTM[3793]='*Āsavavippayuttaṃ sāsavaṃ nahetuṃ dhammaṃ paṭicca āsavavippayutto naanāsavo nanahetu dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ anāsavaṃ nahetuṃ dhammaṃ paṭicca āsavavippayutto nasāsavo nanahetu dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[3794]='*20-54-1. Saññojanagocchakādi-hetudukaṃ*';
P_HTM[3795]='****57*. Saññojanaṃ hetuṃ dhammaṃ paṭicca nosaññojano nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3796]='****58*. Ganthaṃ hetuṃ dhammaṃ paṭicca nogantho nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3797]='****59*. Oghaṃ hetuṃ dhammaṃ paṭicca noogho nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3798]='****60*. Yogaṃ hetuṃ dhammaṃ paṭicca noyogo nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3799]='****61*. Nīvaraṇaṃ hetuṃ dhammaṃ paṭicca nonīvaraṇo nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3800]='****62*. Noparāmāsaṃ hetuṃ dhammaṃ paṭicca nanoparāmāso nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3801]='*55-68-1. Mahantaradukādi-hetudukaṃ*';
P_HTM[3802]='****63*. Sārammaṇaṃ hetuṃ dhammaṃ paṭicca nasārammaṇo nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3803]='*Sārammaṇaṃ nahetuṃ dhammaṃ paṭicca naanārammaṇo nanahetu dhammo uppajjati hetupaccayā. Anārammaṇaṃ nahetuṃ dhammaṃ paṭicca naanārammaṇo nanahetu dhammo ** uppajjati hetupaccayā. Sārammaṇaṃ nahetuñca anārammaṇaṃ nahetuñca dhammaṃ paṭicca naanārammaṇo nanahetu dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[3804]='****64*. Nocittaṃ hetuṃ dhammaṃ paṭicca nanocitto nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3805]='*Cittaṃ nahetuṃ dhammaṃ paṭicca nocitto nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3806]='****65*. Cetasikaṃ hetuṃ dhammaṃ paṭicca nacetasiko nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3807]='*Cetasikaṃ nahetuṃ dhammaṃ paṭicca naacetasiko nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3808]='****66*. Cittasampayuttaṃ hetuṃ dhammaṃ paṭicca nacittasampayutto nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Saṃkhittaṃ.)*';
P_HTM[3809]='****67*. Cittasaṃsaṭṭhaṃ hetuṃ dhammaṃ paṭicca nacittasaṃsaṭṭho nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3810]='****68*. Cittasamuṭṭhānaṃ hetuṃ dhammaṃ paṭicca nocittasamuṭṭhāno nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3811]='****69*. Cittasahabhuṃ hetuṃ dhammaṃ paṭicca nocittasahabhū nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3812]='****70*. Cittānuparivattiṃ hetuṃ dhammaṃ paṭicca nocittānuparivattī nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3813]='****71*. Cittasaṃsaṭṭhasamuṭṭhānaṃ hetuṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhāno nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3814]='****72*. Cittasaṃsaṭṭhasamuṭṭhānasahabhuṃ hetuṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānasahabhū nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3815]='****73*. Cittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ ** hetuṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānānuparivattī nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3816]='****74*. Bāhiraṃ hetuṃ dhammaṃ paṭicca nabāhiro nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3817]='*Ajjhattikaṃ nahetuṃ dhammaṃ paṭicca naajjhattiko nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3818]='****75*. Noupādā hetuṃ dhammaṃ paṭicca nanoupādā nahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3819]='*Upādā nahetuṃ dhammaṃ paṭicca noupādā nanahetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[3820]='****76*. Upādinnaṃ hetuṃ dhammaṃ paṭicca naupādinno nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3821]='*Anupādinnaṃ hetuṃ dhammaṃ paṭicca naupādinno nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3822]='*Upādinnaṃ nahetuṃ dhammaṃ paṭicca naanupādinno nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3823]='*Anupādinnaṃ nahetuṃ dhammaṃ paṭicca naupādinno nanahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3824]='*69-82-1. Upādānagocchakādi-hetudukaṃ*';
P_HTM[3825]='****77*. Upādānaṃ hetuṃ dhammaṃ paṭicca noupādāno nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3826]='****78*. Kilesaṃ hetuṃ dhammaṃ paṭicca nokileso nahetu dhammo uppajjati hetupaccayā.*';
P_HTM[3827]='*83-1. Piṭṭhiduka-hetudukaṃ*';
P_HTM[3828]='****79*. Dassanena ** pahātabbaṃ hetuṃ dhammaṃ paṭicca nadassanena pahātabbo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3829]='*Nadassanena pahātabbaṃ hetuṃ dhammaṃ paṭicca nadassanena pahātabbo nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3830]='*Dassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca nanadassanena pahātabbo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3831]='*Nadassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca nadassanena pahātabbo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3832]='****80*. Bhāvanāya pahātabbaṃ hetuṃ dhammaṃ paṭicca nabhāvanāya pahātabbo nahetu dhammo uppajjati hetupaccayā… tīṇi. Nabhāvanāya pahātabbaṃ hetuṃ dhammaṃ paṭicca nabhāvanāya pahātabbo nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3833]='*Bhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca nanabhāvanāya pahātabbo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3834]='*Nabhāvanāya pahātabbaṃ nahetuṃ dhammaṃ paṭicca nabhāvanāya pahātabbo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3835]='****81*. Dassanena pahātabbahetukaṃ hetuṃ dhammaṃ paṭicca nadassanena pahātabbahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3836]='*Nadassanena pahātabbahetukaṃ hetuṃ dhammaṃ paṭicca nanadassanena pahātabbahetuko nahetu dhammo uppajjati hetupaccayā… tīṇi. (Sabbattha pañhe saṃkhittaṃ.)*';
P_HTM[3837]='*Dassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca nanadassanena pahātabbahetuko nanahetu dhammo uppajjati hetupaccayā. Nadassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca nadassanena pahātabbahetuko nanahetu dhammo uppajjati hetupaccayā. Hetuyā dve. (Saṃkhittaṃ.)*';
P_HTM[3838]='*100-1-6. Saraṇaduka-hetudukādi*';
P_HTM[3839]='****82*. Saraṇaṃ ** hetuṃ dhammaṃ paṭicca nasaraṇo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3840]='*Araṇaṃ hetuṃ dhammaṃ paṭicca nasaraṇo nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā cattāri.*';
P_HTM[3841]='*Saraṇaṃ nahetuṃ dhammaṃ paṭicca naaraṇo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3842]='*Araṇaṃ nahetuṃ dhammaṃ paṭicca nasaraṇo nanahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3843]='****83*. Saraṇaṃ sahetukaṃ dhammaṃ paṭicca nasaraṇo nasahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3844]='*Araṇaṃ sahetukaṃ dhammaṃ paṭicca nasaraṇo nasahetuko dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3845]='*Saraṇaṃ ahetukaṃ dhammaṃ paṭicca naaraṇo naahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3846]='*Araṇaṃ ahetukaṃ dhammaṃ paṭicca nasaraṇo naahetuko dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3847]='****84*. Saraṇaṃ hetusampayuttaṃ dhammaṃ paṭicca nasaraṇo nahetusampayutto dhammo uppajjati hetupaccayā. Ekaṃ. Araṇaṃ hetusampayuttaṃ dhammaṃ paṭicca nasaraṇo nahetusampayutto dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve. (Sahetukadukasadisaṃ.)*';
P_HTM[3848]='****85*. Saraṇaṃ hetuñceva sahetukañca dhammaṃ paṭicca naaraṇo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3849]='*Araṇaṃ hetuñceva sahetukañca dhammaṃ paṭicca nasaraṇo nahetu ceva naahetuko ca dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3850]='*Saraṇaṃ sahetukañceva na ca hetuṃ dhammaṃ paṭicca naaraṇo naahetuko ceva nana ca hetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3851]='*Araṇaṃ ** sahetukañceva na ca hetuṃ dhammaṃ paṭicca nasaraṇo naahetuko ceva nana ca hetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3852]='****86*. Saraṇaṃ hetuñceva hetusampayuttañca dhammaṃ paṭicca naaraṇo nahetu ceva nahetuvippayutto ca dhammo uppajjati hetupaccayā. (Hetusahetukadukasadisaṃ.)*';
P_HTM[3853]='****87*. Saraṇaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nasaraṇo nahetu nasahetuko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3854]='*Araṇaṃ nahetuṃ sahetukaṃ dhammaṃ paṭicca nasaraṇo nahetu nasahetuko dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā dve.*';
P_HTM[3855]='*Araṇaṃ nahetuṃ ahetukaṃ dhammaṃ paṭicca nasaraṇo nahetu naahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3856]='*100-7-13. Saraṇaduka-cūḷantaradukādi*';
P_HTM[3857]='****88*. Araṇo appaccayo dhammo nasaraṇassa naappaccayassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[3858]='****89*. Araṇo asaṅkhato dhammo nasaraṇassa naasaṅkhatassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[3859]='****90*. Araṇo sanidassano dhammo naaraṇassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. Araṇo sanidassano dhammo nasaraṇassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)*';
P_HTM[3860]='*100-14-54. Saraṇaduka-āsavādigocchakāni*';
P_HTM[3861]='****91*. Saraṇaṃ āsavaṃ dhammaṃ paṭicca nasaraṇo noāsavo dhammo uppajjati hetupaccayā. Saraṇaṃ āsavaṃ dhammaṃ paṭicca naaraṇo noāsavo dhammo uppajjati hetupaccayā. Saraṇaṃ āsavaṃ dhammaṃ paṭicca nasaraṇo noāsavo ca naaraṇo noāsavo ca dhammā uppajjanti hetupaccayā.*';
P_HTM[3862]='*Saraṇaṃ **noāsavaṃ dhammaṃ paṭicca naaraṇo nanoāsavo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3863]='****92*. Araṇaṃ sāsavaṃ dhammaṃ paccayā nasaraṇo nasāsavo dhammo uppajjati hetupaccayā.*';
P_HTM[3864]='*Araṇaṃ anāsavaṃ dhammaṃ paṭicca nasaraṇo naanāsavo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ. (Etena upāyena sabbattha vitthāretabbaṃ.)*';
P_HTM[3865]='*100-55-82. Saraṇaduka-mahantaradukādi*';
P_HTM[3866]='****93*. Saraṇaṃ sārammaṇaṃ dhammaṃ paṭicca nasaraṇo nasārammaṇo dhammo uppajjati hetupaccayā. Araṇaṃ sārammaṇaṃ dhammaṃ paṭicca nasaraṇo nasārammaṇo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3867]='*100-83. Saraṇaduka-piṭṭhidukaṃ*';
P_HTM[3868]='****94*. Saraṇaṃ dassanena pahātabbaṃ dhammaṃ paṭicca nasaraṇo nadassanena pahātabbo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[3869]='*Araṇaṃ nadassanena pahātabbaṃ dhammaṃ paccayā naaraṇo nanadassanena pahātabbo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.)*';
P_HTM[3870]='****95*. Araṇaṃ sauttaraṃ dhammaṃ paccayā nasaraṇo nasauttaro dhammo uppajjati hetupaccayā.*';
P_HTM[3871]='*Araṇaṃ anuttaraṃ dhammaṃ paṭicca nasaraṇo naanuttaro dhammo uppajjati hetupaccayā. (Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[3872]='*Dhammānulomapaccanīye dukadukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3873]='*Anulomapaccanīyapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3874]='*Dhammapaccanīyānulome tikapaṭṭhānaṃ*';
P_HTM[3875]='*1. Kusalattikaṃ*';
P_HTM[3876]='*1-2. Paṭiccavārādi*';
P_HTM[3877]='*Paccayacatukkaṃ*';
P_HTM[3878]='*Hetu-ārammaṇapaccayā*';
P_HTM[3879]='****1*. Nakusalaṃ *dhammaṃ paṭicca akusalo dhammo uppajjati hetupaccayā. Akusalaṃ ekaṃ khandhaṃ paṭicca tayo khandhā…pe… dve khandhe paṭicca dve khandhā nakusalaṃ dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Vipākābyākataṃ kiriyābyākataṃ ekaṃ khandhaṃ paṭicca tayo khandhā cittasamuṭṭhānañca rūpaṃ…pe… nakusalaṃ dhammaṃ paṭicca akusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3880]='*Naakusalaṃ dhammaṃ paṭicca kusalo dhammo uppajjati hetupaccayā. Naakusalaṃ dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Naakusalaṃ dhammaṃ paṭicca kusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3881]='*Naabyākataṃ dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Naabyākataṃ dhammaṃ paṭicca kusalo dhammo uppajjati hetupaccayā. Naabyākataṃ dhammaṃ paṭicca akusalo dhammo uppajjati  Naabyākataṃ dhammaṃ paṭicca kusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Naabyākataṃ dhammaṃ paṭicca akusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3882]='*Nakusalañca ** naabyākatañca dhammaṃ paṭicca akusalo dhammo uppajjati hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Nakusalañca naabyākatañca dhammaṃ paṭicca akusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3883]='*Naakusalañca naabyākatañca dhammaṃ paṭicca kusalo dhammo uppajjati hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Naakusalañca naabyākatañca dhammaṃ paṭicca kusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3884]='*Nakusalañca naakusalañca dhammaṃ paṭicca abyākato dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3885]='****2*. Nakusalaṃ dhammaṃ paṭicca akusalo dhammo uppajjati ārammaṇapaccayā. Nakusalaṃ dhammaṃ paṭicca abyākato dhammo uppajjati ārammaṇapaccayā. Dve.*';
P_HTM[3886]='*Naakusalaṃ dhammaṃ paṭicca kusalo dhammo uppajjati ārammaṇapaccayā. Naakusalaṃ dhammaṃ paṭicca abyākato dhammo uppajjati ārammaṇapaccayā. Dve.*';
P_HTM[3887]='*Naabyākataṃ dhammaṃ paṭicca kusalo dhammo uppajjati ārammaṇapaccayā. Naabyākataṃ dhammaṃ paṭicca akusalo dhammo uppajjati ārammaṇapaccayā. Dve.*';
P_HTM[3888]='*Nakusalañca naabyākatañca dhammaṃ paṭicca akusalo dhammo uppajjati ārammaṇapaccayā. Ekaṃ.*';
P_HTM[3889]='*Naakusalañca naabyākatañca dhammaṃ paṭicca kusalo dhammo uppajjati ārammaṇapaccayā. Ekaṃ.*';
P_HTM[3890]='*Nakusalañca naakusalañca dhammaṃ paṭicca abyākato dhammo uppajjati ārammaṇapaccayā. Ekaṃ. Hetuyā aṭṭhārasa, ārammaṇe nava, adhipatiyā aṭṭhārasa…pe… avigate aṭṭhārasa.*';
P_HTM[3891]='*Paccanīyaṃ*';
P_HTM[3892]='*Nahetu-naārammaṇapaccayā*';
P_HTM[3893]='****3*. Nakusalaṃ dhammaṃ paṭicca akusalo dhammo uppajjati nahetupaccayā. Nakusalaṃ dhammaṃ paṭicca abyākato dhammo uppajjati nahetupaccayā…pe… nakusalañca naakusalañca dhammaṃ paṭicca abyākato dhammo uppajjati nahetupaccayā.*';
P_HTM[3894]='****4*. Nakusalaṃ ** dhammaṃ paṭicca abyākato dhammo uppajjati naārammaṇapaccayā…pe… nakusalañca naakusalañca dhammaṃ paṭicca abyākato dhammo uppajjati naārammaṇapaccayā. (Saṃkhittaṃ.)*';
P_HTM[3895]='****5*. Nahetuyā cha, naārammaṇe cha, naadhipatiyā aṭṭhārasa…pe… novigate cha.*';
P_HTM[3896]='*Hetupaccayā naārammaṇe cha… (saṃkhittaṃ).*';
P_HTM[3897]='*Nahetupaccayā ārammaṇe cha… (saṃkhittaṃ).*';
P_HTM[3898]='*(Sahajātavāro paṭiccavārasadiso).*';
P_HTM[3899]='*3-6. Paccayavārādi*';
P_HTM[3900]='****6*. Nakusalaṃ dhammaṃ paccayā kusalo dhammo uppajjati hetupaccayā. Nakusalaṃ dhammaṃ paccayā akusalo dhammo uppajjati hetupaccayā. Nakusalaṃ dhammaṃ paccayā abyākato dhammo uppajjati hetupaccayā. Nakusalaṃ dhammaṃ paccayā kusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Nakusalaṃ dhammaṃ paccayā akusalo ca abyākato ca dhammā uppajjanti hetupaccayā. Pañca.*';
P_HTM[3901]='*Naakusalaṃ dhammaṃ paccayā akusalo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3902]='*Naabyākataṃ dhammaṃ paccayā abyākato dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3903]='*Nakusalañca naabyākatañca dhammaṃ paccayā… tīṇi.*';
P_HTM[3904]='*Naakusalañca naabyākatañca dhammaṃ paccayā… tīṇi. Nakusalañca naakusalañca dhammaṃ paccayā kusalo dhammo uppajjati hetupaccayā… pañca. (Saṃkhittaṃ.) Hetuyā chabbīsati, ārammaṇe terasa…pe… avigate chabbīsati.*';
P_HTM[3905]='*Saṃsaṭṭhavāre hetuyā nava…pe… avigate nava. (Saṃkhittaṃ.)*';
P_HTM[3906]='*7. Pañhāvāro*';
P_HTM[3907]='****7*. Nakusalo ** dhammo akusalassa dhammassa hetupaccayena paccayo. Nakusalo dhammo abyākatassa dhammassa hetupaccayena paccayo. Nakusalo dhammo akusalassa ca abyākatassa ca dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[3908]='*Naakusalo dhammo kusalassa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[3909]='*Naabyākato dhammo abyākatassa dhammassa hetupaccayena paccayo… pañca.*';
P_HTM[3910]='*Nakusalo ca naabyākato ca dhammā akusalassa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[3911]='*Naakusalo ca naabyākato ca dhammā kusalassa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[3912]='*Nakusalo ca naakusalo ca dhammā abyākatassa dhammassa hetupaccayena paccayo. Ekaṃ.*';
P_HTM[3913]='*Ārammaṇapaccayo*';
P_HTM[3914]='****8*. Nakusalo dhammo kusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[3915]='*Naakusalo dhammo akusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[3916]='*Naabyākato dhammo abyākatassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[3917]='*Nakusalo ca naabyākato ca dhammā kusalassa dhammassa ārammaṇapaccayena paccayo. Nakusalo ca naabyākato ca dhammā akusalassa dhammassa ārammaṇapaccayena paccayo. Nakusalo ca naabyākato ca dhammā abyākatassa dhammassa ārammaṇapaccayena paccayo. Tīṇi.*';
P_HTM[3918]='*Naakusalo ca naabyākato ca dhammā kusalassa dhammassa ārammaṇapaccayena paccayo. Naakusalo ca naabyākato ca dhammā akusalassa dhammassa ārammaṇapaccayena paccayo. Naakusalo ca naabyākato ca dhammā abyākatassa dhammassa ārammaṇapaccayena paccayo. Tīṇi.*';
P_HTM[3919]='*Nakusalo ** ca naakusalo ca dhammā kusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Saṃkhittaṃ.)*';
P_HTM[3920]='****9*. Hetuyā aṭṭhārasa, ārammaṇe aṭṭhārasa, adhipatiyā tevīsa…pe… avigate dvāvīsa. (Pañhāvāraṃ vitthāretabbaṃ.)*';
P_HTM[3921]='*2. Vedanāttikaṃ*';
P_HTM[3922]='*1-7. Paṭiccavārādi*';
P_HTM[3923]='****10*. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca adukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (3)*';
P_HTM[3924]='*Nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nadukkhāya vedanāya sampayuttaṃ dhammaṃ paṭicca adukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (3)*';
P_HTM[3925]='*Naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca adukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. (3) (Saṃkhittaṃ.) Hetuyā ekavīsa, adhipatiyā ekavīsa…pe… avigate ekavīsa.*';
P_HTM[3926]='*3. Vipākattikaṃ*';
P_HTM[3927]='*1-7. Paṭiccavārādi*';
P_HTM[3928]='****11*. Navipākaṃ dhammaṃ paṭicca vipāko dhammo uppajjati hetupaccayā. Navipākaṃ dhammaṃ paṭicca vipākadhammadhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3929]='*Navipākadhammadhammaṃ paṭicca vipāko dhammo uppajjati hetupaccayā. Navipākadhammadhammaṃ paṭicca nevavipākanavipākadhammadhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3930]='*Nanevavipākanavipākadhammadhammaṃ ** paṭicca nevavipākanavipākadhammadhammo uppajjati hetupaccayā. Nanevavipākanavipākadhammadhammaṃ paṭicca vipāko dhammo uppajjati hetupaccayā… pañca. Hetuyā dvāvīsa.*';
P_HTM[3931]='*4. Upādinnattikaṃ*';
P_HTM[3932]='*1-7. Paṭiccavārādi*';
P_HTM[3933]='****12*. Naupādinnupādāniyaṃ dhammaṃ paṭicca anupādinnupādāniyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3934]='*Naanupādinnupādāniyaṃ dhammaṃ paṭicca anupādinnupādāniyo dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3935]='*Naanupādinnaanupādāniyaṃ dhammaṃ paṭicca upādinnupādāniyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3936]='*Naupādinnupādāniyañca naanupādinnaanupādāniyañca dhammaṃ paṭicca anupādinnupādāniyo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3937]='*Naanupādinnupādāniyañca naanupādinnaanupādāniyañca dhammaṃ paṭicca upādinnupādāniyo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[3938]='*Naupādinnupādāniyañca naanupādinnupādāniyañca dhammaṃ paṭicca anupādinnaanupādāniyo dhammo uppajjati hetupaccayā… tīṇi. Hetuyā aṭṭhārasa.*';
P_HTM[3939]='*5. Saṃkiliṭṭhattikaṃ*';
P_HTM[3940]='*1-7. Paṭiccavārādi*';
P_HTM[3941]='****13*. Nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca asaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā. Nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko ca asaṃkiliṭṭhaasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3942]='*Naasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[3943]='*Naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca saṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā. Naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko ** dhammo uppajjati hetupaccayā. Naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paṭicca saṃkiliṭṭhasaṃkilesiko ca asaṃkiliṭṭhasaṃkilesiko ca dhammā uppajjanti hetupaccayā. Tīṇi. Hetuyā aṭṭhārasa.*';
P_HTM[3944]='*6. Vitakkattikaṃ*';
P_HTM[3945]='*1-7. Paṭiccavārādi*';
P_HTM[3946]='****14*. Nasavitakkasavicāraṃ dhammaṃ paṭicca savitakkasavicāro dhammo uppajjati hetupaccayā. Nasavitakkasavicāraṃ dhammaṃ paṭicca avitakkavicāramatto dhammo uppajjati hetupaccayā. Nasavitakkasavicāraṃ dhammaṃ paṭicca avitakkaavicāro dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3947]='*Naavitakkavicāramattaṃ dhammaṃ paṭicca avitakkavicāramatto dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3948]='*Naavitakkaavicāraṃ dhammaṃ paṭicca avitakkaavicāro dhammo uppajjati hetupaccayā… satta. Hetuyā ekūnapaññāsa.*';
P_HTM[3949]='*7. Pītittikaṃ*';
P_HTM[3950]='*1-7. Paṭiccavārādi*';
P_HTM[3951]='****15*. Napītisahagataṃ dhammaṃ paṭicca pītisahagato dhammo uppajjati hetupaccayā… cattāri.*';
P_HTM[3952]='*Nasukhasahagataṃ dhammaṃ paṭicca sukhasahagato dhammo uppajjati hetupaccayā… cattāri.*';
P_HTM[3953]='*Naupekkhāsahagataṃ dhammaṃ paṭicca upekkhāsahagato dhammo uppajjati hetupaccayā. Naupekkhāsahagataṃ dhammaṃ paṭicca pītisahagato dhammo uppajjati hetupaccayā… cattāri. Hetuyā aṭṭhavīsa.*';
P_HTM[3954]='*8. Dassanattikaṃ*';
P_HTM[3955]='*1-7. Paṭiccavārādi*';
P_HTM[3956]='****16*. Nadassanena pahātabbaṃ dhammaṃ paṭicca bhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Nadassanena pahātabbaṃ dhammaṃ paṭicca nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Nadassanena pahātabbaṃ dhammaṃ paṭicca bhāvanāya pahātabbo ca nevadassanena nabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3957]='*Nabhāvanāya **pahātabbaṃ dhammaṃ paṭicca dassanena pahātabbo dhammo uppajjati hetupaccayā. Nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Nabhāvanāya pahātabbaṃ dhammaṃ paṭicca dassanena pahātabbo ca nevadassanena nabhāvanāya pahātabbo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[3958]='*Nevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca dassanena pahātabbo dhammo uppajjati hetupaccayā… pañca. (Saṃkhittaṃ.) Hetuyā aṭṭhārasa.*';
P_HTM[3959]='*9. Dassanahetuttikaṃ*';
P_HTM[3960]='*1-7. Paṭiccavārādi*';
P_HTM[3961]='****17*. Nadassanena pahātabbahetukaṃ dhammaṃ paṭicca dassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā chabbīsa.*';
P_HTM[3962]='*10. Ācayagāmittikaṃ*';
P_HTM[3963]='*1-7. Paṭiccavārādi*';
P_HTM[3964]='****18*. Naācayagāmiṃ dhammaṃ paṭicca apacayagāmī dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[3965]='*11. Sekkhattikaṃ*';
P_HTM[3966]='*1-7. Paṭiccavārādi*';
P_HTM[3967]='****19*. Nasekkhaṃ dhammaṃ paṭicca asekkho dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[3968]='*12-16. Parittattikādi*';
P_HTM[3969]='*1-7. Paṭiccavārādi*';
P_HTM[3970]='****20*. Naparittaṃ dhammaṃ paṭicca paritto dhammo uppajjati hetupaccayā… hetuyā dvāvīsa.*';
P_HTM[3971]='****21*. Naparittārammaṇaṃ dhammaṃ paṭicca parittārammaṇo dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[3972]='****22*. Nahīnaṃ dhammaṃ paṭicca majjhimo dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[3973]='****23*. Namicchattaniyataṃ ** dhammaṃ paṭicca sammattaniyato dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[3974]='****24*. Namaggārammaṇaṃ dhammaṃ paṭicca maggahetuko dhammo uppajjati hetupaccayā… hetuyā dasa *[hetuyā aṭṭha?]*.*';
P_HTM[3975]='*17. Uppannattikaṃ*';
P_HTM[3976]='*7. Pañhāvāro*';
P_HTM[3977]='****25*. Naanuppanno dhammo uppannassa dhammassa hetupaccayena paccayo. Nauppādī dhammo uppannassa dhammassa hetupaccayena paccayo. Naanuppanno ca nauppādī ca dhammā uppannassa dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[3978]='*18-19. Atītattikadvayaṃ*';
P_HTM[3979]='*1-7. Paṭiccavārādi*';
P_HTM[3980]='****26*. Naatīto dhammo paccuppannassa dhammassa hetupaccayena paccayo. Naanāgato dhammo paccuppannassa dhammassa hetupaccayena paccayo. Naatīto ca naanāgato ca dhammā paccuppannassa dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[3981]='****27*. Naatītārammaṇaṃ dhammaṃ paṭicca atītārammaṇo dhammo uppajjati hetupaccayā. Naatītārammaṇaṃ dhammaṃ paṭicca anāgatārammaṇo dhammo uppajjati hetupaccayā. Naatītārammaṇaṃ dhammaṃ paṭicca paccuppannārammaṇo dhammo uppajjati hetupaccayā. Tīṇi.*';
P_HTM[3982]='*Naanāgatārammaṇaṃ dhammaṃ paṭicca atītārammaṇo dhammo uppajjati hetupaccayā. Naanāgatārammaṇaṃ dhammaṃ paṭicca paccuppannārammaṇo dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[3983]='*Napaccuppannārammaṇaṃ dhammaṃ paṭicca paccuppannārammaṇo dhammo uppajjati hetupaccayā. Napaccuppannārammaṇaṃ dhammaṃ paṭicca atītārammaṇo dhammo uppajjati hetupaccayā. Napaccuppannārammaṇaṃ dhammaṃ paṭicca anāgatārammaṇo dhammo uppajjati hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā sattarasa.*';
P_HTM[3984]='*20-21. Ajjhattattikadvayaṃ*';
P_HTM[3985]='*1-7. Paṭiccavārādi*';
P_HTM[3986]='****28*. Naajjhattaṃ dhammaṃ paṭicca bahiddhā dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[3987]='*Nabahiddhā ** dhammaṃ paṭicca ajjhatto dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā dve.*';
P_HTM[3988]='****29*. Naajjhattārammaṇaṃ dhammaṃ paṭicca ajjhattārammaṇo dhammo uppajjati hetupaccayā… dve.*';
P_HTM[3989]='*Nabahiddhārammaṇaṃ dhammaṃ paṭicca bahiddhārammaṇo dhammo uppajjati hetupaccayā… dve.*';
P_HTM[3990]='*Naajjhattārammaṇañca nabahiddhārammaṇañca dhammaṃ paṭicca ajjhattārammaṇo dhammo uppajjati hetupaccayā… dve. Hetuyā cha.*';
P_HTM[3991]='*22. Sanidassanattikaṃ*';
P_HTM[3992]='*1-7. Paṭiccavārādi*';
P_HTM[3993]='****30*. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca anidassanasappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca anidassanaappaṭigho dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho ca anidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca anidassanasappaṭigho ca anidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho ca anidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. Nasanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho ca anidassanasappaṭigho ca anidassanaappaṭigho ca dhammā uppajjanti hetupaccayā. Satta.*';
P_HTM[3994]='*Naanidassanasappaṭighaṃ dhammaṃ paṭicca anidassanasappaṭigho dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho dhammo uppajjati hetupaccayā… satta.*';
P_HTM[3995]='*Naanidassanaappaṭighaṃ dhammaṃ paṭicca anidassanaappaṭigho dhammo uppajjati hetupaccayā… satta. Hetuyā pañcatiṃsa. (Pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[3996]='*Dhammapaccanīyānulome tikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[3997]='*Dhammapaccanīyānulome dukapaṭṭhānaṃ*';
P_HTM[3998]='*1-6. Hetugocchakaṃ*';
P_HTM[3999]='*1-7. Paṭiccavārādi*';
P_HTM[4000]='****1*. Nahetuṃ **dhammaṃ paṭicca hetu dhammo uppajjati hetupaccayā. Nahetuṃ dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Nahetuṃ dhammaṃ paṭicca hetu ca nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4001]='*Nanahetuṃ dhammaṃ paṭicca hetu dhammo uppajjati hetupaccayā. Nanahetuṃ dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Nanahetuṃ dhammaṃ paṭicca hetu ca nahetu ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4002]='*Nahetuñca nanahetuñca dhammaṃ paṭicca hetu dhammo uppajjati hetupaccayā. Nahetuñca nanahetuñca dhammaṃ paṭicca nahetu dhammo uppajjati hetupaccayā. Nahetuñca nanahetuñca dhammaṃ paṭicca hetu ca nahetu ca dhammā uppajjanti hetupaccayā. (3) (Saṃkhittaṃ.) Hetuyā nava, ārammaṇe nava…pe… avigate nava.*';
P_HTM[4003]='*(Sahajātavārampi…pe… pañhāvārampi vitthāretabbaṃ.)*';
P_HTM[4004]='****2*. Nasahetukaṃ dhammaṃ paṭicca sahetuko dhammo uppajjati hetupaccayā. Nasahetukaṃ dhammaṃ paṭicca ahetuko dhammo uppajjati hetupaccayā. Nasahetukaṃ dhammaṃ paṭicca sahetuko ca ahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4005]='*Naahetukaṃ ** dhammaṃ paṭicca ahetuko dhammo uppajjati hetupaccayā. Naahetukaṃ dhammaṃ paṭicca sahetuko dhammo uppajjati hetupaccayā. Naahetukaṃ dhammaṃ paṭicca sahetuko ca ahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4006]='*Nasahetukañca naahetukañca dhammaṃ paṭicca sahetuko dhammo uppajjati hetupaccayā. Nasahetukañca naahetukañca dhammaṃ paṭicca ahetuko dhammo uppajjati hetupaccayā. Nasahetukañca naahetukañca dhammaṃ paṭicca sahetuko ca ahetuko ca dhammā uppajjanti hetupaccayā. Tīṇi. Hetuyā nava.*';
P_HTM[4007]='****3*. Nahetusampayuttaṃ dhammaṃ paṭicca hetusampayutto dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4008]='****4*. Nahetuñceva naahetukañca dhammaṃ paṭicca hetu ceva sahetuko ca dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4009]='****5*. Nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca hetu ceva hetusampayutto ca dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4010]='****6*. Nahetuṃ nasahetukaṃ dhammaṃ paṭicca nahetu sahetuko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4011]='*7-13. Cūḷantaradukādi*';
P_HTM[4012]='****7*. Naappaccayaṃ dhammaṃ paṭicca sappaccayo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4013]='****8*. Naasaṅkhataṃ dhammaṃ paṭicca saṅkhato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4014]='****9*. Nasanidassanaṃ dhammaṃ paṭicca sanidassano dhammo uppajjati hetupaccayā. Nasanidassanaṃ dhammaṃ paṭicca anidassano dhammo uppajjati hetupaccayā. Nasanidassanaṃ dhammaṃ paṭicca sanidassano ca anidassano ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4015]='*Nasanidassano ** dhammo sanidassanassa dhammassa hetupaccayena paccayo… tīṇi.*';
P_HTM[4016]='*Nasanidassano dhammo anidassanassa dhammassa ārammaṇapaccayena paccayo. Naanidassano dhammo anidassanassa dhammassa ārammaṇapaccayena paccayo.*';
P_HTM[4017]='****10*. Nasappaṭighaṃ dhammaṃ paṭicca sappaṭigho dhammo uppajjati hetupaccayā. Nasappaṭighaṃ dhammaṃ paṭicca appaṭigho dhammo uppajjati hetupaccayā. Nasappaṭighaṃ dhammaṃ paṭicca sappaṭigho ca appaṭigho ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4018]='*Naappaṭighaṃ dhammaṃ paṭicca appaṭigho dhammo uppajjati hetupaccayā. Naappaṭighaṃ dhammaṃ paṭicca sappaṭigho dhammo uppajjati hetupaccayā. Naappaṭighaṃ dhammaṃ paṭicca sappaṭigho ca appaṭigho ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4019]='*Nasappaṭighañca naappaṭighañca dhammaṃ paṭicca sappaṭigho dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4020]='****11*. Narūpiṃ dhammaṃ paṭicca rūpī dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4021]='****12*. Nalokiyaṃ dhammaṃ paṭicca lokiyo dhammo uppajjati hetupaccayā. Nalokiyaṃ dhammaṃ paṭicca lokuttaro dhammo uppajjati hetupaccayā. Nalokiyaṃ dhammaṃ paṭicca lokiyo ca lokuttaro ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4022]='*Nalokuttaraṃ dhammaṃ paṭicca lokiyo dhammo uppajjati hetupaccayā. (1)*';
P_HTM[4023]='*Nalokiyañca nalokuttarañca dhammaṃ paṭicca lokiyo dhammo uppajjati hetupaccayā. (1). Hetuyā pañca.*';
P_HTM[4024]='****13*. Nakenaci viññeyyaṃ dhammaṃ paṭicca kenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4025]='*14-19. Āsavagocchakaṃ*';
P_HTM[4026]='****14*. Naāsavaṃ dhammaṃ paṭicca āsavo dhammo uppajjati hetupaccayā. Naāsavaṃ dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Naāsavaṃ ** dhammaṃ paṭicca āsavo ca noāsavo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4027]='*Nanoāsavaṃ dhammaṃ paṭicca noāsavo dhammo uppajjati hetupaccayā. Nanoāsavaṃ dhammaṃ paṭicca āsavo dhammo uppajjati hetupaccayā. Nanoāsavaṃ dhammaṃ paṭicca āsavo ca noāsavo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4028]='*Naāsavañca nanoāsavañca dhammaṃ paṭicca āsavo dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4029]='****15*. Nasāsavaṃ dhammaṃ paṭicca sāsavo dhammo uppajjati hetupaccayā. Nasāsavaṃ dhammaṃ paṭicca anāsavo dhammo uppajjati hetupaccayā. Nasāsavaṃ dhammaṃ paṭicca sāsavo ca anāsavo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4030]='*Naanāsavaṃ dhammaṃ paṭicca sāsavo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4031]='*Nasāsavañca naanāsavañca dhammaṃ paṭicca sāsavo dhammo uppajjati hetupaccayā. Ekaṃ. (Saṃkhittaṃ.) Hetuyā pañca.*';
P_HTM[4032]='****16*. Naāsavasampayuttaṃ * dhammaṃ paṭicca āsavasampayutto dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4033]='****17*. Naāsavañceva anāsavañca dhammaṃ paṭicca āsavo ceva sāsavo ca dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4034]='****18*. Naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca āsavo ceva āsavasampayutto ca dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4035]='****19*. Āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca āsavavippayutto sāsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4036]='*20-54. Saññojanādichagocchakāni*';
P_HTM[4037]='****20*. Nasaññojanaṃ dhammaṃ paṭicca saññojano dhammo uppajjati hetupaccayā…pe….*';
P_HTM[4038]='*Naganthaṃ dhammaṃ paṭicca gantho dhammo uppajjati hetupaccayā…pe….*';
P_HTM[4039]='*Naoghaṃ ** dhammaṃ paṭicca ogho dhammo uppajjati hetupaccayā …pe….*';
P_HTM[4040]='*Nayogaṃ dhammaṃ paṭicca yogo dhammo uppajjati hetupaccayā…pe….*';
P_HTM[4041]='*Nanīvaraṇaṃ dhammaṃ paṭicca nīvaraṇo dhammo uppajjati hetupaccayā…*';
P_HTM[4042]='****21*. Naparāmāsaṃ dhammaṃ paṭicca parāmāso dhammo uppajjati hetupaccayā….*';
P_HTM[4043]='*55-68. Mahantaradukādi*';
P_HTM[4044]='****22*. Nasārammaṇaṃ dhammaṃ paṭicca sārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇaṃ dhammaṃ paṭicca anārammaṇo dhammo uppajjati hetupaccayā. Nasārammaṇaṃ dhammaṃ paṭicca sārammaṇo ca anārammaṇo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4045]='*Naanārammaṇaṃ dhammaṃ paṭicca anārammaṇo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4046]='*Nasārammaṇañca naanārammaṇañca dhammaṃ paṭicca sārammaṇo dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4047]='****23*. Nacittaṃ dhammaṃ paṭicca citto dhammo uppajjati hetupaccayā. Nacittaṃ dhammaṃ paṭicca nocitto dhammo uppajjati hetupaccayā. Nacittaṃ dhammaṃ paṭicca citto ca nocitto ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4048]='*Nanocittaṃ dhammaṃ paṭicca nocitto dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4049]='*Nacittañca nanocittañca dhammaṃ paṭicca nocitto dhammo uppajjati  Ekaṃ. Hetuyā pañca.*';
P_HTM[4050]='****24*. Nacetasikaṃ dhammaṃ paṭicca cetasiko dhammo uppajjati hetupaccayā. Nacetasikaṃ dhammaṃ paṭicca acetasiko dhammo uppajjati hetupaccayā. Nacetasikaṃ dhammaṃ paṭicca cetasiko ca acetasiko ca dhammā uppajjanti hetupaccayā. Hetuyā nava.*';
P_HTM[4051]='****25*. Nacittasampayuttaṃ dhammaṃ paṭicca cittasampayutto dhammo uppajjati hetupaccayā. Nacittasampayuttaṃ dhammaṃ paṭicca cittavippayutto dhammo uppajjati hetupaccayā. Nacittasampayuttaṃ dhammaṃ paṭicca cittasampayutto ca cittavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4052]='*Nacittavippayuttaṃ ** dhammaṃ paṭicca cittavippayutto dhammo uppajjati hetupaccayā. Nacittavippayuttaṃ dhammaṃ paṭicca cittasampayutto dhammo uppajjati hetupaccayā. Nacittavippayuttaṃ dhammaṃ paṭicca cittasampayutto ca cittavippayutto ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4053]='*Nacittasampayuttañca nacittavippayuttañca dhammaṃ paṭicca cittasampayutto dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4054]='****26*. Nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca cittasaṃsaṭṭho dhammo uppajjati hetupaccayā. Nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca cittavisaṃsaṭṭho dhammo uppajjati hetupaccayā. Nacittasaṃsaṭṭhaṃ dhammaṃ paṭicca cittasaṃsaṭṭho ca cittavisaṃsaṭṭho ca dhammā uppajjanti hetupaccayā… hetuyā nava.*';
P_HTM[4055]='****27*. Nacittasamuṭṭhānaṃ dhammaṃ paṭicca cittasamuṭṭhāno dhammo uppajjati hetupaccayā. Nacittasamuṭṭhānaṃ dhammaṃ paṭicca nocittasamuṭṭhāno dhammo uppajjati hetupaccayā. Nacittasamuṭṭhānaṃ dhammaṃ paṭicca cittasamuṭṭhāno ca nocittasamuṭṭhāno ca dhammā uppajjanti hetupaccayā… hetuyā nava.*';
P_HTM[4056]='****28*. Nacittasahabhuṃ dhammaṃ paṭicca cittasahabhū dhammo uppajjati hetupaccayā. Nacittasahabhuṃ dhammaṃ paṭicca nocittasahabhū dhammo uppajjati hetupaccayā. Nacittasahabhuṃ dhammaṃ paṭicca cittasahabhū ca nocittasahabhū ca dhammā uppajjanti hetupaccayā… hetuyā nava.*';
P_HTM[4057]='****29*. Nacittānuparivattiṃ dhammaṃ paṭicca cittānuparivattī dhammo uppajjati hetupaccayā. Nacittānuparivattiṃ dhammaṃ paṭicca nocittānuparivattī dhammo uppajjati hetupaccayā. Nacittānuparivattiṃ dhammaṃ paṭicca cittānuparivattī ca nocittānuparivattī ca dhammā uppajjanti hetupaccayā… hetuyā nava.*';
P_HTM[4058]='****30*. Nacittasaṃsaṭṭhasamuṭṭhānaṃ dhammaṃ paṭicca cittasaṃsaṭṭhasamuṭṭhāno dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4059]='****31*. Nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ dhammaṃ paṭicca cittasaṃsaṭṭhasamuṭṭhānasahabhū dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4060]='****32*. Nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ dhammaṃ paṭicca cittasaṃsaṭṭhasamuṭṭhānānuparivattī dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4061]='****33*. Naajjhattikaṃ * dhammaṃ paṭicca ajjhattiko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4062]='*Nabāhiraṃ dhammaṃ paṭicca bāhiro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4063]='*Naajjhattikañca nabāhirañca dhammaṃ paṭicca ajjhattiko dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4064]='****34*. Naupādā dhammaṃ paṭicca upādā dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4065]='****35*. Naupādinnaṃ dhammaṃ paṭicca anupādinno dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4066]='*69-74. Upādānagocchakaṃ*';
P_HTM[4067]='****36*. Naupādānaṃ dhammaṃ paṭicca upādāno dhammo uppajjati hetupaccayā… (saṃkhittaṃ).*';
P_HTM[4068]='*75-82. Kilesagocchakaṃ*';
P_HTM[4069]='****37*. Nakilesaṃ dhammaṃ paṭicca kileso dhammo uppajjati hetupaccayā… (saṃkhittaṃ).*';
P_HTM[4070]='*83-99. Piṭṭhidukaṃ*';
P_HTM[4071]='****38*. Nadassanena pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4072]='*Nanadassanena pahātabbaṃ dhammaṃ paṭicca dassanena pahātabbo dhammo uppajjati hetupaccayā. Nanadassanena pahātabbaṃ dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. Nanadassanena pahātabbaṃ dhammaṃ paṭicca dassanena pahātabbo ca nadassanena pahātabbo ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4073]='*Nadassanena pahātabbañca nanadassanena pahātabbañca dhammaṃ paṭicca nadassanena pahātabbo dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[4074]='****39*. Nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4075]='****40*. Nadassanena **pahātabbahetukaṃ dhammaṃ paṭicca dassanena pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4076]='****41*. Nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca bhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4077]='****42*. Nasavitakkaṃ dhammaṃ paṭicca savitakko dhammo uppajjati hetupaccayā. Nasavitakkaṃ dhammaṃ paṭicca avitakko dhammo uppajjati hetupaccayā. Nasavitakkaṃ dhammaṃ paṭicca savitakko ca avitakko ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4078]='*Naavitakkaṃ dhammaṃ paṭicca avitakko dhammo uppajjati hetupaccayā. Naavitakkaṃ dhammaṃ paṭicca savitakko dhammo uppajjati hetupaccayā. Naavitakkaṃ dhammaṃ paṭicca savitakko ca avitakko ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4079]='*Nasavitakkañca naavitakkañca dhammaṃ paṭicca savitakko dhammo uppajjati hetupaccayā. Nasavitakkañca naavitakkañca dhammaṃ paṭicca avitakko dhammo uppajjati hetupaccayā. Nasavitakkañca naavitakkañca dhammaṃ paṭicca savitakko ca avitakko ca dhammā uppajjanti hetupaccayā. (3) Hetuyā nava.*';
P_HTM[4080]='****43*. Nasavicāraṃ dhammaṃ paṭicca savicāro dhammo uppajjati hetupaccayā  hetuyā nava.*';
P_HTM[4081]='****44*. Nasappītikaṃ dhammaṃ paṭicca sappītiko dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4082]='****45*. Napītisahagataṃ dhammaṃ paṭicca pītisahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4083]='****46*. Nasukhasahagataṃ dhammaṃ paṭicca sukhasahagato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4084]='****47*. Naupekkhāsahagataṃ dhammaṃ paṭicca upekkhāsahagato dhammo uppajjati hetupaccayā. Naupekkhāsahagataṃ dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati hetupaccayā. Naupekkhāsahagataṃ dhammaṃ paṭicca upekkhāsahagato ca naupekkhāsahagato ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4085]='*Nanaupekkhāsahagataṃ ** dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4086]='*Naupekkhāsahagatañca nanaupekkhāsahagatañca dhammaṃ paṭicca upekkhāsahagato dhammo uppajjati hetupaccayā. Naupekkhāsahagatañca nanaupekkhāsahagatañca dhammaṃ paṭicca naupekkhāsahagato dhammo uppajjati hetupaccayā. Naupekkhāsahagatañca nanaupekkhāsahagatañca dhammaṃ paṭicca upekkhāsahagato ca naupekkhāsahagato ca dhammā uppajjanti hetupaccayā. Tīṇi. Hetuyā nava.*';
P_HTM[4087]='****48*. Nakāmāvacaraṃ dhammaṃ paṭicca kāmāvacaro dhammo uppajjati hetupaccayā. Nakāmāvacaraṃ dhammaṃ paṭicca nakāmāvacaro dhammo uppajjati hetupaccayā. Nakāmāvacaraṃ dhammaṃ paṭicca kāmāvacaro ca nakāmāvacaro ca dhammā uppajjanti hetupaccayā… tīṇi.*';
P_HTM[4088]='*Nanakāmāvacaraṃ dhammaṃ paṭicca nakāmāvacaro dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4089]='*Nakāmāvacarañca nanakāmāvacarañca dhammaṃ paṭicca kāmāvacaro dhammo uppajjati hetupaccayā… tīṇi. Hetuyā nava.*';
P_HTM[4090]='****49*. Narūpāvacaraṃ dhammaṃ paṭicca rūpāvacaro dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4091]='****50*. Naarūpāvacaraṃ dhammaṃ paṭicca naarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4092]='****51*. Napariyāpannaṃ dhammaṃ paṭicca pariyāpanno dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4093]='*Naapariyāpannaṃ dhammaṃ paṭicca pariyāpanno dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4094]='*Napariyāpannañca naapariyāpannañca dhammaṃ paṭicca pariyāpanno dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[4095]='****52*. Naniyyānikaṃ dhammaṃ paṭicca aniyyāniko dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4096]='*Naaniyyānikaṃ ** dhammaṃ paṭicca aniyyāniko dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4097]='*Naniyyānikañca naaniyyānikañca dhammaṃ paṭicca aniyyāniko dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[4098]='****53*. Naniyataṃ dhammaṃ paṭicca aniyato dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4099]='*Naaniyataṃ dhammaṃ paṭicca aniyato dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4100]='*Naniyatañca naaniyatañca dhammaṃ paṭicca aniyato dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca.*';
P_HTM[4101]='****54*. Nasauttaraṃ dhammaṃ paṭicca sauttaro dhammo uppajjati hetupaccayā. Nasauttaraṃ dhammaṃ paṭicca anuttaro dhammo uppajjati hetupaccayā. Nasauttaraṃ dhammaṃ paṭicca sauttaro ca anuttaro ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4102]='*Naanuttaraṃ dhammaṃ paṭicca sauttaro dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4103]='*Nasauttarañca naanuttarañca dhammaṃ paṭicca sauttaro dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4104]='*100. Saraṇadukaṃ*';
P_HTM[4105]='*1-7. Paṭiccavārādi*';
P_HTM[4106]='****55*. Nasaraṇaṃ dhammaṃ paṭicca araṇo dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4107]='*Naaraṇaṃ dhammaṃ paṭicca araṇo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4108]='*Nasaraṇañca naaraṇañca dhammaṃ paṭicca araṇo dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā pañca, ārammaṇe dve…pe… avigate pañca.*';
P_HTM[4109]='*Paccanīyaṃ*';
P_HTM[4110]='*Nahetupaccayo*';
P_HTM[4111]='****56*. Nasaraṇaṃ dhammaṃ paṭicca araṇo dhammo uppajjati nahetupaccayā. Naaraṇaṃ dhammaṃ paṭicca saraṇo dhammo uppajjati nahetupaccayā (saṃkhittaṃ).*';
P_HTM[4112]='*Nahetuyā dve, naārammaṇe tīṇi…pe… novigate tīṇi.*';
P_HTM[4113]='*(Sahajātavārampi…pe… sampayuttavārampi paṭiccavārasadisaṃ.)*';
P_HTM[4114]='*Hetu-ārammaṇapaccayā*';
P_HTM[4115]='****57*. Nasaraṇo ** dhammo araṇassa dhammassa hetupaccayena paccayo. (1)*';
P_HTM[4116]='*Naaraṇo dhammo araṇassa dhammassa hetupaccayena paccayo. Naaraṇo dhammo saraṇassa dhammassa hetupaccayena paccayo. Naaraṇo dhammo saraṇassa ca araṇassa ca dhammassa hetupaccayena paccayo. (3)*';
P_HTM[4117]='****58*. Nasaraṇo dhammo saraṇassa dhammassa ārammaṇapaccayena paccayo. Nasaraṇo dhammo araṇassa dhammassa ārammaṇapaccayena paccayo. Dve.*';
P_HTM[4118]='*Naaraṇo dhammo araṇassa dhammassa ārammaṇapaccayena paccayo. Naaraṇo dhammo saraṇassa dhammassa ārammaṇapaccayena paccayo. Dve.*';
P_HTM[4119]='****59*. Hetuyā cattāri, ārammaṇe cattāri…pe… avigate satta.*';
P_HTM[4120]='*Paccanīyuddhāro*';
P_HTM[4121]='****60*. Nasaraṇo dhammo saraṇassa dhammassa ārammaṇapaccayena paccayo, upanissayapaccayena paccayo, purejātapaccayena paccayo (saṃkhittaṃ).*';
P_HTM[4122]='*Nahetuyā satta, naārammaṇe satta…pe… noavigate cattāri.*';
P_HTM[4123]='*(Yathā kusalattike pañhāvārassa anulomampi paccanīyampi anulomapaccanīyampi paccanīyānulomampi gaṇitaṃ, evaṃ gaṇetabbaṃ.)*';
P_HTM[4124]='*Dhammapaccanīyānulome dukapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[4125]='*Dhammapaccanīyānulome dukatikapaṭṭhānaṃ*';
P_HTM[4126]='*1-1. Hetuduka-kusalattikaṃ*';
P_HTM[4127]='****1*. Nahetuṃ **nakusalaṃ dhammaṃ paccayā hetu kusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalaṃ dhammaṃ paccayā nahetu kusalo dhammo uppajjati hetupaccayā. Nahetuṃ nakusalaṃ dhammaṃ paccayā hetu kusalo ca nahetu kusalo ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4128]='*Nahetuṃ naakusalaṃ dhammaṃ paccayā hetu akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4129]='****2*. Nahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu abyākato dhammo uppajjati hetupaccayā. Nanahetuṃ naabyākataṃ dhammaṃ paṭicca nahetu abyākato dhammo uppajjati hetupaccayā. Nahetuṃ naabyākatañca nanahetuṃ naabyākatañca dhammaṃ paṭicca nahetu abyākato dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4130]='*2-4-1. Sahetukādidukāni-kusalattikaṃ*';
P_HTM[4131]='****3*. Nasahetukaṃ nakusalaṃ dhammaṃ paccayā sahetuko kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4132]='*Nasahetukaṃ naakusalaṃ dhammaṃ paccayā sahetuko akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4133]='****4*. Nasahetukaṃ **naabyākataṃ dhammaṃ paṭicca ahetuko abyākato dhammo uppajjati hetupaccayā. Naahetukaṃ naabyākataṃ dhammaṃ paṭicca ahetuko abyākato dhammo uppajjati hetupaccayā. Nasahetukaṃ naabyākatañca naahetukaṃ naabyākatañca dhammaṃ paṭicca ahetuko abyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4134]='****5*. Nahetusampayuttaṃ nakusalaṃ dhammaṃ paccayā….*';
P_HTM[4135]='****6*. Nahetu ceva naahetuko ca nakusalo dhammo hetussa ceva sahetukassa ca kusalassa dhammassa ārammaṇapaccayena paccayo. Nahetu ceva naahetuko ca nakusalo dhammo sahetukassa ceva na ca hetussa kusalassa dhammassa ārammaṇapaccayena paccayo. Nahetu ceva naahetuko ca nakusalo dhammo hetussa ceva sahetukassa kusalassa ca sahetukassa ceva na ca hetussa kusalassa ca dhammassa ārammaṇapaccayena paccayo. Tīṇi.*';
P_HTM[4136]='*Naahetuko ceva nana ca hetu nakusalo dhammo hetussa ceva sahetukassa ca kusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[4137]='*Nahetu ceva naahetuko nakusalo ca naahetuko ceva nanahetu nakusalo ca dhammā hetussa ceva sahetukassa ca kusalassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Sabbattha nava pañhā.)*';
P_HTM[4138]='****7*. Nahetu ceva naahetuko ca naakusalo dhammo hetussa ceva sahetukassa ca akusalassa dhammassa ārammaṇapaccayena paccayo (saṃkhittaṃ, nava pañhā).*';
P_HTM[4139]='*Nahetu ceva naahetuko ca naabyākato dhammo hetussa ceva sahetukassa ca abyākatassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Nava pañhā.)*';
P_HTM[4140]='*5-1. Hetuhetusampayuttaduka-kusalattikaṃ*';
P_HTM[4141]='****8*. Nahetu ceva nahetuvippayutto ca nakusalo dhammo hetussa ceva hetusampayuttassa ca kusalassa dhammassa ārammaṇapaccayena paccayo (saṃkhittaṃ, nava pañhā kātabbā).*';
P_HTM[4142]='*Nahetu ** ceva nahetuvippayutto ca naakusalo dhammo hetussa ceva hetusampayuttassa ca akusalassa dhammassa ārammaṇapaccayena paccayo (saṃkhittaṃ, nava pañhā kātabbā).*';
P_HTM[4143]='*Nahetu ceva nahetuvippayutto ca naabyākato dhammo hetussa ceva hetusampayuttassa ca abyākatassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Nava pañhā kātabbā.)*';
P_HTM[4144]='*6-1. Nahetusahetukaduka-kusalattikaṃ*';
P_HTM[4145]='****9*. Nahetuṃ nasahetukaṃ nakusalaṃ dhammaṃ paccayā nahetu sahetuko kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4146]='*Nahetuṃ nasahetukaṃ naakusalaṃ dhammaṃ paccayā nahetu sahetuko akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4147]='*Nahetuṃ naahetukaṃ naabyākataṃ dhammaṃ paṭicca nahetu ahetuko abyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4148]='*7-13-1. Cūḷantaradukāni-kusalattikaṃ*';
P_HTM[4149]='****10*. Naappaccayaṃ nakusalaṃ dhammaṃ paccayā sappaccayo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4150]='*Naappaccayaṃ naakusalaṃ dhammaṃ paccayā sappaccayo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4151]='*Naappaccayaṃ * naabyākataṃ dhammaṃ paṭicca sappaccayo abyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4152]='****11*. Naasaṅkhataṃ…pe… (sappaccayadukasadisaṃ).*';
P_HTM[4153]='****12*. Nasanidassanaṃ nakusalaṃ dhammaṃ paccayā anidassano kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4154]='*Nasanidassanaṃ naakusalaṃ dhammaṃ paccayā anidassano akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4155]='*Nasanidassanaṃ ** naabyākataṃ dhammaṃ paṭicca sanidassano abyākato dhammo uppajjati hetupaccayā. Nasanidassanaṃ naabyākataṃ dhammaṃ paṭicca anidassano abyākato dhammo uppajjati hetupaccayā. Nasanidassanaṃ naabyākataṃ dhammaṃ paṭicca sanidassano abyākato ca anidassano abyākato ca dhammā uppajjanti hetupaccayā. (3) …Hetuyā tīṇi.*';
P_HTM[4156]='****13*. Nasappaṭighaṃ nakusalaṃ dhammaṃ paccayā appaṭigho kusalo dhammo uppajjati hetupaccayā.*';
P_HTM[4157]='****14*. Naarūpiṃ nakusalaṃ dhammaṃ paccayā arūpī kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4158]='*Naarūpiṃ naakusalaṃ dhammaṃ paccayā arūpī akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4159]='*Narūpiṃ naabyākataṃ dhammaṃ paṭicca rūpī abyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4160]='****15*. Nalokuttaraṃ nakusalaṃ dhammaṃ paccayā lokiyo kusalo dhammo uppajjati  Nalokuttaraṃ nakusalaṃ dhammaṃ paccayā lokuttaro kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4161]='*Nalokuttaraṃ naakusalaṃ dhammaṃ paccayā lokiyo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4162]='*Nalokiyaṃ naabyākataṃ dhammaṃ paṭicca lokiyo abyākato dhammo uppajjati hetupaccayā. Nalokuttaraṃ naabyākataṃ dhammaṃ paṭicca lokiyo abyākato dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4163]='****16*. Nakenaci viññeyyaṃ nakusalaṃ dhammaṃ paccayā kenaci viññeyyo kusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4164]='*Nakenaci naviññeyyaṃ nakusalaṃ dhammaṃ paccayā kenaci naviññeyyo kusalo dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4165]='*Nakenaci ** viññeyyaṃ nakusalañca nakenaci naviññeyyaṃ nakusalañca dhammaṃ paccayā kenaci viññeyyo kusalo dhammo uppajjati hetupaccayā… tīṇi. (Sabbattha nava.)*';
P_HTM[4166]='*Nakenaci viññeyyaṃ naakusalaṃ dhammaṃ paccayā kenaci viññeyyo akusalo dhammo uppajjati hetupaccayā. Nakenaci naviññeyyaṃ naakusalaṃ dhammaṃ paccayā kenaci naviññeyyo akusalo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4167]='*Nakenaci viññeyyaṃ naabyākataṃ dhammaṃ paṭicca kenaci viññeyyo abyākato dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4168]='*14-1. Āsavaduka-kusalattikaṃ*';
P_HTM[4169]='****17*. Naāsavaṃ nakusalaṃ dhammaṃ paccayā noāsavo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4170]='*Naāsavaṃ naakusalaṃ dhammaṃ paccayā āsavo akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4171]='*Naāsavaṃ naabyākataṃ dhammaṃ paṭicca noāsavo abyākato dhammo uppajjati hetupaccayā. Nanoāsavaṃ naabyākataṃ dhammaṃ paṭicca noāsavo abyākato dhammo uppajjati hetupaccayā. (Dukamūlakaṃ ekaṃ.)… Hetuyā tīṇi.*';
P_HTM[4172]='*15-1. Sāsavaduka-kusalattikaṃ*';
P_HTM[4173]='****18*. Naanāsavaṃ nakusalaṃ dhammaṃ paccayā anāsavo kusalo dhammo uppajjati hetupaccayā. Naanāsavaṃ nakusalaṃ dhammaṃ paccayā sāsavo kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4174]='*Naanāsavaṃ naakusalaṃ dhammaṃ paccayā sāsavo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4175]='*16-1. Āsavasampayuttaduka-kusalattikaṃ*';
P_HTM[4176]='****19*. Naāsavasampayuttaṃ nakusalaṃ dhammaṃ paccayā āsavavippayutto kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4177]='*Naāsavasampayuttaṃ ** naakusalaṃ dhammaṃ paccayā āsavasampayutto akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4178]='*Naāsavasampayuttaṃ naabyākataṃ dhammaṃ paṭicca āsavavippayutto abyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4179]='*17-1. Āsavasāsavaduka-kusalattikaṃ*';
P_HTM[4180]='****20*. Naāsavañceva naanāsavañca nakusalaṃ dhammaṃ paccayā sāsavo ceva noāsavo ca kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4181]='*Naāsavañceva naanāsavañca naakusalaṃ dhammaṃ paccayā āsavo ceva sāsavo ca akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4182]='*Naāsavañceva naanāsavañca naabyākataṃ dhammaṃ paṭicca sāsavo ceva no ca āsavo abyākato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4183]='*(Āsavaāsavasampayuttadukaṃ natthi.)*';
P_HTM[4184]='*19-1. Āsavavippayuttasāsavaduka-kusalattikaṃ*';
P_HTM[4185]='****21*. Āsavavippayuttaṃ naanāsavaṃ nakusalaṃ dhammaṃ paccayā āsavavippayutto anāsavo kusalo dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ naanāsavaṃ nakusalaṃ dhammaṃ paccayā āsavavippayutto sāsavo kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4186]='*Āsavavippayuttaṃ naanāsavaṃ naakusalaṃ dhammaṃ paccayā āsavavippayutto sāsavo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4187]='*Āsavavippayuttaṃ nasāsavaṃ naabyākataṃ dhammaṃ paṭicca āsavavippayutto sāsavo abyākato dhammo uppajjati hetupaccayā. Āsavavippayuttaṃ naanāsavaṃ naabyākataṃ dhammaṃ paṭicca āsavavippayutto sāsavo abyākato dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4188]='*20-54-1. Saññojanādichagocchakāni-kusalattikaṃ*';
P_HTM[4189]='****22*. Nasaññojanaṃ ** naakusalaṃ dhammaṃ paccayā saññojano akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4190]='****23*. Naganthaṃ naakusalaṃ dhammaṃ paccayā gantho akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4191]='****24*. Naoghaṃ naakusalaṃ dhammaṃ paccayā ogho akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4192]='****25*. Nayogaṃ naakusalaṃ dhammaṃ paccayā yogo akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4193]='****26*. Nanīvaraṇaṃ naakusalaṃ dhammaṃ paccayā nīvaraṇo akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4194]='****27*. Naparāmāsaṃ naakusalaṃ dhammaṃ paccayā parāmāso akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4195]='*55-68-1. Mahantaradukāni-kusalattikaṃ*';
P_HTM[4196]='****28*. Nasārammaṇaṃ nakusalaṃ dhammaṃ paccayā sārammaṇo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4197]='*Nasārammaṇaṃ naakusalaṃ dhammaṃ paccayā sārammaṇo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4198]='*Naanārammaṇaṃ naabyākataṃ dhammaṃ paṭicca anārammaṇo abyākato dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4199]='****29*. Nocittaṃ nakusalaṃ dhammaṃ paccayā citto kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Naakusale tīṇi. Naabyākate tīṇi. Saṃkhittaṃ.)*';
P_HTM[4200]='****30*. Nacetasikaṃ nakusalaṃ dhammaṃ paccayā cetasiko kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4201]='****31*. Nacittasampayuttaṃ **nakusalaṃ dhammaṃ paccayā cittasampayutto kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4202]='****32*. Nacittasaṃsaṭṭhaṃ nakusalaṃ dhammaṃ paccayā cittasaṃsaṭṭho kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4203]='****33*. Nacittasamuṭṭhānaṃ nakusalaṃ dhammaṃ paccayā cittasamuṭṭhāno kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4204]='****34*. Nacittasahabhuṃ nakusalaṃ dhammaṃ paccayā cittasahabhū kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4205]='****35*. Nacittānuparivattiṃ nakusalaṃ dhammaṃ paccayā cittānuparivattī kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4206]='****36*. Nacittasaṃsaṭṭhasamuṭṭhānaṃ nakusalaṃ dhammaṃ paccayā cittasaṃsaṭṭhasamuṭṭhāno kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4207]='****37*. Nacittasaṃsaṭṭhasamuṭṭhānasahabhuṃ nakusalaṃ dhammaṃ paccayā cittasaṃsaṭṭhasamuṭṭhānasahabhū kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4208]='****38*. Nacittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ nakusalaṃ dhammaṃ paccayā cittasaṃsaṭṭhasamuṭṭhānānuparivattī kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4209]='****39*. Naajjhattikaṃ nakusalaṃ dhammaṃ paccayā ajjhattiko kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4210]='****40*. Nanoupādā nakusalaṃ dhammaṃ paccayā noupādā kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4211]='****41*. Naanupādinnaṃ nakusalaṃ dhammaṃ paccayā anupādinno kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4212]='*69-74-1. Upādānadukādi-kusalattikaṃ*';
P_HTM[4213]='****42*. Naupādānaṃ ** naakusalaṃ dhammaṃ paccayā upādāno akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4214]='*75-82-1. Kilesadukādi-kusalattikaṃ*';
P_HTM[4215]='****43*. Nakilesaṃ naakusalaṃ dhammaṃ paccayā kileso akusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4216]='*83-100-1. Piṭṭhidukāni-kusalattikaṃ*';
P_HTM[4217]='****44*. Nadassanena pahātabbaṃ nakusalaṃ dhammaṃ paccayā nadassanena pahātabbo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4218]='*Nadassanena pahātabbaṃ naakusalaṃ dhammaṃ paccayā dassanena pahātabbo akusalo dhammo uppajjati hetupaccayā. Nadassanena pahātabbaṃ naakusalaṃ dhammaṃ paccayā nadassanena pahātabbo akusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4219]='*Nadassanena pahātabbaṃ naabyākataṃ dhammaṃ paṭicca nadassanena pahātabbo abyākato dhammo uppajjati hetupaccayā. Nanadassanena pahātabbaṃ naabyākataṃ dhammaṃ paṭicca nadassanena pahātabbo abyākato dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4220]='****45*. Nabhāvanāya pahātabbaṃ nakusalaṃ dhammaṃ paccayā nabhāvanāya pahātabbo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4221]='****46*. Nadassanena pahātabbahetukaṃ nakusalaṃ dhammaṃ paccayā nadassanena pahātabbahetuko kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4222]='****47*. Nabhāvanāya pahātabbahetukaṃ nakusalaṃ dhammaṃ paccayā nabhāvanāya pahātabbahetuko kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4223]='****48*. Nasavitakkaṃ nakusalaṃ dhammaṃ paccayā savitakko kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4224]='****49*. Nasavicāraṃ * nakusalaṃ dhammaṃ paccayā savicāro kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4225]='****50*. Nasappītikaṃ nakusalaṃ dhammaṃ paccayā sappītiko kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4226]='****51*. Napītisahagataṃ nakusalaṃ dhammaṃ paccayā pītisahagato kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4227]='****52*. Nasukhasahagataṃ nakusalaṃ dhammaṃ paccayā sukhasahagato kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4228]='****53*. Naupekkhāsahagataṃ nakusalaṃ dhammaṃ paccayā upekkhāsahagato kusalo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4229]='****54*. Nanakāmāvacaraṃ nakusalaṃ dhammaṃ paccayā nakāmāvacaro kusalo dhammo uppajjati hetupaccayā. Nanakāmāvacaraṃ nakusalaṃ dhammaṃ paccayā kāmāvacaro kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4230]='****55*. Narūpāvacaraṃ nakusalaṃ dhammaṃ paccayā rūpāvacaro kusalo dhammo uppajjati hetupaccayā. Narūpāvacaraṃ nakusalaṃ dhammaṃ paccayā narūpāvacaro kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4231]='****56*. Naarūpāvacaraṃ nakusalaṃ dhammaṃ paccayā arūpāvacaro kusalo dhammo uppajjati hetupaccayā. Naarūpāvacaraṃ nakusalaṃ dhammaṃ paccayā naarūpāvacaro kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4232]='****57*. Naapariyāpannaṃ nakusalaṃ dhammaṃ paccayā apariyāpanno kusalo dhammo uppajjati hetupaccayā. Naapariyāpannaṃ nakusalaṃ dhammaṃ paccayā pariyāpanno kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4233]='****58*. Naniyyānikaṃ nakusalaṃ dhammaṃ paccayā niyyāniko kusalo dhammo uppajjati hetupaccayā. Naniyyānikaṃ nakusalaṃ dhammaṃ paccayā naaniyyāniko kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4234]='****59*. Naniyataṃ * nakusalaṃ dhammaṃ paccayā niyato kusalo dhammo uppajjati hetupaccayā. Naniyataṃ nakusalaṃ dhammaṃ paccayā aniyato kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4235]='****60*. Naanuttaraṃ nakusalaṃ dhammaṃ paccayā anuttaro kusalo dhammo uppajjati hetupaccayā. Naanuttaraṃ nakusalaṃ dhammaṃ paccayā sauttaro kusalo dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4236]='****61*. Nasaraṇaṃ nakusalaṃ dhammaṃ paccayā araṇo kusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4237]='*Nasaraṇaṃ naakusalaṃ dhammaṃ paccayā saraṇo akusalo dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4238]='*Nasaraṇaṃ naabyākataṃ dhammaṃ paṭicca araṇo abyākato dhammo uppajjati hetupaccayā. Naaraṇaṃ naabyākataṃ dhammaṃ paṭicca araṇo abyākato dhammo uppajjati hetupaccayā. Hetuyā dve.*';
P_HTM[4239]='*1-2. Hetuduka-vedanāttikaṃ*';
P_HTM[4240]='****62*. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca hetu sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca nahetu sukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā. Nahetuṃ nasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca hetu sukhāya vedanāya sampayutto ca nahetu sukhāya vedanāya sampayutto ca dhammā uppajjanti hetupaccayā. Hetuyā tīṇi. Nahetu nadukkhāya vedanāya sampayuttamūlaṃ tīṇiyeva.*';
P_HTM[4241]='*Nahetuṃ naadukkhamasukhāya vedanāya sampayuttaṃ dhammaṃ paṭicca hetu adukkhamasukhāya vedanāya sampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4242]='*1-3. Hetuduka-vipākattikaṃ*';
P_HTM[4243]='****63*. Nahetuṃ navipākaṃ dhammaṃ paṭicca hetu vipāko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4244]='*Nahetuṃ ** navipākadhammadhammaṃ paccayā hetu vipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4245]='*Nahetuṃ nanevavipākanavipākadhammadhammaṃ paṭicca nahetu nevavipākanavipākadhammadhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4246]='*1-4. Hetuduka-upādinnattikaṃ*';
P_HTM[4247]='****64*. Nahetu naupādinnupādāniyo dhammo hetussa upādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Nahetu naupādinnupādāniyo dhammo nahetussa upādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo. Nahetu naupādinnupādāniyo dhammo hetussa upādinnupādāniyassa ca nahetussa upādinnupādāniyassa ca dhammassa ārammaṇapaccayena paccayo. (3)*';
P_HTM[4248]='*Nanahetu naupādinnupādāniyo dhammo nahetussa upādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo… tīṇi.*';
P_HTM[4249]='*Nahetu naupādinnupādāniyo ca nanahetu naupādinnupādāniyo ca dhammā hetussa upādinnupādāniyassa dhammassa ārammaṇapaccayena paccayo… tīṇi. (Nava pañhā saṃkhittaṃ.)*';
P_HTM[4250]='*Nahetuṃ naanupādinnupādāniyaṃ dhammaṃ paccayā hetu anupādinnupādāniyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4251]='*Nahetuṃ naanupādinnaanupādāniyaṃ dhammaṃ paccayā hetu anupādinnaanupādāniyo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4252]='*1-5. Hetuduka-saṃkiliṭṭhattikaṃ*';
P_HTM[4253]='****65*. Nahetuṃ nasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paccayā hetu saṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4254]='*Nahetuṃ naasaṃkiliṭṭhasaṃkilesikaṃ dhammaṃ paṭicca nahetu asaṃkiliṭṭhasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4255]='*Nahetuṃ naasaṃkiliṭṭhaasaṃkilesikaṃ dhammaṃ paccayā hetu asaṃkiliṭṭhaasaṃkilesiko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4256]='*1-6. Hetuduka-vitakkattikaṃ*';
P_HTM[4257]='****66*. Nahetuṃ **nasavitakkasavicāraṃ dhammaṃ paṭicca hetu savitakkasavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4258]='*Nahetuṃ naavitakkavicāramattaṃ dhammaṃ paṭicca hetu avitakkavicāramatto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4259]='*Nahetuṃ naavitakkaavicāraṃ dhammaṃ paṭicca nahetu avitakkaavicāro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4260]='*1-7. Hetuduka-pītittikaṃ*';
P_HTM[4261]='****67*. Nahetuṃ napītisahagataṃ dhammaṃ paṭicca hetu pītisahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4262]='*Nahetuṃ nasukhasahagataṃ dhammaṃ paṭicca hetu sukhasahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4263]='*Nahetuṃ naupekkhāsahagataṃ dhammaṃ paṭicca hetu upekkhāsahagato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4264]='*1-8. Hetuduka-dassanattikaṃ*';
P_HTM[4265]='****68*. Nahetuṃ nadassanena pahātabbaṃ dhammaṃ paccayā hetu dassanena pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4266]='*Nahetuṃ nabhāvanāya pahātabbaṃ dhammaṃ paccayā hetu bhāvanāya pahātabbo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4267]='****69*. Nahetuṃ nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nahetu nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. Nanahetuṃ nanevadassanena nabhāvanāya pahātabbaṃ dhammaṃ paṭicca nahetu nevadassanena nabhāvanāya pahātabbo dhammo uppajjati hetupaccayā. (Dukamūlaṃ ekaṃ saṃkhittaṃ, sabbattha tīṇi.)*';
P_HTM[4268]='*1-9. Hetuduka-dassanahetuttikaṃ*';
P_HTM[4269]='****70*. Nanahetuṃ nadassanena pahātabbahetukaṃ dhammaṃ paṭicca nahetu dassanena pahātabbahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4270]='*Nanahetuṃ ** nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu bhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4271]='****71*. Nahetuṃ nanevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu nevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā. Nanahetuṃ nanevadassanena nabhāvanāya pahātabbahetukaṃ dhammaṃ paṭicca nahetu nevadassanena nabhāvanāya pahātabbahetuko dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4272]='*1-10. Hetuduka-ācayagāmittikaṃ*';
P_HTM[4273]='****72*. Nahetuṃ naācayagāmiṃ dhammaṃ paccayā hetu ācayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4274]='*Nahetuṃ naapacayagāmiṃ dhammaṃ paccayā hetu apacayagāmī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4275]='*Nahetuṃ nanevācayagāmināpacayagāmiṃ dhammaṃ paṭicca nahetu nevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā. Nanahetuṃ nanevācayagāmināpacayagāmiṃ dhammaṃ paṭicca nahetu nevācayagāmināpacayagāmī dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4276]='*1-11. Hetuduka-sekkhattikaṃ*';
P_HTM[4277]='****73*. Nahetuṃ nasekkhaṃ dhammaṃ paccayā hetu sekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4278]='*Nahetuṃ naasekkhaṃ dhammaṃ paccayā hetu asekkho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4279]='*Nahetuṃ nanevasekkhanāsekkhaṃ dhammaṃ paṭicca nahetu nevasekkhanāsekkho dhammo uppajjati hetupaccayā. Nanahetuṃ nanevasekkhanāsekkhaṃ dhammaṃ paṭicca nahetu nevasekkhanāsekkho dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4280]='*1-12. Hetuduka-parittattikaṃ*';
P_HTM[4281]='****74*. Nahetuṃ ** naparittaṃ dhammaṃ paṭicca nahetu paritto dhammo uppajjati hetupaccayā. Nanahetuṃ naparittaṃ dhammaṃ paṭicca nahetu paritto dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4282]='*Nahetuṃ namahaggataṃ dhammaṃ paṭicca hetu mahaggato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4283]='*Nahetuṃ naappamāṇaṃ dhammaṃ paccayā hetu appamāṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4284]='*1-13. Hetuduka-parittārammaṇattikaṃ*';
P_HTM[4285]='****75*. Nahetuṃ naparittārammaṇaṃ dhammaṃ paṭicca hetu parittārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4286]='*Nahetuṃ namahaggatārammaṇaṃ dhammaṃ paccayā hetu mahaggatārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4287]='*Nahetuṃ naappamāṇārammaṇaṃ dhammaṃ paccayā hetu appamāṇārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4288]='*1-14. Hetuduka-hīnattikaṃ*';
P_HTM[4289]='****76*. Nahetuṃ nahīnaṃ dhammaṃ paccayā hetu hīno dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4290]='*Nahetuṃ namajjhimaṃ dhammaṃ paṭicca nahetu majjhimo dhammo uppajjati hetupaccayā. Nanahetuṃ namajjhimaṃ dhammaṃ paṭicca nahetu majjhimo dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4291]='*Nahetuṃ napaṇītaṃ dhammaṃ paccayā hetu paṇīto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4292]='*1-15. Hetuduka-micchattaniyatattikaṃ*';
P_HTM[4293]='****77*. Nahetuṃ namicchattaniyataṃ dhammaṃ paccayā hetu micchattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4294]='*Nahetuṃ ** nasammattaniyataṃ dhammaṃ paccayā hetu sammattaniyato dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4295]='*Nahetuṃ naaniyataṃ dhammaṃ paṭicca nahetu aniyato dhammo uppajjati hetupaccayā. Nanahetuṃ naaniyataṃ dhammaṃ paṭicca nahetu aniyato dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4296]='*1-16. Hetuduka-maggārammaṇattikaṃ*';
P_HTM[4297]='****78*. Nahetuṃ namaggārammaṇaṃ dhammaṃ paccayā hetu maggārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4298]='*Nahetuṃ namaggahetukaṃ dhammaṃ paccayā hetu maggahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4299]='*Nahetuṃ namaggādhipatiṃ dhammaṃ paccayā hetu maggādhipati dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4300]='*1-17. Hetuduka-uppannattikaṃ*';
P_HTM[4301]='****79*. Nahetu nauppanno dhammo hetussa uppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava.*';
P_HTM[4302]='*1-18. Hetuduka-atītattikaṃ*';
P_HTM[4303]='****80*. Nahetu napaccuppanno dhammo hetussa paccuppannassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe nava.*';
P_HTM[4304]='*1-19. Hetuduka-atītārammaṇattikaṃ*';
P_HTM[4305]='****81*. Nahetuṃ naatītārammaṇaṃ dhammaṃ paṭicca hetu atītārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4306]='*Nahetuṃ naanāgatārammaṇaṃ dhammaṃ paccayā hetu anāgatārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4307]='*Nahetuṃ napaccuppannārammaṇaṃ dhammaṃ paṭicca hetu paccuppannārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4308]='*1-20. Hetuduka-ajjhattattikaṃ*';
P_HTM[4309]='****82*. Nahetu ** naajjhatto dhammo hetussa ajjhattassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)… Ārammaṇe nava, adhipatiyā upanissaye nava, purejāte atthiyā avigate tīṇi.*';
P_HTM[4310]='*Nahetu nabahiddhā dhammo hetussa bahiddhā dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.)… Ārammaṇe nava, adhipatiyā upanissaye nava, purejāte atthiyā avigate tīṇi.*';
P_HTM[4311]='*(Ajjhattattiko na labbhati paṭiccavārādīsu.)*';
P_HTM[4312]='*1-21. Hetuduka-ajjhattārammaṇattikaṃ*';
P_HTM[4313]='****83*. Nahetuṃ naajjhattārammaṇaṃ dhammaṃ paccayā hetu ajjhattārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4314]='*Nahetuṃ nabahiddhārammaṇaṃ dhammaṃ paccayā hetu bahiddhārammaṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Ajjhattabahiddhārammaṇaṃ natthi.)*';
P_HTM[4315]='*1-22. Hetuduka-sanidassanattikaṃ*';
P_HTM[4316]='****84*. Nahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4317]='*Nanahetuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4318]='*(Nahetunaanidassanasappaṭighamūlepi tīṇiyeva.)*';
P_HTM[4319]='****85*. Nahetuṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca nahetu anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4320]='*2-5-22. Sahetukādidukāni-sanidassanattikaṃ*';
P_HTM[4321]='****86*. Nasahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca ahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4322]='*Naahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca ahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi pañhā.*';
P_HTM[4323]='*(Nasahetukanaanidassanasappaṭighamūlepi tīṇiyeva.)*';
P_HTM[4324]='*Nasahetukaṃ **naanidassanaappaṭighaṃ dhammaṃ paṭicca ahetuko anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4325]='*(Nahetusampayuttaṃ nasanidassanasappaṭighaṃ sahetukadukasadisaṃ. Tīṇi pañhā. Hetusahetukaduke ca hetuhetusampayuttaduke ca pañhā no labbhati.)*';
P_HTM[4326]='*6-22. Nahetusahetukaduka-sanidassanattikaṃ*';
P_HTM[4327]='****87*. Nahetuṃ nasahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu ahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4328]='*Nahetuṃ naahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nahetu ahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4329]='*Nahetuṃ nasahetukaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca… tīṇiyeva.*';
P_HTM[4330]='*Nahetuṃ nasahetukaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca nahetu ahetuko anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4331]='*7-8-22. Sappaccayadukādi-sanidassanattikaṃ*';
P_HTM[4332]='****88*. Naappaccayaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sappaccayo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4333]='*Naappaccayaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca sappaccayo anidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4334]='*(Naappaccayanaanidassanaappaṭighamūlepi ekameva.) Hetuyā ekaṃ, adhipatiyā ekaṃ…pe… avigate ekaṃ.*';
P_HTM[4335]='*(Nasaṅkhataṃ nasappaccayasadisaṃ.)*';
P_HTM[4336]='*9-22. Sanidassanaduka-sanidassanattikaṃ*';
P_HTM[4337]='****89*. Nasanidassanaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sanidassano sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4338]='*Nasanidassanaṃ ** naanidassanasappaṭighaṃ dhammaṃ paṭicca anidassano anidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4339]='*Nasanidassanaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca anidassano anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4340]='*10-22. Sappaṭighaduka-sanidassanattikaṃ*';
P_HTM[4341]='****90*. Nasappaṭighaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sappaṭigho sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4342]='*Naappaṭighaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sappaṭigho sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4343]='*Nasappaṭighaṃ nasanidassanasappaṭighañca naappaṭighaṃ nasanidassanasappaṭighañca dhammaṃ paṭicca sappaṭigho sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. (Sabbattha tīṇi.)*';
P_HTM[4344]='*Nasappaṭighaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca sappaṭigho anidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4345]='*Naappaṭighaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca appaṭigho anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4346]='*11-22. Rūpīduka-sanidassanattikaṃ*';
P_HTM[4347]='****91*. Narūpiṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca rūpī sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4348]='*Narūpiṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca rūpī anidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4349]='*Naarūpiṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca rūpī anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4350]='*12-22. Lokiyaduka-sanidassanattikaṃ*';
P_HTM[4351]='****92*. Nalokiyaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca lokiyo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4352]='*Nalokuttaraṃ ** nasanidassanasappaṭighaṃ dhammaṃ paṭicca lokiyo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4353]='*(Gaṇitakena gaṇetabbā tīṇi pañhā.)*';
P_HTM[4354]='*Nalokiyaṃ naanidassanasappaṭighaṃ dhammaṃ paṭicca lokiyo anidassanasappaṭigho… (tīṇiyeva pañhā kātabbā).*';
P_HTM[4355]='*Nalokuttaraṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca lokiyo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4356]='*13-22. Kenaciviññeyyaduka-sanidassanattikaṃ*';
P_HTM[4357]='****93*. Nakenaci viññeyyaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca kenaci viññeyyo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nakenaci viññeyyaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca kenaci naviññeyyo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Nakenaci viññeyyaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca kenaci viññeyyo sanidassanasappaṭigho ca kenaci naviññeyyo sanidassanasappaṭigho ca dhammā uppajjanti hetupaccayā. (3)*';
P_HTM[4358]='*Nakenaci naviññeyyaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca… tīṇiyeva.*';
P_HTM[4359]='*Nakenaci viññeyyaṃ nasanidassanasappaṭighañca nakenaci naviññeyyaṃ nasanidassanasappaṭighañca dhammaṃ paṭicca… tīṇiyeva. (Sabbattha nava.)*';
P_HTM[4360]='*Nakenaci viññeyyaṃ naanidassanasappaṭighassa purimasadisaṃ navapañhaṃ kātabbaṃ. Nakenaci viññeyyaṃ naanidassanaappaṭighamūlassa navapañhameva. Hetuyā nava, adhipatiyā nava…pe… avigate nava.*';
P_HTM[4361]='*14-22. Āsavaduka-sanidassanattikaṃ*';
P_HTM[4362]='****94*. Naāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca noāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4363]='*Nanoāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca noāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4364]='*Noāsavaṃ ** naanidassanasappaṭighaṃ dhammaṃ paṭicca… (purimanayena tīṇi pañhā).*';
P_HTM[4365]='*Noāsavaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca noāsavo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4366]='*15-22. Sāsavaduka-sanidassanattikaṃ*';
P_HTM[4367]='****95*. Nasāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4368]='*Naanāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4369]='*(Nasāsavaṃ naanidassanasappaṭighamūlassa purimanayena tīṇi pañhā.)*';
P_HTM[4370]='*Naanāsavaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca sāsavo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4371]='*16-22. Āsavasampayuttaduka-sanidassanattikaṃ*';
P_HTM[4372]='****96*. Naāsavasampayuttaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca āsavavippayutto sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4373]='*Naāsavavippayuttaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca āsavavippayutto sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4374]='*(Naāsavasampayuttanaanidassanasappaṭighamūle tīṇiyeva.)*';
P_HTM[4375]='*Naāsavasampayuttaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca āsavavippayutto anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4376]='*17-22. Āsavasāsavadukādi-sanidassanattikaṃ*';
P_HTM[4377]='****97*. Naāsavañceva naanāsavañca nasanidassanasappaṭighaṃ dhammaṃ paṭicca sāsavo ceva no ca āsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā.*';
P_HTM[4378]='*Naanāsavañceva ** nano ca āsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sāsavo ceva no ca āsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… gaṇitakena tīṇi.*';
P_HTM[4379]='*(Naāsavañceva naanāsavaṃ naanidassanasappaṭighamūlepi purimanayena tīṇiyeva.)*';
P_HTM[4380]='*Naāsavañceva naanāsavañca naanidassanaappaṭighaṃ dhammaṃ paṭicca sāsavo ceva no ca āsavo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4381]='*(Āsavaāsavasampayuttaduke pañhā na labbhati.)*';
P_HTM[4382]='*19-22. Āsavavippayuttasāsavaduka-sanidassanattikaṃ*';
P_HTM[4383]='****98*. Āsavavippayuttaṃ nasāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca āsavavippayutto sāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4384]='*Āsavavippayuttaṃ naanāsavaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca āsavavippayutto sāsavo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4385]='*(Āsavavippayuttanasāsavanaanidassanasappaṭighamūlepi purimanayeneva tīṇi pañhā.)*';
P_HTM[4386]='*Āsavavippayuttaṃ naanāsavaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca āsavavippayutto sāsavo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4387]='*20-54-22. Saññojanādichagocchakāni-sanidassanattikaṃ*';
P_HTM[4388]='****99*. Nosaññojanaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nosaññojano sanidassanasappaṭigho dhammo uppajjati hetupaccayā…. (Tīṇi pañhā.)*';
P_HTM[4389]='****100*. Noganthaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nogantho sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4390]='****101*. Nooghaṃ * nasanidassanasappaṭighaṃ dhammaṃ paṭicca noogho sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4391]='****102*. Noyogaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca noyogo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4392]='****103*. Nonīvaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nonīvaraṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4393]='****104*. Noparāmāsaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca noparāmāso sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4394]='*55-68-22. Mahantaradukādi-sanidassanattikaṃ*';
P_HTM[4395]='****105*. Nasārammaṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca anārammaṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4396]='*Naanārammaṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca anārammaṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4397]='*(Anidassanasappaṭighe tīṇiyeva.)*';
P_HTM[4398]='*Nasārammaṇaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca anārammaṇo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4399]='****106*. Nocittaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocitto sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4400]='*Nanocittaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocitto sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4401]='****107*. Nacetasikaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nacetasiko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4402]='****108*. Nacittasampayuttaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca cittavippayutto sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4403]='****109*. Nacittasaṃsaṭṭhaṃ ** nasanidassanasappaṭighaṃ dhammaṃ paṭicca cittavisaṃsaṭṭho sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4404]='****110*. Nocittasamuṭṭhānaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca cittasamuṭṭhāno sanidassanasappaṭigho dhammo uppajjati hetupaccayā. (Cittasamuṭṭhānarūpeneva tīṇi, saṃkhittaṃ.)*';
P_HTM[4405]='****111*. Nocittasahabhuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocittasahabhū sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4406]='****112*. Nocittānuparivattiṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocittānuparivattī sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4407]='****113*. Nocittasaṃsaṭṭhasamuṭṭhānaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhāno sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4408]='****114*. Nocittasaṃsaṭṭhasamuṭṭhānasahabhuṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānasahabhū sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4409]='****115*. Nocittasaṃsaṭṭhasamuṭṭhānānuparivattiṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nocittasaṃsaṭṭhasamuṭṭhānānuparivattī sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4410]='****116*. Naajjhattikaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca bāhiro sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4411]='*Nabāhiraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca bāhiro sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Gaṇitakena tīṇi.*';
P_HTM[4412]='****117*. Noupādā nasanidassanasappaṭighaṃ dhammaṃ paṭicca upādā sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4413]='****118*. Naupādinnaṃ **nasanidassanasappaṭighaṃ dhammaṃ paṭicca anupādinno sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4414]='*69-74-22. Upādānadukādi-sanidassanattikaṃ*';
P_HTM[4415]='****119*. Noupādānaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca noupādāno sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4416]='*75-82-22. Kilesadukādi-sanidassanattikaṃ*';
P_HTM[4417]='****120*. Nokilesaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nokileso sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4418]='*83-100-22. Piṭṭhidukādi-sanidassanattikaṃ*';
P_HTM[4419]='****121*. Nadassanena pahātabbaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nadassanena pahātabbo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4420]='****122*. Nabhāvanāya pahātabbaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nabhāvanāya pahātabbo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4421]='****123*. Nadassanena pahātabbahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nadassanena pahātabbahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4422]='****124*. Nabhāvanāya pahātabbahetukaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nabhāvanāya pahātabbahetuko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4423]='****125*. Nasavitakkaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca avitakko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4424]='****126*. Nasavicāraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca avicāro sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4425]='****127*. Nasappītikaṃ * nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasappītiko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4426]='****128*. Napītisahagataṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca napītisahagato sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4427]='****129*. Nasukhasahagataṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca nasukhasahagato sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4428]='****130*. Naupekkhāsahagataṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca naupekkhāsahagato sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4429]='****131*. Nakāmāvacaraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca kāmāvacaro sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4430]='****132*. Narūpāvacaraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca narūpāvacaro sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4431]='****133*. Naarūpāvacaraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca naarūpāvacaro sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4432]='****134*. Napariyāpannaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca pariyāpanno sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4433]='****135*. Naniyyānikaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca aniyyāniko sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4434]='****136*. Naniyataṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca aniyato sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4435]='****137*. Nasauttaraṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca sauttaro sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4436]='****138*. Nasaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca araṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4437]='*Naaraṇaṃ ** nasanidassanasappaṭighaṃ dhammaṃ paṭicca araṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4438]='*Nasaraṇaṃ nasanidassanasappaṭighañca naaraṇaṃ nasanidassanasappaṭighañca dhammaṃ paṭicca araṇo sanidassanasappaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi. (Anidassanasappaṭighe tīṇiyeva.)*';
P_HTM[4439]='*Nasaraṇaṃ naanidassanaappaṭighaṃ dhammaṃ paṭicca araṇo anidassanaappaṭigho dhammo uppajjati hetupaccayā. Hetuyā ekaṃ.*';
P_HTM[4440]='*Paccanīyaṃ*';
P_HTM[4441]='*Nahetu-naārammaṇapaccayā*';
P_HTM[4442]='****139*. Nasaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca araṇo sanidassanasappaṭigho dhammo uppajjati nahetupaccayā. Ekaṃ.*';
P_HTM[4443]='*Nasaraṇaṃ nasanidassanasappaṭighaṃ dhammaṃ paṭicca araṇo sanidassanasappaṭigho dhammo uppajjati naārammaṇapaccayā… tīṇi. Nahetuyā ekaṃ, naārammaṇe tīṇi, naadhipatiyā tīṇi…pe… novigate tīṇi.*';
P_HTM[4444]='*Hetupaccayā naārammaṇe tīṇi… naārammaṇapaccayā hetuyā tīṇi.*';
P_HTM[4445]='*(Sahajātavārampi paccayavārampi nissayavārampi saṃsaṭṭhavārampi sampayuttavārampi vitthāretabbaṃ.)*';
P_HTM[4446]='*7. Pañhāvāro*';
P_HTM[4447]='*Hetupaccayo*';
P_HTM[4448]='****140*. Nasaraṇo nasanidassanasappaṭigho dhammo araṇassa sanidassanasappaṭighassa dhammassa hetupaccayena paccayo. Naaraṇo nasanidassanasappaṭigho dhammo araṇassa sanidassanasappaṭighassa dhammassa hetupaccayena paccayo.*';
P_HTM[4449]='*Hetuyā dve, adhipatiyā dve…pe… avigate tīṇi.*';
P_HTM[4450]='*(Yathā kusalattike pañhāvārassa anulomampi paccanīyampi anulomapaccanīyampi paccanīyānulomampi gaṇitaṃ, evaṃ gaṇetabbaṃ.)*';
P_HTM[4451]='*Dhammapaccanīyānulome dukatikapaṭṭhānaṃ niṭṭhitaṃ.*';
P_HTM[4452]='*Dhammapaccanīyānulome tikadukapaṭṭhānaṃ*';
P_HTM[4453]='*1-1. Kusalattika-hetudukaṃ*';
P_HTM[4454]='****1*. Nakusalaṃ *nahetuṃ dhammaṃ paṭicca akusalo hetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuṃ dhammaṃ paṭicca abyākato hetu dhammo uppajjati hetupaccayā. (2)*';
P_HTM[4455]='*Naakusalaṃ nahetuṃ dhammaṃ paṭicca kusalo hetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuṃ dhammaṃ paṭicca abyākato hetu dhammo uppajjati hetupaccayā. (2)*';
P_HTM[4456]='*Naabyākataṃ nahetuṃ dhammaṃ paṭicca kusalo hetu dhammo uppajjati hetupaccayā. Naabyākataṃ nahetuṃ dhammaṃ paṭicca akusalo hetu dhammo uppajjati hetupaccayā. (2)*';
P_HTM[4457]='*Nakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca akusalo hetu dhammo uppajjati hetupaccayā. Naakusalaṃ nahetuñca naabyākataṃ nahetuñca dhammaṃ paṭicca kusalo hetu dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñca naakusalaṃ nahetuñca dhammaṃ paṭicca abyākato hetu dhammo uppajjati hetupaccayā. Tīṇi. (Saṃkhittaṃ.) Hetuyā nava.*';
P_HTM[4458]='****2*. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca akusalo nahetu dhammo uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ dhammaṃ paṭicca abyākato nahetu dhammo ** uppajjati hetupaccayā. Nakusalaṃ nanahetuṃ * dhammaṃ paṭicca akusalo nahetu ca abyākato nahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4459]='*Naakusalaṃ nanahetuṃ dhammaṃ paṭicca kusalo nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nanahetuṃ dhammaṃ paṭicca abyākato nahetu dhammo uppajjati hetupaccayā. Naakusalaṃ nanahetuṃ dhammaṃ paṭicca kusalo nahetu ca abyākato nahetu ca dhammā uppajjanti hetupaccayā. Tīṇi.*';
P_HTM[4460]='*Naabyākataṃ nanahetuṃ dhammaṃ paṭicca abyākato nahetu dhammo uppajjati hetupaccayā… pañca.*';
P_HTM[4461]='*Nakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca akusalo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4462]='*Naakusalaṃ nanahetuñca naabyākataṃ nanahetuñca dhammaṃ paṭicca kusalo nahetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4463]='*Nakusalaṃ nanahetuñca naakusalaṃ nanahetuñca dhammaṃ paṭicca abyākato nahetu dhammo uppajjati hetupaccayā. Ekaṃ… hetuyā aṭṭhārasa.*';
P_HTM[4464]='*1-2. Kusalattika-sahetukadukaṃ*';
P_HTM[4465]='****3*. Nakusalaṃ nasahetukaṃ dhammaṃ paṭicca akusalo sahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ nasahetukaṃ dhammaṃ paṭicca abyākato sahetuko dhammo uppajjati hetupaccayā. Naakusalaṃ nasahetukaṃ dhammaṃ paṭicca abyākato sahetuko dhammo uppajjati hetupaccayā. Naabyākataṃ nasahetukaṃ dhammaṃ paṭicca akusalo sahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ nasahetukañca naabyākataṃ nasahetukañca dhammaṃ paṭicca akusalo sahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ nasahetukañca naakusalaṃ nasahetukañca dhammaṃ paṭicca abyākato sahetuko dhammo uppajjati hetupaccayā. Hetuyā cha.*';
P_HTM[4466]='****4*. Nakusalaṃ naahetukaṃ dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati hetupaccayā. Naakusalaṃ naahetukaṃ dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati  Naabyākataṃ ** naahetukaṃ dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ naahetukañca naabyākataṃ naahetukañca dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati hetupaccayā. Naakusalaṃ naahetukañca naabyākataṃ naahetukañca dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati hetupaccayā. Nakusalaṃ naahetukañca naakusalaṃ naahetukañca dhammaṃ paṭicca abyākato ahetuko dhammo uppajjati hetupaccayā. Hetuyā cha.*';
P_HTM[4467]='*1-3. Kusalattika-hetusampayuttadukaṃ*';
P_HTM[4468]='****5*. Nakusalaṃ nahetusampayuttaṃ dhammaṃ paṭicca akusalo hetusampayutto dhammo uppajjati hetupaccayā. Nakusalaṃ nahetusampayuttaṃ dhammaṃ paṭicca abyākato hetusampayutto dhammo uppajjati hetupaccayā. Naakusalaṃ nahetusampayuttaṃ dhammaṃ paṭicca abyākato hetusampayutto dhammo uppajjati hetupaccayā… cha. (Sahetukasadisaṃ.)*';
P_HTM[4469]='*Nakusalaṃ nahetuvippayuttaṃ dhammaṃ paṭicca abyākato hetuvippayutto dhammo uppajjati hetupaccayā… cha. (Ahetukasadisaṃ, saṃkhittaṃ.)*';
P_HTM[4470]='*1-4-6. Kusalattika-hetusahetukādidukāni*';
P_HTM[4471]='****6*. Nakusalaṃ nahetuñceva naahetukañca dhammaṃ paṭicca akusalo hetu ceva sahetuko ca dhammo uppajjati hetupaccayā. Nakusalaṃ nahetuñceva naahetukañca dhammaṃ paṭicca abyākato hetu ceva sahetuko ca dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[4472]='*(Naakusale dve, naabyākate dve. Paṭhamaṃ gaṇitakena ekaṃ, dutiyaṃ gaṇitakena ekaṃ, tatiyaṃ gaṇitakena ekaṃ, sabbattha nava pañhā.)*';
P_HTM[4473]='*Nakusalaṃ naahetukañceva na ca hetuṃ dhammaṃ paṭicca akusalo sahetuko ceva na ca hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4474]='****7*. Nakusalaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca akusalo hetu ceva hetusampayutto ca dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4475]='*Nakusalaṃ ** nahetuvippayuttañceva nanahetuñca dhammaṃ paṭicca akusalo hetusampayutto ceva na ca hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4476]='****8*. Nakusalaṃ nahetuṃ nasahetukaṃ dhammaṃ paṭicca abyākato nahetu sahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4477]='****9*. Nakusalaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca akusalo nahetu ahetuko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[4478]='*Naakusalaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca abyākato nahetu ahetuko dhammo uppajjati hetupaccayā. (1)*';
P_HTM[4479]='*Naabyākataṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca abyākato nahetu ahetuko dhammo uppajjati hetupaccayā. (1) (Gaṇitakena tīṇi pañhā.)… Hetuyā cha.*';
P_HTM[4480]='*1-7-13. Kusalattika-cūḷantaradukāni*';
P_HTM[4481]='****10*. Nakusalo nasappaccayo dhammo kusalassa sappaccayassa dhammassa ārammaṇapaccayena paccayo… ārammaṇe cha. (Saṅkhataṃ sappaccayasadisaṃ.)*';
P_HTM[4482]='****11*. Nakusalaṃ nasanidassanaṃ dhammaṃ paṭicca abyākato sanidassano dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4483]='*Nakusalo naanidassano dhammo kusalassa anidassanassa dhammassa ārammaṇapaccayena paccayo. (Nava pañhā kātabbā).*';
P_HTM[4484]='****12*. Nakusalaṃ nasappaṭighaṃ dhammaṃ paṭicca abyākato sappaṭigho dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4485]='*Nakusalaṃ naappaṭighaṃ dhammaṃ paṭicca abyākato appaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4486]='****13*. Nakusalaṃ narūpiṃ dhammaṃ paṭicca abyākato rūpī dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4487]='*Nakusalaṃ ** naarūpiṃ dhammaṃ paṭicca abyākato arūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4488]='****14*. Nakusalaṃ nalokiyaṃ dhammaṃ paṭicca abyākato lokiyo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4489]='*Nakusalaṃ nalokuttaraṃ dhammaṃ paccayā kusalo lokuttaro dhammo uppajjati hetupaccayā. Nakusalaṃ nalokuttaraṃ dhammaṃ paccayā abyākato lokuttaro dhammo uppajjati hetupaccayā. (Cha pañhā kātabbā.)*';
P_HTM[4490]='****15*. Nakusalaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca akusalo kenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[4491]='*Nakusalaṃ nakenaci naviññeyyaṃ dhammaṃ paṭicca akusalo kenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[4492]='*1-14. Kusalattika-āsavagocchakaṃ*';
P_HTM[4493]='****16*. Nakusalaṃ noāsavaṃ dhammaṃ paṭicca akusalo āsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4494]='*Nakusalaṃ nanoāsavaṃ dhammaṃ paṭicca akusalo noāsavo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4495]='****17*. Nakusalaṃ nasāsavaṃ dhammaṃ paṭicca abyākato sāsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4496]='*Nakusalaṃ naanāsavaṃ dhammaṃ paccayā kusalo anāsavo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā cha…pe… vipāke tīṇi…pe… avigate cha.*';
P_HTM[4497]='****18*. Nakusalaṃ naāsavasampayuttaṃ dhammaṃ paṭicca akusalo āsavasampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4498]='*Nakusalaṃ naāsavavippayuttaṃ dhammaṃ paṭicca akusalo āsavavippayutto dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4499]='****19*. Nakusalaṃ ** naāsavañceva naanāsavañca dhammaṃ paṭicca akusalo āsavo ceva sāsavo ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4500]='*Nakusalaṃ naanāsavañceva nano ca āsavaṃ dhammaṃ paṭicca akusalo sāsavo ceva no ca āsavo dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4501]='****20*. Nakusalaṃ naāsavañceva naāsavavippayuttañca dhammaṃ paṭicca akusalo āsavo ceva āsavasampayutto ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4502]='*Nakusalaṃ naāsavavippayuttañceva nano ca āsavaṃ dhammaṃ paṭicca akusalo āsavasampayutto ceva no ca āsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4503]='****21*. Nakusalaṃ āsavavippayuttaṃ nasāsavaṃ dhammaṃ paṭicca abyākato āsavavippayutto sāsavo dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4504]='*1-20-54. Kusalattika-saññojanādigocchakāni*';
P_HTM[4505]='****22*. Nakusalaṃ nosaññojanaṃ dhammaṃ paṭicca akusalo saññojano dhammo uppajjati hetupaccayā.*';
P_HTM[4506]='****23*. Nakusalaṃ noganthaṃ dhammaṃ paṭicca akusalo gantho dhammo uppajjati hetupaccayā.*';
P_HTM[4507]='****24*. Nakusalaṃ nooghaṃ dhammaṃ paṭicca akusalo ogho dhammo uppajjati hetupaccayā.*';
P_HTM[4508]='****25*. Nakusalaṃ noyogaṃ dhammaṃ paṭicca akusalo yogo dhammo uppajjati hetupaccayā.*';
P_HTM[4509]='****26*. Nakusalaṃ nonīvaraṇaṃ dhammaṃ paṭicca akusalo nīvaraṇo dhammo uppajjati hetupaccayā.*';
P_HTM[4510]='****27*. Nakusalaṃ ** noparāmāsaṃ dhammaṃ paṭicca akusalo parāmāso dhammo uppajjati hetupaccayā.*';
P_HTM[4511]='*1-55-92. Kusalattika-mahantaradukāni*';
P_HTM[4512]='****28*. Nakusalaṃ nasārammaṇaṃ dhammaṃ paṭicca abyākato sārammaṇo dhammo uppajjati hetupaccayā…pe….*';
P_HTM[4513]='*1-93. Kusalattika-kāmāvacaradukaṃ*';
P_HTM[4514]='****29*. Nakusalaṃ nakāmāvacaraṃ dhammaṃ paṭicca abyākato kāmāvacaro dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4515]='*Nakusalaṃ nanakāmāvacaraṃ dhammaṃ paṭicca abyākato nakāmāvacaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4516]='*1-94. Kusalattika-rūpāvacaradukaṃ*';
P_HTM[4517]='****30*. Nakusalaṃ narūpāvacaraṃ dhammaṃ paṭicca abyākato rūpāvacaro dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4518]='*Nakusalaṃ nanarūpāvacaraṃ dhammaṃ paṭicca abyākato narūpāvacaro dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4519]='*1-95. Kusalattika-arūpāvacaradukaṃ*';
P_HTM[4520]='****31*. Nakusalaṃ naarūpāvacaraṃ dhammaṃ paccayā kusalo arūpāvacaro dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4521]='*Nakusalaṃ nanaarūpāvacaraṃ dhammaṃ paṭicca abyākato naarūpāvacaro dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4522]='*1-96. Kusalattika-pariyāpannadukaṃ*';
P_HTM[4523]='****32*. Nakusalaṃ napariyāpannaṃ dhammaṃ paṭicca abyākato pariyāpanno dhammo uppajjati hetupaccayā. Naakusalaṃ napariyāpannaṃ dhammaṃ paṭicca abyākato pariyāpanno dhammo uppajjati hetupaccayā. Naabyākataṃ napariyāpannaṃ dhammaṃ paṭicca abyākato pariyāpanno dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4524]='*Nakusalaṃ ** naapariyāpannaṃ dhammaṃ paccayā kusalo apariyāpanno dhammo uppajjati hetupaccayā. Nakusalaṃ naapariyāpannaṃ dhammaṃ paccayā abyākato apariyāpanno dhammo uppajjati hetupaccayā. Dve. (Akusalamūle dve, dukamūle dve.)… Hetuyā cha.*';
P_HTM[4525]='*1-97. Kusalattika-niyyānikadukaṃ*';
P_HTM[4526]='****33*. Nakusalaṃ naniyyānikaṃ dhammaṃ paccayā kusalo niyyāniko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4527]='*Nakusalaṃ naaniyyānikaṃ dhammaṃ paṭicca abyākato aniyyāniko dhammo uppajjati hetupaccayā. Naabyākataṃ naaniyyānikaṃ dhammaṃ paṭicca abyākato aniyyāniko dhammo uppajjati hetupaccayā. Naakusalaṃ naaniyyānikañca naabyākataṃ naaniyyānikañca dhammaṃ paṭicca abyākato aniyyāniko dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4528]='*1-98. Kusalattika-niyatadukaṃ*';
P_HTM[4529]='****34*. Nakusalaṃ * naniyataṃ dhammaṃ paccayā kusalo niyato dhammo uppajjati hetupaccayā… (apariyāpannasadisaṃ cha pañhā).*';
P_HTM[4530]='*Nakusalaṃ naaniyataṃ dhammaṃ paṭicca abyākato aniyato dhammo uppajjati hetupaccayā. Naakusalaṃ naaniyataṃ dhammaṃ paṭicca abyākato aniyato dhammo uppajjati hetupaccayā. Naabyākataṃ naaniyataṃ dhammaṃ paṭicca abyākato aniyato dhammo uppajjati hetupaccayā. Nakusalaṃ naaniyatañca naabyākataṃ naaniyatañca dhammaṃ paṭicca abyākato aniyato dhammo uppajjati hetupaccayā. Naakusalaṃ naaniyatañca naabyākataṃ naaniyatañca dhammaṃ paṭicca abyākato aniyato dhammo uppajjati hetupaccayā. Hetuyā pañca.*';
P_HTM[4531]='*1-99. Kusalattika-sauttaradukaṃ*';
P_HTM[4532]='****35*. Nakusalaṃ nasauttaraṃ dhammaṃ paṭicca abyākato sauttaro dhammo uppajjati hetupaccayā. Naakusalaṃ nasauttaraṃ dhammaṃ paṭicca abyākato sauttaro dhammo uppajjati hetupaccayā. Naabyākataṃ nasauttaraṃ dhammaṃ paṭicca ** abyākato sauttaro dhammo uppajjati hetupaccayā. Naakusalaṃ nasauttarañca naabyākataṃ nasauttarañca dhammaṃ paṭicca abyākato sauttaro dhammo uppajjati hetupaccayā. Nakusalaṃ nasauttarañca naakusalaṃ nasauttarañca dhammaṃ paṭicca abyākato sauttaro dhammo uppajjati hetupaccayā. Hetuyā pañca.*';
P_HTM[4533]='*Nakusalaṃ naanuttaraṃ dhammaṃ paccayā kusalo anuttaro dhammo uppajjati hetupaccayā… (saṃkhittaṃ.) Hetuyā cha…pe… vipāke tīṇi…pe… avigate cha.*';
P_HTM[4534]='*1-100. Kusalattika-saraṇadukaṃ*';
P_HTM[4535]='****36*. Nakusalaṃ nasaraṇaṃ dhammaṃ paccayā akusalo saraṇo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4536]='*Nakusalaṃ naaraṇaṃ dhammaṃ paṭicca abyākato araṇo dhammo uppajjati hetupaccayā. Naabyākataṃ naaraṇaṃ dhammaṃ paṭicca abyākato araṇo dhammo uppajjati hetupaccayā. Nakusalaṃ naaraṇañca naabyākataṃ naaraṇañca dhammaṃ paṭicca abyākato araṇo dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4537]='*2-1. Vedanāttika-hetudukaṃ*';
P_HTM[4538]='****37*. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca sukhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā. Nasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca adukkhamasukhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā. Tīṇi.*';
P_HTM[4539]='*Nadukkhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4540]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nahetuṃ dhammaṃ paṭicca adukkhamasukhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā… tīṇi.*';
P_HTM[4541]='*Nasukhāya ** vedanāya sampayuttaṃ nahetuñca naadukkhamasukhāya vedanāya sampayuttaṃ nahetuñca dhammaṃ paṭicca sukhāya vedanāya sampayutto hetu dhammo uppajjati hetupaccayā… tīṇi (dutiyaṃ gaṇitakena tīṇi). Hetuyā ekavīsa.*';
P_HTM[4542]='*Nasukhāya vedanāya sampayuttaṃ nanahetuṃ dhammaṃ paṭicca dukkhāya vedanāya sampayutto nahetu dhammo uppajjati hetupaccayā… dve.*';
P_HTM[4543]='*Nadukkhāya vedanāya sampayuttaṃ nanahetuṃ dhammaṃ paṭicca… (dve pañhāyeva).*';
P_HTM[4544]='*Naadukkhamasukhāya vedanāya sampayuttaṃ nanahetuṃ dhammaṃ paṭicca… (dveyeva. Paṭhamaṃ gaṇitakena ekaṃ, dutiyaṃ gaṇitakena ekaṃ, tatiyaṃ gaṇitakena ekaṃ kātabbaṃ.) Hetuyā nava.*';
P_HTM[4545]='*3-1. Vipākattika-hetudukaṃ*';
P_HTM[4546]='****38*. Navipākaṃ nahetuṃ dhammaṃ paṭicca vipāko hetu dhammo uppajjati hetupaccayā. Navipākaṃ nahetuṃ dhammaṃ paṭicca vipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Navipākaṃ nahetuṃ dhammaṃ paṭicca nevavipākanavipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Tīṇi.*';
P_HTM[4547]='*Navipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca vipāko hetu dhammo uppajjati hetupaccayā. Navipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca nevavipākanavipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[4548]='*Nanevavipākanavipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca vipāko hetu dhammo uppajjati hetupaccayā. Nanevavipākanavipākadhammadhammaṃ nahetuṃ dhammaṃ paṭicca vipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Dve.*';
P_HTM[4549]='*Navipākaṃ nahetuñca nanevavipākanavipākadhammadhammaṃ nahetuñca dhammaṃ paṭicca vipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4550]='*Navipākadhammadhammaṃ nahetuñca nanevavipākanavipākadhammadhammaṃ nahetuñca dhammaṃ paṭicca vipāko hetu dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4551]='*Navipākaṃ nahetuñca navipākadhammadhammaṃ nahetuñca dhammaṃ paṭicca vipāko hetu dhammo uppajjati hetupaccayā. Navipākaṃ nahetuñca navipākadhammadhammaṃ nahetuñca ** dhammaṃ paṭicca nevavipākanavipākadhammadhammo hetu dhammo uppajjati hetupaccayā. Dve. (Saṃkhittaṃ.) Hetuyā ekādasa.*';
P_HTM[4552]='*Navipākaṃ nanahetuṃ dhammaṃ paṭicca vipākadhammadhammo nahetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa. (Saṃkhittaṃ.)*';
P_HTM[4553]='*4-1. Upādinnattika-hetudukaṃ*';
P_HTM[4554]='****39*. Naupādinnupādāniyaṃ nahetuṃ dhammaṃ paṭicca anupādinnupādāniyo hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4555]='*Naupādinnupādāniyaṃ nanahetuṃ dhammaṃ paṭicca anupādinnupādāniyo nahetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhārasa.*';
P_HTM[4556]='*5-1. Saṃkiliṭṭhattika-hetudukaṃ*';
P_HTM[4557]='****40*. Nasaṃkiliṭṭhasaṃkilesikaṃ nahetuṃ dhammaṃ paṭicca asaṃkiliṭṭhasaṃkilesiko hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4558]='*6-11-1. Vitakkādittikāni-hetudukaṃ*';
P_HTM[4559]='****41*. Nasavitakkasavicāraṃ nahetuṃ dhammaṃ paṭicca savitakkasavicāro hetu dhammo uppajjati hetupaccayā… hetuyā pannarasa.*';
P_HTM[4560]='****42*. Napītisahagataṃ nahetuṃ dhammaṃ paṭicca pītisahagato hetu dhammo uppajjati hetupaccayā… hetuyā aṭṭhavīsa.*';
P_HTM[4561]='****43*. Nadassanena pahātabbaṃ nahetuṃ dhammaṃ paṭicca bhāvanāya pahātabbo hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4562]='****44*. Nadassanena pahātabbahetukaṃ nahetuṃ dhammaṃ paṭicca bhāvanāya pahātabbahetuko hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4563]='****45*. Naācayagāmiṃ nahetuṃ dhammaṃ paṭicca apacayagāmī hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4564]='****46*. Nasekkhaṃ **nahetuṃ dhammaṃ paṭicca asekkho hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4565]='*12-13-1. Parittattikadvaya-hetudukaṃ*';
P_HTM[4566]='****47*. Naparittaṃ nahetuṃ dhammaṃ paṭicca mahaggato hetu dhammo uppajjati hetupaccayā… hetuyā ekādasa.*';
P_HTM[4567]='****48*. Naparittārammaṇaṃ nahetuṃ dhammaṃ paṭicca parittārammaṇo hetu dhammo uppajjati hetupaccayā… hetuyā terasa.*';
P_HTM[4568]='*14-17-1. Hīnādittikāni-hetudukaṃ*';
P_HTM[4569]='****49*. Nahīnaṃ nahetuṃ dhammaṃ paṭicca majjhimo hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4570]='****50*. Namicchattaniyataṃ nahetuṃ dhammaṃ paṭicca sammattaniyato hetu dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4571]='****51*. Namaggārammaṇaṃ nahetuṃ dhammaṃ paṭicca maggahetuko hetu dhammo uppajjati hetupaccayā… (saṃkhittaṃ.) Hetuyā dasa.*';
P_HTM[4572]='****52*. Naanuppanno nanahetu dhammo uppannassa nahetussa dhammassa hetupaccayena paccayo. Nauppādī nanahetu dhammo uppannassa nahetussa dhammassa hetupaccayena paccayo. Naanuppanno nanahetu ca nauppādī nanahetu ca dhammā uppannassa nahetussa dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[4573]='*18-19-1. Atītattikadvaya-hetudukaṃ*';
P_HTM[4574]='****53*. Naatīto nanahetu dhammo paccuppannassa nahetussa dhammassa hetupaccayena paccayo. Naanāgato nanahetu dhammo paccuppannassa nahetussa dhammassa hetupaccayena paccayo. Naatīto nanahetu ca naanāgato nanahetu ca dhammā paccuppannassa nahetussa dhammassa hetupaccayena paccayo. Hetuyā tīṇi.*';
P_HTM[4575]='****54*. Naatītārammaṇaṃ ** nahetuṃ dhammaṃ paṭicca atītārammaṇo hetu dhammo uppajjati hetupaccayā… hetuyā sattarasa.*';
P_HTM[4576]='*20-21-1. Ajjhattattikadvaya-hetudukaṃ*';
P_HTM[4577]='****55*. Naajjhattaṃ nahetuṃ dhammaṃ paṭicca bahiddhā hetu dhammo uppajjati hetupaccayā.*';
P_HTM[4578]='*Nabahiddhā nahetuṃ dhammaṃ paṭicca ajjhatto hetu dhammo uppajjati hetupaccayā… hetuyā dve.*';
P_HTM[4579]='****56*. Naajjhattārammaṇaṃ nahetuṃ dhammaṃ paṭicca ajjhattārammaṇo hetu dhammo uppajjati hetupaccayā… dve.*';
P_HTM[4580]='*Nabahiddhārammaṇaṃ nahetuṃ dhammaṃ paṭicca bahiddhārammaṇo hetu dhammo uppajjati hetupaccayā… hetuyā cha.*';
P_HTM[4581]='*22-1. Sanidassanattika-hetudukaṃ*';
P_HTM[4582]='****57*. Nasanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca anidassanaappaṭigho hetu dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nahetuṃ dhammaṃ paṭicca anidassanaappaṭigho hetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nahetuñca naanidassanasappaṭighaṃ nahetuñca dhammaṃ paṭicca anidassanaappaṭigho hetu dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4583]='*Nasanidassanasappaṭighaṃ nanahetuṃ dhammaṃ paṭicca sanidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. Nasanidassanasappaṭighaṃ nanahetuṃ dhammaṃ paṭicca anidassanasappaṭigho nahetu dhammo uppajjati hetupaccayā. (Nahetu nanahetu ovattā, tīṇi mūlāni, ekavīsati pañhā kātabbā.)*';
P_HTM[4584]='*22-2. Sanidassanattika-sahetukadukaṃ*';
P_HTM[4585]='****58*. Nasanidassanasappaṭighaṃ nasahetukaṃ dhammaṃ paṭicca anidassanaappaṭigho sahetuko dhammo uppajjati hetupaccayā. Naanidassanasappaṭighaṃ nasahetukaṃ dhammaṃ paṭicca anidassanaappaṭigho sahetuko dhammo uppajjati hetupaccayā**. Nasanidassanasappaṭighaṃ nasahetukañca naanidassanasappaṭighaṃ nasahetukañca dhammaṃ paṭicca anidassanaappaṭigho sahetuko dhammo uppajjati hetupaccayā. Hetuyā tīṇi.*';
P_HTM[4586]='*Nasanidassanasappaṭighaṃ naahetukaṃ dhammaṃ paṭicca sanidassanasappaṭigho ahetuko dhammo uppajjati hetupaccayā… satta.*';
P_HTM[4587]='*Naanidassanasappaṭighaṃ naahetukaṃ dhammaṃ paṭicca anidassanasappaṭigho ahetuko dhammo uppajjati hetupaccayā… satta.*';
P_HTM[4588]='*Nasanidassanasappaṭighaṃ naahetukañca naanidassanasappaṭighaṃ naahetukañca dhammaṃ paṭicca anidassanasappaṭigho ahetuko dhammo uppajjati hetupaccayā… satta. Hetuyā ekavīsa.*';
P_HTM[4589]='*22-3-6. Sanidassanattika-hetusampayuttādidukāni*';
P_HTM[4590]='****59*. Nasanidassanasappaṭighaṃ nahetusampayuttaṃ dhammaṃ paṭicca anidassanaappaṭigho hetusampayutto dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4591]='*Nasanidassanasappaṭighaṃ nahetuvippayuttaṃ dhammaṃ paṭicca sanidassanasappaṭigho hetuvippayutto dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4592]='****60*. Nasanidassanasappaṭighaṃ nahetuñceva naahetukañca dhammaṃ paṭicca anidassanaappaṭigho hetu ceva sahetuko ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4593]='*Nasanidassanasappaṭighaṃ naahetukañceva nana ca hetuṃ dhammaṃ paṭicca anidassanaappaṭigho sahetuko ceva na ca hetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4594]='****61*. Nasanidassanasappaṭighaṃ nahetuñceva nahetuvippayuttañca dhammaṃ paṭicca anidassanaappaṭigho hetu ceva hetusampayutto ca dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4595]='*Nasanidassanasappaṭighaṃ nahetuvippayuttañceva nana ca hetuṃ dhammaṃ paṭicca anidassanaappaṭigho hetusampayutto ceva na ca hetu dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4596]='****62*. Nasanidassanasappaṭighaṃ ** nahetuṃ nasahetukaṃ dhammaṃ paṭicca anidassanaappaṭigho nahetu sahetuko dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4597]='*Nasanidassanasappaṭighaṃ nahetuṃ naahetukaṃ dhammaṃ paṭicca sanidassanasappaṭigho nahetu ahetuko dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4598]='*22-7-13. Sanidassanattika-cūḷantaradukāni*';
P_HTM[4599]='****63*. Nasanidassanasappaṭigho nasappaccayo dhammo anidassanaappaṭighassa sappaccayassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe tīṇi, adhipatiyā upanissaye tīṇi.*';
P_HTM[4600]='****64*. Nasanidassanasappaṭighaṃ nasanidassanaṃ dhammaṃ paṭicca sanidassanasappaṭigho sanidassano dhammo uppajjati hetupaccayā… hetuyā pañca.*';
P_HTM[4601]='*Naanidassanaappaṭigho nanasanidassano dhammo anidassanaappaṭighassa nasanidassanassa dhammassa ārammaṇapaccayena paccayo. (Saṃkhittaṃ.) Ārammaṇe tīṇi, adhipatiyā upanissaye purejāte atthiyā avigate tīṇi.*';
P_HTM[4602]='****65*. Nasanidassanasappaṭighaṃ nasappaṭighaṃ dhammaṃ paṭicca sanidassanasappaṭigho sappaṭigho dhammo uppajjati hetupaccayā… hetuyā nava.*';
P_HTM[4603]='*Nasanidassanasappaṭighaṃ * naappaṭighaṃ dhammaṃ paṭicca anidassanaappaṭigho appaṭigho dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4604]='****66*. Nasanidassanasappaṭighaṃ narūpiṃ dhammaṃ paṭicca sanidassanasappaṭigho rūpī dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4605]='*Nasanidassanasappaṭighaṃ naarūpiṃ dhammaṃ paṭicca anidassanaappaṭigho arūpī dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4606]='****67*. Nasanidassanasappaṭighaṃ nalokiyaṃ dhammaṃ paṭicca sanidassanasappaṭigho lokiyo dhammo uppajjati hetupaccayā… satta.*';
P_HTM[4607]='*Naanidassanasappaṭighaṃ ** nalokiyaṃ dhammaṃ paṭicca anidassanasappaṭigho lokiyo dhammo uppajjati hetupaccayā… satta. Hetuyā ekavīsa.*';
P_HTM[4608]='*Nasanidassanasappaṭighaṃ nalokuttaraṃ dhammaṃ paccayā anidassanaappaṭigho lokuttaro dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[4609]='*Nasanidassanasappaṭighaṃ nalokuttaraṃ dhammaṃ paccayā anidassanaappaṭigho lokuttaro dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi…pe… avigate tīṇi.*';
P_HTM[4610]='****68*. Nasanidassanasappaṭighaṃ nakenaci viññeyyaṃ dhammaṃ paṭicca sanidassanasappaṭigho kenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā pañcatiṃsa.*';
P_HTM[4611]='*Nasanidassanasappaṭighaṃ nanakenaci viññeyyaṃ dhammaṃ paṭicca sanidassanasappaṭigho nakenaci viññeyyo dhammo uppajjati hetupaccayā… hetuyā pañcatiṃsa.*';
P_HTM[4612]='*22-14-19. Sanidassanattika-āsavagocchakāni*';
P_HTM[4613]='****69*. Nasanidassanasappaṭighaṃ noāsavaṃ dhammaṃ paṭicca anidassanaappaṭigho āsavo dhammo uppajjati hetupaccayā… hetuyā tīṇi.*';
P_HTM[4614]='*Nasanidassanasappaṭighaṃ nanoāsavaṃ dhammaṃ paṭicca sanidassanasappaṭigho noāsavo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4615]='****70*. Nasanidassanasappaṭighaṃ nasāsavaṃ dhammaṃ paṭicca sanidassanasappaṭigho sāsavo dhammo uppajjati hetupaccayā… hetuyā ekavīsa.*';
P_HTM[4616]='*Nasanidassanasappaṭighaṃ naanāsavaṃ dhammaṃ paccayā anidassanaappaṭigho anāsavo dhammo uppajjati hetupaccayā. (Saṃkhittaṃ.) Hetuyā tīṇi…pe… avigate tīṇi.*';
