P_HTM[4807]='*Naakusalaṃ **nasanidassanasappaṭighañca naabyākataṃ nasanidassanasappaṭighañca dhammaṃ paṭicca abyākato sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ.*';
P_HTM[4808]='*Nakusalaṃ nasanidassanasappaṭighañca naakusalaṃ nasanidassanasappaṭighañca dhammaṃ paṭicca abyākato sanidassanasappaṭigho dhammo uppajjati hetupaccayā. Ekaṃ. Hetuyā cha.*';
